INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (2, 'a87f31924667bd8487ff800ff1829df1', 'hoi-lam-vuon-grosse-pointe', 'Hội Làm Vườn Grosse Pointe', 'Grosse Pointe Garden Society', 'https://phimimg.com/upload/vod/20250518-1/fc492d844ffa34d2a8cabaf4cc80803e.jpg', 'https://phimimg.com/upload/vod/20250518-1/336933b2c491a15a8b6c964bc62a9058.jpg', 2025, 'series', 'FHD', 'Vietsub', '42 phút/tập', 0, 'Khi bốn thành viên của một hội làm vườn bị vướng vào một vụ giết người tai tiếng, họ buộc phải chôn xác... trong những luống hoa được chăm sóc cẩn thận của chính mình. Ai cũng có bí mật… nhưng một số bí mật thì không bao giờ được chôn vùi.', 'completed', 'https://www.youtube.com/watch?v=iwJ8P6GZvkU', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Melissa Fumero, AnnaSophia Robb, Ben Rappaport, Aja Naomi King, Nancy Travis, Matthew Davis, Alexander Hodge, Felix Avitia', 'Jenna Bans', '2025-05-18 12:01:01.933', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (4, 'b2759da044ea9401e7e455f149116a40', 'ta-la-quan-chu-ta-ac-cua-quoc-gia-o-giua-muon-vi-sao', 'Ta Là Quân Chủ Tà Ác Của Quốc Gia Ở Giữa Muôn Vì Sao', 'I''m The Evil Lord Of An Intergalactic Empire', 'https://phimimg.com/upload/vod/20250411-1/4da86307ef9145ae7dd7985ee7227bdd.jpg', 'https://phimimg.com/upload/vod/20250411-1/171863a98466894a2f067a17ae39bb25.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Liam là một người chuyển sinh vào gia tộc bá tước cai quản một hành tinh nơi biên cảnh của Đế quốc thiên hà Algrand và đã trở thành gia chủ từ khi còn nhỏ. Vì phẫn uất với kiếp trước sống lương thiện nhưng bị chà đạp, Liam đã hạ quyết tâm kiếp này sẽ làm một quân chủ tà ác để chà đạp kẻ khác! &nbsp;Đây là một thế giới khoa học viễn tưởng nên Liam muốn được lái rô-bốt! Cậu thậm chí muốn học kiếm thuật mạnh nhất để tung hoành ngang dọc! Muốn xây dựng hậu cung và đắm chìm trong tửu sắc!
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (5, '3e6bf902e857e7ce80846480c79ded99', 'su-thanh-son-hai', 'Sư Thành Sơn Hải', 'Contenders', 'https://phimimg.com/upload/vod/20250502-1/dcdf67108a6973b891d33c48c642d07a.jpg', 'https://phimimg.com/upload/vod/20250502-1/ab626d33ab9ddde6d009e793af1f84d8.jpg', 2025, 'series', 'FHD', 'Vietsub', '22 phút/tập', 0, 'Cuối thập niên 40 thế kỷ 20, dọc bờ sông Malacca tập trung nhiều cộng đồng người Hoa đến mưu sinh. Trải qua năm tháng gian truân, đồng hương giúp đỡ lẫn nhau, kiên cường phấn đấu. Sau khi có chỗ đứng, một bang hội đầy huyền thoại là &quot;Sơn Hải Bang&quot; dần trở thành trung tâm phát triển của người Hoa nơi đây.', 'completed', 'https://www.youtube.com/watch?v=zczIUDkbo3o', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Nguy Tử,Dương Húc Văn,Vương Tử Vy,Nhạc Lệ Na', 'Cự Hưng Mậu', '2025-05-24 17:39:06.659', 'Hoàn Tất (48/48)', '48');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (6, '803815bbe0f321b3e4476f9af5fbe16f', 'quy-co-seon-ju-phuc-thu', 'Quý Cô Seon Ju Phục Thù', 'Desperate Mrs. Seon Ju', 'https://phimimg.com/upload/vod/20241120-1/05e935ee1659e79b7c50e9c8346aa2b1.jpg', 'https://phimimg.com/upload/vod/20241120-1/0d48bf417de0adb32b6812145b0ea317.jpg', 2024, 'series', 'FHD', 'Vietsub', '29 phút/tập', 0, 'Một người phụ nữ mạnh mẽ phá bỏ cuộc hôn nhân đầy bất hạnh của mình và xây dựng một &quot;ngôi nhà mới&quot; để bắt đầu lại từ đầu.', 'ongoing', 'https://www.youtube.com/watch?v=kKASGhblzVE', NULL, NULL, false, '[{"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Sim Yi Young,Song Chang Eui,Choi Jung Yoon,Joung Young Sub', 'Kim Heung Dong', '2025-05-24 17:39:21.404', 'Tập 121', '126');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (7, '26f6abfa0d7725fef678e371897d5df0', 'nhung-ngoi-sao-nhac-co-dien', 'Những Ngôi Sao Nhạc Cổ Điển', 'Classic Stars', 'https://phimimg.com/upload/vod/20250407-1/6517e015b88e3e276d13996b4b3f5a9a.jpg', 'https://phimimg.com/upload/vod/20250407-1/b04f5e321f28ee2d17d35abc2e9f1765.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Tại Học viện Tư thục Gloria – nơi quy tụ những tài năng trẻ được kỳ vọng trong tương lai trong các lĩnh vực âm nhạc, nghệ thuật, thể thao và giải trí – một dự án đặc biệt đang diễn ra. Tại khoa Âm nhạc, những học sinh có mức độ tương thích cao với “tài năng (tiềm năng)” của các nhà soạn nhạc vĩ đại trong quá khứ sẽ được cấy ghép “Gift” (món quà), và từ đó được gọi bằng tên của chính nhà soạn nhạc đó. Beethoven, một chàng trai trẻ tình cờ được phát hiện có mức độ tương thích sau một chấn thương, cũng trở thành một trong số họ. Cậu chuyển vào học viện và bắt đầu làm quen với những người bạn mang các “Gift” khác nhau. Cùng nhau, họ trải nghiệm sức hấp dẫn của âm nhạc và hướng tới chiến thắng trong các cuộc thi âm nhạc lớn. Một bản giao hưởng kỳ diệu nơi âm nhạc (Emotion) và không gian thực tế ảo (Visualize) hòa quyện – một **dự án mộng mơ nối tiếp ý chí của những nhạc sĩ vĩ đại tới tương lai – chính thức bắt đầu!', 'ongoing', 'https://www.youtube.com/watch?v=BnI0BqkjOrw', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-18 12:01:26.616', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (9, 'c8abeb065f097f73f7d1cecb33ed6da7', 'chuyen-tinh-cay-son-tra', 'Chuyện Tình Cây Sơn Tra', 'When The Hawthorn Blooms', 'https://phimimg.com/upload/vod/20250513-1/da10c19712659ec6440a6501520d9de8.jpg', 'https://phimimg.com/upload/vod/20250513-1/41a174b54fc5d44366fba629ab73da6c.jpg', 2025, 'series', 'FHD', 'Vietsub', '14 phút/tập', 0, 'Đầu những năm 70 của thế kỷ 20, Tịnh Thu, một cô gái có hoàn cảnh gia đình không tốt đã hưởng ứng lời kêu gọi của phong trào lên núi về nông thôn. Cô đến làng Tây Thôn Bình để đi thực tế sưu tầm tư liệu biên soạn lịch sử làng và tại đây, cô đã gặp Lão Tam – một chàng trai khôi ngô, tài hoa. Quá trình tiếp xúc đã khiến hai người dần nảy sinh tình cảm. Tuy nhiên, sự chênh lệch lớn về hoàn cảnh gia đình và địa vị xã hội đã đẩy mối tình của họ vào muôn vàn sóng gió. Liệu lời hẹn ước cùng nhau ngắm cây sơn tra nở hoa của họ có thành sự thật?', 'ongoing', NULL, NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Trương Gia Thạc, Từ Tiểu Thư, Cao Vũ Hàng, Triệu An Đệ', 'Dương Hoa', '2025-05-18 12:01:34.716', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (99, 'cf9bc13940118ba0d4b4e85f5c3d4c87', 'lam-chuyen-phan-5', 'Lắm Chuyện (Phần 5)', 'Big Mouth (Season 5)', 'https://phimimg.com/upload/vod/20240615-1/2519b29bfed8b839d8c98c5ecb305533.jpg', 'https://phimimg.com/upload/vod/20240615-1/d8ae9a6b09e2432633d9c56ec8bb7723.jpg', 2021, 'hoathinh', 'FHD', 'Vietsub', '26 phút/tập', 0, 'Bọ uyên ương và sâu bướm căm ghét len lỏi vào trái tim của các học sinh trung học Bridgeton, đưa đến những màn tỏ tình lãng mạn, những cơn giận điên và tin đồn ác ý.', 'completed', 'https://www.youtube.com/watch?v=yBbqLV1DzNI', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0c853f6238e0997ee318b646bb1978bc", "name": "Trẻ Em", "slug": "tre-em"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Nick Kroll, John Mulaney, Jessi Klein, Jason Mantzoukas, Jenny Slate, Fred Armisen, Maya Rudolph, Jordan Peele, Maria Bamford, Gina Rodriguez, David Thewlis, Ali Wong, Chelsea Peretti, Bobby Cannavale, Andrew Rannells, Zachary Quinto', 'Đang cập nhật', '2025-05-24 17:38:11.599', 'Hoàn Tất (10/10)', '10');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (8, 'ebfebc42d8f8dd67da25a2dcab4ac8ff', 'do-danh-vo-yeu', 'Dỗ Dành Vợ Yêu', 'Coaxing My Beloved Wife', 'https://phimimg.com/upload/vod/20250516-1/e27dea3744024d943ef3dacc78937f88.jpg', 'https://phimimg.com/upload/vod/20250516-1/9c4243b249d8c02cb5ed31177d24ccb4.jpg', 2025, 'series', 'FHD', 'Vietsub', '3 phút/tập', 0, 'Ngọc Diệp - mẹ đơn thân nuôi con sau khi tình một đêm với người đàn ông lạ mặt. Cô không hề hay biết rằng người đó chính là Tùng Lâm, tổng giám đốc lạnh lùng. Khi số phận đưa họ gặp lại, tình yêu dần nhen nhóm nhưng cũng đầy rẫy âm mưu từ kẻ thứ ba – Nhã Đan, người không từ thủ đoạn kể cả hại cả con của Ngọc Diệp. Vì để có tiền cứu con, Ngọc Diệp chấp nhận làm trợ lý cho Tùng Lâm, bất chấp hiểm nguy luôn rình rập. Liệu tình yêu có đủ lớn để vượt qua tất cả khi sự thật dần được phơi bày?', 'ongoing', 'https://www.youtube.com/watch?v=q9WIQ3x5V6s', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "f6ce1ae8b39af9d38d653b8a0890adb8", "name": "Việt Nam", "slug": "viet-nam"}]', 'Nhâm Phương Nam,Đàm Phương Linh', 'Đang cập nhật', '2025-05-24 17:39:00.412', 'Tập 9', '99');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (15, '940222ade2401c27cf112992065c8877', 'tinh-yeu-gia-tao', 'Tình Yêu Giả Tạo', 'Kill Lover', 'https://phimimg.com/upload/vod/20250504-1/3c1b0e320bdb203d97700b3e2da43a9c.jpg', 'https://phimimg.com/upload/vod/20250504-1/936cc301de56a847852f406c9a94187a.jpg', 2025, 'series', 'FHD', 'Vietsub', '38 phút/tập', 0, 'Vưu Vưu mất mẹ và cha bị tù vì âm mưu của An Quốc Hiên. Cô vô tình làm Tề Đông, con trai An Quốc Hiên, bị mù và vứt xuống biển. Sau khi được cứu, Tề Đông tự lập công ty đối đầu với Tập đoàn Tinh Diệu. Năm năm sau, Vưu Vưu trở lại với danh tính mới, Tề Cách Cách, tiếp cận Tề Đông để trả thù, nhưng phát hiện anh cũng muốn báo thù An Quốc Hiên. Hai người hợp tác, nhưng một mối đe dọa lớn hơn đang rình rập.', 'completed', NULL, NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wanyan Luorong, Sun Jiaqi, Yu Yifu, Fan Wei, Zhang Guansen, Liu Shuai', 'Tao Sheng', '2025-05-18 12:01:57.938', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (12, '4d70135cf4b09e7b072f9f78863f2600', 'ban-an-tu-qua-khu', 'Bản Án Từ Quá Khứ', 'See Her Again', 'https://phimimg.com/upload/vod/20250508-1/576075468d29d0762cec6f560d36abb2.jpg', 'https://phimimg.com/upload/vod/20250508-1/e0395f12f5d4b7941d45ce67194d29de.jpg', 2024, 'series', 'FHD', 'Vietsub + Thuyết Minh + Lồng Tiếng', '47 phút/tập', 0, 'Một loạt vụ án mạng bắt nguồn từ một vụ cháy chung cư lớn vào những năm 1990. Cảnh sát Hong Kong Dương Quang Diệu (Trần Vỹ Đình) vì lần theo dấu vết của hung thủ, gặp một sự cố xuyên không đến năm 2018. Tại đây anh gặp nữ cảnh sát Trần Khải Tinh (Lưu Nhã Sắt) tiếp tục hành trình tìm ra sự thật đằng sau vụ án kéo dài hơn 20 năm để bảo vệ những người mình yêu thương và giữ vững pháp luật, đòi lại công lý cho nạn nhân.', 'completed', 'https://www.youtube.com/watch?v=7AKCNVyqIZ0', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'William Chan,Liu Yase,Stephen Fung,Tse Kwan-Ho,Niki Chow,Kevin Chu,Alan Luk,Ling Man-Lung,He Dujuan,Kumer So', 'Wong Kwok Keung', '2025-05-24 17:41:26.846', 'Hoàn Tất (18/18)', '18');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (13, 'fa6f5467c4dfa53f6d0a5b94815bfc80', 'ba-lan-ga-cho-ma-quan', 'Ba Lần Gả Cho Ma Quân', 'Just Wanna Be With You', 'https://phimimg.com/upload/vod/20250513-1/9a9e048c68b7fd95b922d85205631ce6.jpg', 'https://phimimg.com/upload/vod/20250513-1/8ba73414fdf31fa11006f32e5bbc1c4c.jpg', 2025, 'series', 'FHD', 'Vietsub', '11 phút/tập', 0, 'Thần nữ của tộc Thương Vân – Giang Trĩ Ngư và thiếu niên ly tộc – Giang Cảnh Hoài, tình cờ gặp gỡ và nảy sinh tình cảm. Tình yêu của họ bị ngăn cấm bởi tộc trưởng Nam Cung Tiêu do khác biệt giai cấp. Không chỉ phản đối, ông còn giăng bẫy khiến cả hai hiểu lầm sâu sắc, từ yêu hóa hận.
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (14, 'b8fd187b3f6b41d95bbc6c831075f367', '2099', '2099', '2099', 'https://phimimg.com/upload/vod/20250516-1/0184a38c6e68602dc7a043614dc3c1f6.jpg', 'https://phimimg.com/upload/vod/20250516-1/577957f6c1e956824f7b056606fe0d57.jpg', 2025, 'series', 'FHD', 'Vietsub', '30 phút/tập', 0, 'Nhờ sự giúp đỡ của ái phi người máy sinh học 2099, vị vua vô dụng Trần Tiểu Hoa đã lột xác từ một người bỏ bê bản thân đến dũng cảm gánh vác trách nhiệm. Tuy nhiên, tất cả đều chỉ xảy ra trong thế giới ảo. Trần Tiểu Hoa ở thế giới thực đang sắp chết não. Người yêu Khương Đào của anh đánh đổi cả mạng sống để giúp anh tỉnh lại, giúp anh hoàn thành nhiệm vụ lội ngược dòng. Sau khi tỉnh lại, Trần Tiểu Hoa đối mặt với người yêu đang hôn mê. Lần này, đến lượt anh cứu cô ấy.', 'ongoing', '', NULL, 'popular_tv', false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lý Khê Nhuế,Tôn Trạch Nguyên,Lâm Gia Xuyên,Trương Khả Doanh,Chu Hạo Kỳ', 'Mã Vân Ngọc', '2025-05-24 17:37:47.38', 'Tập 15', '18');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (16, 'f8bf0d84e9b0e57f01008c4827d7fda5', 'van-gioi-doc-ton', 'Vạn Giới Độc Tôn', 'Ten Thousand Worlds', 'https://phimimg.com/upload/vod/20250308-1/25c9c7486b5de820475bd8fe0ccb316e.jpg', 'https://phimimg.com/upload/vod/20250308-1/4b81238b9844aa16e3f7e9ee8afdbc94.jpg', 2021, 'hoathinh', 'FHD', 'Vietsub', '10 phút/tập', 0, 'Với sự trợ giúp của Phượng Hoàng huyết mạch, Lâm Phong đã vượt qua mọi khó khăndần &nbsp;từng bước tiến lên trên con đường võ đạo. Anh trải qua những thử thách đầy nguy hiểm, chiến đấu với những đối thủ mạnh mẽ. Lâm Phong trở thành một cường giả được tôn kính.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-24 17:35:16.846', 'Tập 332', '386');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (18, '4a1fee2e159e5ba76e1a8b3f54634d19', 'trong-tong-mon-tru-ta-ra-tat-ca-deu-la-gian-diep', 'Trong Tông Môn Trừ Ta Ra Tất Cả Đều Là Gián Điệp', 'Everyone In The Sect, Except Me, Is An Undercover Agent', 'https://phimimg.com/upload/vod/20250219-1/38a3edcb90491413d8f3bc6b95c48229.jpg', 'https://phimimg.com/upload/vod/20250219-1/40d8c1b07a0ba5bed8a90d3753d6bf8e.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '11 phút/tập', 0, 'Một hacker huyền thoại tên Trần Ninh đã bị hệ thống AI truy sát rồi hi sinh để giải cứu nhân loại. Bất ngờ trở thành tông chủ của đệ nhất tông môn ở dị giới. Tuy nhiên, hắn phải đối mặt với việc toàn bộ tông môn đó đều là gián điệp và có thể bị hệ thống tấn công bất cứ lúc nào.', 'ongoing', '', NULL, 'anime', false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Yang Kaiqi,Shuang Zhao,Nie Xiying,李逸,Yitong Zhao,傅婷云', 'Tinghe Li', '2025-05-24 17:35:21.174', 'Tập 69', '120');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (23, '29ebacd5f103d32a0f2fda45fccd4a5c', 'dau-pha-thuong-khung-phan-5', 'Đấu Phá Thương Khung (Phần 5)', 'Fights Break Sphere (Season 5)', 'https://phimimg.com/upload/vod/20240822-1/58a4a1135f235b376641c5171d410b04.jpg', 'https://phimimg.com/upload/vod/20240822-1/27bfb98b2cf23111b0c11e82b0483fc4.jpg', 2022, 'hoathinh', 'FHD', 'Vietsub', '25 phút/tập', 0, 'Phim Đấu Phá Thương Khung: Chuyển thể từ tiểu thuyết cùng tên của tác giả Thiên Tàm Thổ Đậu. &nbsp;Tiêu Viêm là thiên tài tu luyện đấu khí của nhà họ Tiêu, 11 tuổi đã đột phá Thập Đoạn Đấu Chi Khí, trở thành đấu thủ trẻ tuổi nhất của gia tộc suốt trăm năm qua. Nhưng đến năm 12 tuổi, Tiêu Viêm bất ngờ mất đi khả năng tu luyện, chỉ còn lại Tam Đoạn Đấu Chi Khí. Trong 3 năm sau đó, nhà họ Tiêu cũng liên tiếp gặp nhiều bất trắc. &nbsp;Đúng vào lúc Tiêu Viêm tuyệt vọng nhất, một linh hồn xuất hiện từ trong chiếc nhẫn trên tay Tiêu Viêm, mở ra trước mắt Tiêu Viêm một cánh cửa hoàn toàn mới. Dưới sự giúp đỡ của Dược lão, Tiêu Viêm đã hồi phục và nâng cao được công lực của mình, đánh bại Nạp Lan Yên Nhiên khi giao hẹn ba năm đến. &nbsp;Nhưng không may là cha Tiêu Viêm lại bị Vân Lam tông bắt đi, Tiêu Viêm lại bắt đầu cuộc hành trình nhiều thử thách nhằm cứu thoát cha mình…', 'ongoing', 'https://www.youtube.com/watch?v=SLHuLkyHGXE', NULL, 'trending_now', true, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '劉三木,张沛,刘雨轩,蘇婉,祝俊,陳奕雯,楊夢露,文曉依,閻麼麼,夏磊,Dian Tao,张韦', 'Đang cập nhật', '2025-05-24 17:33:19.832', 'Tập 148', '157');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (22, 'd61a328561119583444e250036006e81', 'pham-nhan-tu-tien', 'Phàm Nhân Tu Tiên', 'A Record of a Mortal''s Journey to Immortality', 'https://phimimg.com/upload/vod/20240715-1/ed827a6e5d8f7c41aa0728403665cd87.jpg', 'https://phimimg.com/upload/vod/20240715-1/fe09a10062768cca301682eba6c8245b.jpg', 2020, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Phàm Nhân Tu Tiên là một câu chuyện Tiên Hiệp kể về Hàn Lập - Một người bình thường nhưng lại gặp vô vàn cơ duyên để bước đi trên con đường tu tiên, không phải anh hùng - cũng chẳng phải tiểu nhân, Hàn Lập từng bước khẳng định mình... Liệu Hàn Lập và người yêu có thể cùng bước trên con đường tu tiên và có một cái kết hoàn mỹ? Những thử thách nào đang chờ đợi bọn họ? Mời các bạn xem phim để biết thêm chi tiết nhé...', 'ongoing', 'https://www.youtube.com/watch?v=WSzxfY5OHG0', NULL, 'trending_now', true, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "2276b29204c46f75064735477890afd6", "name": "Thần Thoại", "slug": "than-thoai"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '錢文靑,宋伊人,李詩萌,徐佳琦,Yang Mo,谷江山,喬詩語,Fuzheng Zhang,Liangwei Hu,Rui Liu,He Ba', '王裕仁', '2025-05-24 17:36:30.438', 'Tập 144', '999');
