INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (31, '70770f6b84b0221aad9863719ee8c2d4', 'chuyen-tinh-cuu-long', 'Chuyện Tình Cửu Long', 'Kowloon Generic Romance', 'https://phimimg.com/upload/vod/20250406-1/ff65aefe44a5fe50885374a436cb8b5e.jpg', 'https://phimimg.com/upload/vod/20250406-1/776198b2dc9cfae2fd0b1e6398638b94.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '25 phút/tập', 0, 'Cửu Long Thành Trại: Nơi quá khứ, hiện tại và tương lai giao thoa. Giữa những con hẻm tấp nập, một bí ẩn đen tối đang dần hé lộ. Kujirai, tưởng chừng tìm thấy tình yêu với Kudo, bỗng phát hiện ra một tấm ảnh kỳ lạ: Kudo và một cô gái giống hệt cô, nhưng cô không hề có ký ức về điều đó. Liệu đây là điềm báo gì? Sự thật nào đang ẩn sau bức ảnh, và quá khứ bị lãng quên của Kujirai?', 'ongoing', 'https://www.youtube.com/watch?v=wIrH_z2TLqQ', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Haruka Shiraishi, Tomokazu Sugita, Ryotaro Okiayu, Taito Ban, Aoi Koga, Sayumi Suzushiro, Kengo Kawanishi', 'Đang cập nhật', '2025-05-18 09:51:42.479', NULL, NULL);
