INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (38, 'd865f737d6777cdadaa957a87662d7ea', 'hoang-tu-trong-mo', 'Hoàng Tử Trong Mơ', 'Your Highness', 'https://phimimg.com/upload/vod/20250517-1/4da577b9426e6073a2b7a9b4564d46e5.jpg', 'https://phimimg.com/upload/vod/20250517-1/62fdf242867465a02e5e8b7d936bdf5c.jpg', 2011, 'single', 'FHD', 'Vietsub', '102 phút', 0, 'Lấy bối cảnh thời kỳ trung cổ, “Your Highness” là bộ phim hành động hài kể về hai anh em hoàng tử, một người dũng cảm, hào hoa, đẹp trai luôn giải cứu các thiếu nữ yếu ớt, tiêu diệt loài rồng và chế ngự ác quỷ, một người thì tốt bụng nhưng vô dụng lúc nào cũng muốn trốn tránh lũ rồng, ác quỷ và những rắc rối thường ngày.', 'completed', 'https://www.youtube.com/watch?v=KS8wdVZqVrU', NULL, 'trending_now', true, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Danny McBride, James Franco, Natalie Portman, Zooey Deschanel, Justin Theroux, Toby Jones, Damian Lewis, Rasmus Hardiker, Simon Farnaby, Deobia Oparei, Charles Dance, B.J. Hogg, Matyelok Gibbs, Angela Pleasence, Anna Barry, Michael Clarke Duncan, Amber An', 'David Gordon Green', '2025-05-18 09:25:44.979', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (37, 'a3782ef3356e45ba3e6fa056fd2a8ce4', 'ke-nhin-thau-tro-gian', 'Kẻ Nhìn Thấu Trò Gian', 'Usogui', 'https://phimimg.com/upload/vod/20250517-1/9299960c6177bc9295d17622243cc280.jpg', 'https://phimimg.com/upload/vod/20250517-1/cc6f4bb9e04ff868b5157ef2b3008208.jpg', 2022, 'single', 'FHD', 'Vietsub', '119 phút', 0, 'Hội Kakerou là một tổ chức thống trị thế giới ngầm của Nhật Bản, là nơi cờ bạc được thăng hoa. Tại đây có các thành viên là những con bạc sừng sỏ và trọng tài - những người giám sát và thu hồi nợ khi các canh bạc đã hoàn thành. Madarame Baku là một con bạc bí ẩn có biệt danh là Usogui (có nghĩa là Kẻ ăn lời nói dối). Anh tham gia những trận cá cược đầy nguy hiểm, tìm ra những mánh khoé lừa đảo của đối thủ và đánh bại họ để vươn tới đỉnh cao của Kakerou.', 'completed', 'https://www.youtube.com/watch?v=mg4hqVhHn78', NULL, 'trending_now', true, '[{"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Ryusei Yokohama, Hayato Sano, Mai Shiraishi, Kanata Hongo, Win Morisaki, Kaito Sakurai, Hiroaki Murakami, Shohei Miura, Ryô Kimura, Shingo Tsurumi, Moe Yuki, Minoru Matsumoto, Satoshi Uekiya', 'Hideo Nakata', '2025-05-18 09:31:03.597', NULL, NULL);
