INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (42, '51a9c5784bc9459856a826362c057737', 'knock-out', 'Knock Out', 'Knock Out', 'https://phimimg.com/upload/vod/20250517-1/1ef0aa912dcaf60d79bcceb1bf7716c3.jpg', 'https://phimimg.com/upload/vod/20250517-1/af35cee6d00946bc89af16ce06957e06.jpg', 2025, 'series', 'FHD', 'Vietsub', '70 phút/tập', 0, 'Keen phát hiện ra bố mình vẫn đang gánh một khoản nợ khổng lồ, trong khi bản thân anh cũng không có cách nào xoay xở để trả món nợ của chính mình. Sau đó Keen tình cờ gặp Thun, một võ sĩ quyền anh có biệt danh là “Đại Bác”. Mối quan hệ giữa hai người dần trở nên thân thiết và cuối cùng phát triển thành một tình yêu đẹp, giúp họ cùng nhau vượt qua khó khăn và giải quyết được vấn đề nợ nần của Keen. Thế nhưng trong lúc không hay biết, họ lại bị cuốn vào thế giới quyền anh của thế lực đen tối, dẫn đến rắc rối lớn sau này.', 'ongoing', 'https://www.youtube.com/watch?v=y67ry0Z7__Y', NULL, 'popular_tv', false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Natsakan Chairote,Boripat Jamsat,Thanakrit Talasopon,Kantapon Chompupan,Narongdet Rungarun,Wi Wiset,Jakarin Puribhat,Rawipa Srisanguan,Ploiyukhon Rojanakatanyoo,Samart Payakaroon,Napassakorn Mitiam,Malys Choeysobhon', 'Đang cập nhật', '2025-05-24 17:37:36.839', 'Tập 3', '12');
