INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (40, 'f37cf9ea93740f0bd3177789c2b244e4', 'thu-thach-than-tuong', 'Thử Thách Thần Tượng', 'Running Man', 'https://phimimg.com/upload/vod/20241017-1/8ce53643bb316f8fb8dc3dddd955f2ce.jpg', 'https://phimimg.com/upload/vod/20241017-1/65a22ab2e96e79bfedf8ae96d955f72a.jpg', 2010, 'tvshows', 'FHD', 'Vietsub', '85 phút/tập', 0, 'Thử Thách Thần Tượng - RUNNING MAN là một show truyền hình hài hước thực tế của Hàn Quốc, ra mắt từ năm 2010 nhưng cho đến nay vẫn là một trong những chương trình giải trí được yêu thích nhất tại xứ sở kim chi. Với RUNNING MAN, đảm bảo các bạn sẽ phải &quot;cười lăn cười bò&quot; vì sự hài hước của các thành viên cũng như những nhiệm vụ oái ăm mà họ phải chịu đựng trong suốt chương trình. Ngoài 8 thành viên chính của RUNNING MAN gồm: Yoo Jae Suk, Ji Suk Jin, Kim Jong Kook, Lee Kwang Soo, Haha, Song Ji Hyo, Yang Se Chan và Jeon So Min, khán giả sẽ có dịp gặp gỡ những ngôi sao giải trí hàng đầu khác của Hàn Quốc, thậm chí là những ngôi sao Quốc tế tham gia RUNNING MAN trong vai trò khách mời đặc biệt.', 'ongoing', 'https://www.youtube.com/watch?v=v90RObJapJI', NULL, 'top_rated', true, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Yoo Jae Suk, Jeon So Min, Kim Jong Kook, HaHa, Song Ji Hyo, Yang Se Chan, Ji Suk Jin', 'Đang cập nhật', '2025-05-18 09:25:07.862', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (32, 'b628e37c03795232aea0b0addf6a192c', 'hoi-ban-trai-cua-bunny', 'Hội Bạn Trai Của Bunny', 'Crushology 101', 'https://phimimg.com/upload/vod/20250412-1/d419f5a92d42da8be1a49741bffa9fea.jpg', 'https://phimimg.com/upload/vod/20250412-1/4fab0c5138078b67c9cd769fdf4d7412.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '62 phút/tập', 0, '&quot;Hội bạn trai của Bunny&quot; lấy bối cảnh tại một trường đại học và kể về hành trình trưởng thành của Ban Hee-jin (Roh Jeong-eui). Là người không quá quan tâm đến ngoại hình, cô chỉ hẹn hò dựa trên tính cách. Vì vậy, cô quyết định yêu một chàng trai không quá điển trai nhưng lại có tính cách tốt. Tuy nhiên, sau một thời gian, Ban Hee-jin phát hiện ra rằng anh ta thực chất đã che giấu một bản chất không mấy tốt đẹp đằng sau vẻ ngoài bình thường ấy. Chịu tổn thương sâu sắc từ mối tình đầu đầy cay đắng, cô đưa ra quyết định: từ nay, cô sẽ chỉ hẹn hò với những chàng trai đẹp trai.', 'completed', 'https://www.youtube.com/watch?v=kvusRvDktpw', NULL, 'trending_now', true, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Roh Jeong-eui, Lee Chae-min, Cho Jun-young, Kim Hyun-jin, Choi Ji-su, Hong Min-gi, Nam Kyu-hee, Lee Ji-hoon, Kim Jae-hwa, Kim Min-cheol, Wang Bit-na, Kim Hyeon-mok, Jo Hyun-ah', 'Kim Ji-hoon', '2025-05-18 09:51:35.053', NULL, NULL);
