INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (28, '25a714b921e3a2ba54c452debb9b5584', 'nguoi-yeu-ma-cac-nha-si-khuyen-dung', 'Người Yêu Mà Các Nha Sĩ Khuyên Dùng', 'Sweet Tooth, Good Dentist', 'https://phimimg.com/upload/vod/20250324-1/bb3baff0d79119bdbd99b30a22a281b6.jpg', 'https://phimimg.com/upload/vod/20250324-1/899044209cf16474ce88172b7865f9c5.jpg', 2025, 'series', 'FHD', 'Vietsub', '50 phút/tập', 0, '&quot;Sont&quot; (Ohm Thipakorn), một sinh viên đại học có niềm đam mê bất tận với đồ ngọt, đã trải qua cú sốc lớn nhất đời mình khi phát hiện ra mình bị sâu răng! Điều này buộc cậu phải tìm đến nha sĩ &quot;Jay&quot; (Mark Pakin), một chàng bác sĩ điển trai với vẻ ngoài lạnh lùng nhưng lại có tính cách kỳ quặc. Ban đầu, cả hai như nước với lửa, chẳng hòa hợp. Tuy nhiên, khi Sont tiếp tục điều trị, cậu dần tự hỏi liệu sự quan tâm của Jay chỉ đơn thuần là trách nhiệm của một nha sĩ, hay đằng sau đó còn ẩn chứa điều gì đặc biệt hơn?', 'completed', 'https://www.youtube.com/watch?v=rNcKR4aOSag', NULL, 'popular_tv', false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Pakin Kunaanuwit,Thiphakorn Thitathan,Jitaraphol Potiwihok,Poon Mitpakdee,Benyapa Jeenprasom,Thitiwatchapol Suthabunditphong', 'Banchorn Vorasataree', '2025-05-24 17:37:13.516', 'Tập 9', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (60, 'ed3fc73e6c5e6b0723e9e7935f50947a', 'nha-tro-nhat-khac', 'Nhà Trọ Nhất Khắc', 'Maison Ikkoku', 'https://phimimg.com/upload/vod/20250524-1/344079ebf0ce0e8d99c273fb4b0f4783.jpg', 'https://phimimg.com/upload/vod/20250524-1/15aa749fcb5606f5e3ffa9730db4eee5.jpg', 1986, 'hoathinh', 'FHD', 'Vietsub', '26 phút/tập', 0, 'Như cái tên của tác phẩm đã nêu, câu chuyện xảy ra tại một nhà trọ mang tên là Nhất Khắc (Ikkoku). Người quản lý nhà trọ trước đó đã quyết định nghỉ hưu, và ông cử một phụ nữ trẻ tên là Otonashi Kyoko đến thay thế mình. Người quản lý xinh đẹp đã khiến Godai Yusaku, người học trò nghèo trọ ở phòng 5 thầm yêu thương. Tuy nhiên, Yusaku gặp rất nhiều khó khăn trong việc bày tỏ tình cảm với Kyoko. Những lần anh tỏ tình với Kyoko hầu như đều thất bại: hoặc anh bị người khác vô tình làm gián đoạn, hoặc anh làm Kyoko hiểu lầm và gây ra những tình huống dở khóc dở cười. Mọi chuyện trở nên rắc rối hơn khi Kyoko gia nhập một câu lạc bộ quần vợt dành cho phụ nữ, ở đó cô gặp Mitaka Shun, một người thanh niên giàu có, đẹp trai nhưng tốt bụng. Shun thực lòng yêu thương Kyoko và mong cô kết hôn với anh, nhưng Kyoko cảm thấy khó xử khi đứng trước tình cảm của Yusaku lẫn Shun. Tiếp đó, Nikaido Nozomu, một cậu học sinh 18 tuổi gia nhập &quot;cộng đồng&quot; Ikkoku để rồi cũng thầm thương cô quản lý xinh đẹp của khu nhà trọ. Và một điều ít ai biết là Kyoko đã từng có một người chồng yểu mệnh tên là Otonashi Soichiro, anh qua đời chỉ sáu tháng sau khi hai người kết hôn và hình ảnh người chồng quá cố vẫn còn rất sâu đậm trong trái tim Kyoko. Rõ ràng, đối với Yusaku, một người học trò nghèo, cục mịch và gặp nhiều lận đận trong thi cử, việc có được trái tim của Kyoko không hề đơn giản...', 'completed', 'https://www.youtube.com/watch?v=tuDvCVM0Qb8', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Issei Futamata,Sumi Shimamoto,Shigeru Chiba,Yuko Mita,Kazuyo Aoki,Akira Kamiya,Norio Wakamoto,Toshio Furukawa,Hiromi Tsuru,Minori Matsushima,Chika Sakamoto,Hisako Kyoda,Kazue Komiya,Kosei Tomita,Anna Cummer,Alexandra Carter,Andrea Libman,', 'Đang cập nhật', '2025-05-24 17:34:40.54', 'Hoàn Tất (96/96)', '96');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (25, 'f2fe4479d8861f09946a28965a67d436', 'anne-shirley', 'Anne Shirley', 'Anne Shirley', 'https://phimimg.com/upload/vod/20250419-1/c3d8cc4c8e6f1aa4f343edd0ebe02e3c.jpg', 'https://phimimg.com/upload/vod/20250419-1/4cbb90dddd3cd910557154e055a8e44b.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Từ trại trẻ mồ côi đến ngôi nhà Cuthbert, cuộc đời Anne Shirley, cô bé 11 tuổi đầy cá tính, rẽ sang một trang mới đầy bất ngờ. Marilla và Matthew tìm kiếm một cậu bé, nhưng lại nhận được Anne, một cô bé với trí tưởng tượng vô bờ. Anne Shirley không chỉ là câu chuyện về tuổi thơ, mà còn là hành trình trưởng thành đầy cảm xúc, nơi những cuộc gặp gỡ và chia ly định hình số phận. Liệu Anne sẽ viết nên câu chuyện cuộc đời mình như thế nào?', 'ongoing', 'https://www.youtube.com/watch?v=ENR9ybZwKyU', NULL, 'trending_now', true, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Honoka Inoue,Aya Nakamura,Yasunori Matsumoto,Naoya Miyase,Yume Miyamoto,Hikari Ota', 'Đang cập nhật', '2025-05-24 17:38:57.086', 'Tập 7', '12');
