INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (19, '68ff9c82826dcda9030b6b0990efc033', 'tham-tu-lung-danh-conan', 'Thám Tử Lừng Danh Conan', 'Detective Conan', 'https://phimimg.com/upload/vod/20240310-1/025424cf62248b9a7b54279ef5416e26.jpg', 'https://phimimg.com/upload/vod/20240310-1/2a39971cc29c2802259b918eb437a45b.jpg', 1996, 'hoathinh', 'FHD', 'Vietsub', '25 phút/tập', 0, 'Phim hoạt hình Conan bắt đầu sau vụ việc xảy ra tại công viên giải trí nổi tiếng Tropical Land tại khu tàu lượn siêu tốc. Kudo đang điều tra một trong hai người đàn ông có vẻ ngoài khả nghi được cho là nghi phạm trong vụ việc. Anh ta bị tấn công bởi một trong số họ có mật danh là Gin và đồng đội của anh ta tên là Vodka. Sau khi đánh Shinichi, Gin đã đưa cho anh ta một loại thuốc mà sau này được gọi là APTX 4869 để giết anh ta. Trên thực tế, chất độc có một tác dụng phụ hiếm gặp, biến Shinichi từ một cơ thể trưởng thành thành một đứa trẻ thay vì giết chết. Sau sự cố quan trọng, Shinichi về nhà và lấy tên là Conan Edogawa sau khi bị người bạn thời thơ ấu Ran gây áp lực. Shinichi đã cố gắng che giấu danh tính bí mật của mình với những người anh quan tâm để điều tra về tổ chức Áo Đen.', 'ongoing', NULL, NULL, 'anime', false, '[{"name": "Bí Ẩn"}, {"name": "Hài Hước"}]', '[{"name": "Nhật Bản"}]', 'Minami Takayama, Kappei Yamaguchi, Wakana Yamazaki, Akira Kamiya, Rikiya Koyama, Megumi Hayashibara, Kenichi Ogata, Yukiko Iwai, Wataru Takagi, Ikue Otani, Chafurin', 'Đang cập nhật', '2025-05-24 16:37:53.635', NULL, NULL);
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (3, 'd82604de52c7a4c0d104443d90790b81', 'tro-choi-bong-toi', 'Trò Chơi Bóng Tối', 'Game Of Shadows', 'https://phimimg.com/upload/vod/20250504-1/cfcaedab9f7c32e282655933de752ec3.jpg', 'https://phimimg.com/upload/vod/20250504-1/8f87baf2a6f221f2cd2dd9657ab37cf4.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Ái Phương là một doanh nhân xinh đẹp, tài năng nhưng luôn cô độc. Từ khi Linh Đan giúp đưa tro cốt của cha mẹ Ái Phương về nước, cả hai từ từ bắt đầu thân thiết như chị em ruột. Bất ngờ một hôm Linh Đan bị giết hại một cách bí ẩn. Không đưa ra được bằng chứng thuyết phục với Công An, Ái Phương quyết định tự mình điều tra.', 'ongoing', 'https://www.youtube.com/watch?v=V-wokqXoC30', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}]', '[{"id": "f6ce1ae8b39af9d38d653b8a0890adb8", "name": "Việt Nam", "slug": "viet-nam"}]', 'Chu Anh,Quang Sự,Karen Nguyễn,Nguyễn Xuân Hiệp,Dương Cường,Trần Anh Huy', 'Võ Ngọc,Trần Minh', '2025-05-24 17:33:14.813', 'Tập 30', '33');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (20, '21a38ed2ee0c2c081c31286d29db2acc', 'dau-la-dai-luc-2-tuyet-the-duong-mon', 'Đấu La Đại Lục 2 (Tuyệt Thế Đường Môn)', 'Soul Land 2 (The Peerless Tang Clan)', 'https://phimimg.com/upload/vod/20240103-1/af2ae10bcb72617994f00dce440205dc.jpg', 'https://phimimg.com/upload/vod/20240103-1/bbe888d771d0e6ff0f9935f8f6194c79.jpg', 2023, 'hoathinh', 'FDH', 'Vietsub', '22 phút/tập', 0, 'Nơi đây không có ma pháp, không có hơn thua, không có võ thuật, nhưng lại có võ hồn. Đường Môn suy thoái sau khi đã thành lập được vạn năm ở Đấu La Đại Lục. Một lớp anh tài xuất hiện, liệu thế hệ Thất quái Sử Lai Khắc mới này có chấn hưng được Đường Môn, viết nên bài ca tuyệt thế Đường Môn hay không? Hồn thú triệu năm, Tử Linh Thánh Pháp Thần nắm giữ Nhật Nguyệt Trích Tinh, hệ thống Hồn Đạo Khí hoàn toàn mới khiến Đường Môn suy yếu. Tất cả thần khí đều sẽ lần lượt xuất hiện. Ám khí Đường Môn liệu có chấn hưng được uy phong, Đường Môn có thể tái hiện được huy hoàng hay không?', 'ongoing', 'https://www.youtube.com/watch?v=jkO0PFKEFHk', NULL, 'latest_movies', true, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "578f80eb493b08d175c7a0c29687cbdf", "name": "Võ Thuật", "slug": "vo-thuat"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wei Zhai,Tao Dian,Dawei Liang,Yajing Tang,Kaiyin Sun,Xiyue Chen,Ying Huang,Chengyuan Li', 'Đang cập nhật', '2025-05-24 17:37:14.43', 'Tập 102', '108');
