INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (46, '68e3bf852693ad8a72f32fdfe50dc6d4', 'uchuujin-muumuu', 'Uchuujin MuuMuu', 'Me and the Alien MuMu / 宇宙人ムームー', 'https://phimimg.com/upload/vod/20250425-1/f09431aaa5a47579c8f25081efd7f3e4.jpg', 'https://phimimg.com/upload/vod/20250425-1/af03ec998910f569f7989b90ef68ead7.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Một người ngoài hành tinh giống như mèo từ một thiên hà xa xôi, muumuu, đến trên trái đất. Mục tiêu của anh là tìm hiểu về công nghệ thiết bị gia dụng trên trái đất để phục hồi công nghệ mà loài của anh đã mất. Nhân vật chính, Sakurako, có một cuộc sống đại học điển hình, nhưng mọi thứ thay đổi với sự xuất hiện của Muumuu! Những gì bắt đầu như một sự sống chung bất ngờ nhanh chóng biến thành một cơn lốc của các sự kiện hỗn loạn. Hóa học giữa Sakurako và Muumuu dẫn đến một cuộc phiêu lưu hài kịch siêu, đầy đủ thiết bị và mèo. (Nguồn: Hẻm núi Pony)', 'ongoing', 'https://www.youtube.com/watch?v=AmkNOLfYq1Q', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Momo Harumi,Etsuko Kozakura,Yasuyuki Kase,Gakuto Kajiwara,Yuriko Hibi,Hidenobu Kiuchi,Kentaro Kumagai,Yukiyo Fujii,Karin Takahashi,Katsuyuki Konishi', 'Đang cập nhật', '2025-05-24 17:33:22.796', 'Tập 7', '0');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (47, '4badf6fce1fb568ba4d71e1645e5da27', 'teogonia', 'Teogonia', 'Teogonia', 'https://phimimg.com/upload/vod/20250421-1/83262ce27707ba909fb4151a1006d017.jpg', 'https://phimimg.com/upload/vod/20250421-1/546b0e6a962b50a94a43b387eae00dad.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Trong một thế giới loạn lạc bởi chiến tranh giữa loài người và các bộ tộc á nhân, Kai – một cậu bé bình thường ở làng Rag – ngày ngày chiến đấu để bảo vệ quê hương. Giữa những trận chiến khốc liệt, cậu bất ngờ nhớ lại ký ức về một thế giới hiện đại mà mình chưa từng sống. Từ đó, Kai bị cuốn vào những biến cố lớn, bắt đầu hành trình trưởng thành giữa một thế giới đầy thử thách và hiểm nguy.', 'ongoing', 'https://www.youtube.com/watch?v=oq4T0Cj5Ki0', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Mutsumi Tamura,Kana Hanazawa,Yoshitsugu Matsuoka,Atsushi Miyauchi,Masaya Fukunishi,Manaka Iwami,Hana Tamegai,Hiroshi Naka,Banjo Ginga', 'Đang cập nhật', '2025-05-24 17:33:25.937', 'Tập 7', '12');
