INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (35, '4b9f946525b8fc99573ed7ef8f2918ea', 'diet-slime-suot-300-nam-toi-level-max-luc-nao-chang-hay-phan-2', 'Diệt Slime Suốt 300 Năm, Tôi Level Max Lúc Nào Chẳng Hay (Phần 2)', 'I''ve Been Killing Slimes For 300 Years And Maxed Out My Level (Season 2)', 'https://phimimg.com/upload/vod/20250410-1/164e6e40406d1e732b86b7c56ceeabdb.jpg', 'https://phimimg.com/upload/vod/20250410-1/46e4b13763445937844635b8e0be8577.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Aizawa Azusa là một kẻ “cuồng công việc”, không yêu đương, không bạn bè, không niềm vui và sở thích, cô cống hiến cuộc đời mình cho công việc. Và kết quả là Azusa chết vì làm việc quá sức. Nhờ phép màu, cô được tái sinh trong dáng hình của một phù thủy 17 tuổi trường sinh bất lão. Quyết tâm sống thật khác kiếp trước, Azusa nhàn nhã diệt slime suốt 300 năm và đã vô tình đạt max level. Sức mạnh đi đôi với những phiêu lưu mạo hiểm mới mà Azusa chưa từng đối mặt trong đời. Nhưng cũng nhờ đó mà cô có được niềm vui, có bạn vè và gia đình mới…', 'ongoing', 'https://www.youtube.com/watch?v=eF6BRlsqgbk', NULL, 'trending_now', true, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Aoi Yuki,Kaede Hondo,Sayaka Senbongi,Minami Tanaka,Sayaka Harada,Manami Numakura,Riho Sugiyama,Azumi Waki,Yukari Tamura', 'Đang cập nhật', '2025-05-24 17:33:38.259', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (49, '4703873a678a5cd835a7500d9a0948d1', 'thieu-hoa-nhuoc-cam', 'Thiều Hoa Nhược Cẩm', 'Youthful Glory', 'https://phimimg.com/upload/vod/20250519-1/168d93b4029d4038e06d38c0ec25164a.jpg', 'https://phimimg.com/upload/vod/20250519-1/5a11177fe7bf3d9e7a40c3aa0c21e5e6.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '46 phút/tập', 0, 'Thiều Hoa Nhược Cẩm kể về câu chuyện tình yêu của Minh Đàn, con gái của Tĩnh An hầu phủ và Giang Tự - chiến thần của Đại Hiển. Minh Đàn được ban hôn cho Giang Tự, nhưng sợ chàng là kẻ thô tục nên mới tìm cách lẻn vào quân doanh để xem mặt phu quân tương lai. Thế nhưng nàng không ngờ bản thân vừa gặp đã yêu. Giang Tự và Minh Đàn sau khi thành hôn bắt đầu trải qua mối tình nhiều ngọt ngào nhưng cũng lắm hoạn nạn, cuối cùng từ trong gian khó bồi đắp nên chân tình, cảm nhận được thế nào là hạnh phúc đích thực.', 'ongoing', 'https://www.youtube.com/watch?v=jMryyGoHlS0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Tống Uy Long,Bao Thượng Ân,Đại Lộ Oa,Kha Oánh,Bạch Thự,Tần Hiểu Huyên,Vương Khả,Toàn Y Luân,Dương Bác Tiêu,Tôn Tổ Quân', 'Mẫn Quốc Huy,Tạ Quốc Vĩ', '2025-05-24 17:33:46.249', 'Tập 12', '25');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (50, '902b29421f11bea0bec33126f1c34112', 'doraemon-nobita-du-hanh-bien-phuong-nam', 'Doraemon: Nobita Du Hành Biển Phương Nam', 'Doraemon: Nobita''s Great Adventure in the South Seas', 'https://phimimg.com/upload/vod/20250524-1/56a3660058e918732bc4ad335d02667f.jpg', 'https://phimimg.com/upload/vod/20250524-1/77fb8fd525c8f20616c97e2998f80eb7.jpg', 1998, 'hoathinh', 'FHD', 'Thuyết Minh', '91 phút', 0, 'Việc tìm kiếm tài liệu về biển để phục vụ cho công việc học tập sẽ khiến cánh cửa thần kỳ của Doraemon mở ra và đưa Nobita đến với Shizuka, Gian và Sueno dưới lòng đại dương sâu thẳm. Lần này những người bạn của chúng ta lên một con thuyền khổng lồ và độc đáo để tìm hiểu về những bí ẩn của biển và tìm kiếm kho báu. Điều mà không ai có thể tưởng tượng được là sự biến dạng của dòng không-thời gian sẽ dẫn họ đến thế kỷ XVII giữa một cơn bão lớn sẽ khiến họ bị đắm và nơi Doraemon đánh mất chiếc túi thần kỳ. Không còn thời gian để mất, những người bạn của chúng ta phải tìm ra một lối thoát. Liệu họ có thành công?', 'completed', '', NULL, NULL, false, '[{"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Kazuya Tatekabe,Noriko Ohara,Michiko Nomura,Tohru Emori,Paul Lucas', 'Tsutomu Shibayama', '2025-05-24 17:33:49.834', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (34, 'b61db6a910e3b66ec8c44f77a713aa37', 'khom-lung', 'Khom Lưng', 'The Prisoner Of Beauty', 'https://phimimg.com/upload/vod/20250513-1/9c9253d007ed14c446daf7e39d240104.jpg', 'https://phimimg.com/upload/vod/20250513-1/edc97b789edd9c655c8d3d485cd43816.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '45 phút/tập', 0, 'Khom Lưng khắc họa chuyện tình &quot;cưới trước yêu sau&quot; giữa tướng quân dũng mãnh Ngụy Thiệu và tiểu thư yếu thế Kiều Mạn. Dù luôn đau đáu mối thù diệt tộc, Ngụy Thiệu vẫn vì kế sinh nhai của muôn dân mà miễn cưỡng liên hôn với Kiều Mạn, con gái út của gia tộc trước kia từng phản bội Ngụy gia. Biết rõ đây chỉ là cuộc hôn nhân hữu danh vô thực, Kiều Mạn luôn sống vô cùng thận trọng và dè dặt ở Ngụy gia. Nhưng sau khi cùng nhau trải qua nhiều sóng gió, Kiều Mạn và Ngụy Thiệu dần bị thu hút bởi tài năng của nhau và nảy sinh tình cảm thật sự.', 'ongoing', 'https://www.youtube.com/watch?v=uOvXipz1qZ8', NULL, 'trending_now', true, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Tống Tổ Nhi,Lưu Vũ Ninh,Tuyên Lộ', 'Đặng Khoa', '2025-05-24 17:33:53.654', 'Tập 25', '36');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (62, '362f278d9150aaf7894f586b5682de06', 'thien-nhai-ca-nu', 'Thiên Nhai Ca Nữ', 'Song Bird', 'https://phimimg.com/upload/vod/20250524-1/4e4f09713d037965ba0e929d6f7fd933.jpg', 'https://phimimg.com/upload/vod/20250524-1/f16d3f96945b8c1e979238ab0d643253.jpg', 1989, 'series', 'HD', 'Lồng Tiếng', '43 phút/tập', 0, 'Phim chưa có nội dung.', 'completed', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Leon Lai,Nadia Chan Chung-Ling,Eddie Kwan Lai-Kit,Andy Tai Chi-Wai,Tam Bing-Man,Katherine Lau Ying-Hung,Lam Lei,Felix Lok Ying-Kwan,Wong Wai-Tak,Helen Ma Hoi-Lun,Vivian Tsang,Amy Wu Mei-Yee,Gregory Charles Rivers,Leung Oi,Chang Kin-Ming,Ho', 'Đang cập nhật', '2025-05-24 17:34:48.709', 'Hoàn Tất (20/20)', '20');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (52, '46b89a8af1f131b7cf92ef1e78befcbf', 'nguoc-dong-thoi-gian-de-yeu-anh-2018', 'Ngược Dòng Thời Gian Để Yêu Anh', 'Love Destiny', 'https://phimimg.com/upload/vod/20240927-1/b3ad4656a3efecf7da4b5339672fc7a2.jpg', 'https://phimimg.com/upload/vod/20240927-1/795141b3cbcecc48d4827281019e5dc7.jpg', 2018, 'series', 'FHD', 'Vietsub + Thuyết Minh', '107 phút/tập', 0, 'Karakate, quý nữ thời Ayudhaya sống ở thế kỉ XVII, tính tình đanh đá cay nghiệt, ganh ghét đố kị khiến bản thân mang tiếng xấu gần xa. Cuối cùng vì bị ác tâm che mờ mà muốn giết người để rồi nghiệp báo đến đòi mạng.
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (53, '76dbfb70bc7f07932585401638f1bb0e', 've-thoi-nao-thieu-nu-truyen-tranh', 'Vẽ Thôi Nào! Thiếu Nữ Truyện Tranh', 'The Comic Bang', 'https://phimimg.com/upload/vod/20250522-1/a61136ffc21889eac7f04e1a37f40b28.jpg', 'https://phimimg.com/upload/vod/20250522-1/f213fa6002387a040d855e7c1b1b1e3e.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '32 phút/tập', 0, 'Tả Thiên Đại tỏ tình với nam sinh Diệp Kỳ, ai ngờ anh ta lại tặng cô một bản ký tay và dụ cô nàng trở thành trợ lý vẽ nét cho mình. Hóa ra Diệp Kỳ, vị học bá lạnh lùng lại là một họa sĩ truyện tranh nổi tiếng! Những ngày bị nhầm thành fan, Tả Thiên Đại đã bước chân vào thế giới truyện tranh của Diệp Kỳ, gặp gỡ một nhóm bạn đặc biệt và đầy sự nổi bật. Cùng với họ, cô đã trải qua những tình huống hài hước, đôi khi rơi vào những tình huống tiêu cực nhưng đầy sức mạnh. Giữa những thăng trầm của mối quan hệ của hai người, cả nhóm cũng dần tiến gần hơn đến ước mơ về việc vẽ truyện tranh của mình.', 'ongoing', 'https://www.youtube.com/watch?v=OrNKLcAiTho', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Thẩm Nguyệt,Vương Kính Huyền,Chu Diễn Thần,Tăng Khả Ni,Ngô Vũ Hằng,Triệu Dịch Khâm,Vương Nhược Thiện,Hác Thiệu Văn,Trần Bách Dung,Nhạc Dược Lợi', 'Chung Thanh', '2025-05-24 17:34:04.27', 'Tập 10', '36');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (54, 'b6084eee5942341bee5b666423d284dc', 'than-do-ho-tham', 'Thần Đô Hồ Thám', 'Shendu Fox Detective', 'https://phimimg.com/upload/vod/20250523-1/ff93013d79b6b699bcd35a78f3d936d7.jpg', 'https://phimimg.com/upload/vod/20250523-1/4f2e58ead1fa9af2b3eaf1b800546cd7.jpg', 2025, 'series', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Thành Lạc Dương liên tiếp xảy ra nhiều vụ án giết người hàng loạt, nạn nhân đều là những thiếu nữ xuân thì. Trong phút chốc, cả thành bao trùm trong nỗi sợ hãi. Đại Lý Tự Thừa Hồ Chính Nghĩa nhận lệnh lúc nguy nan để truy tìm chân tướng. Thiếu niên giang hồ Lý Kiếm Tinh, vì muốn tìm ra sự thật của vụ án gia tộc bị diệt môn nên cố ý tiếp cận Hồ Chính Nghĩa... Phượng hoàng giết người, cô dâu hình nhân gỗ, từng vụ án kỳ lạ khó lường nối tiếp nhau. Một nhóm bằng hữu cùng kề vai sát cánh phiêu lưu, từ chỗ nghi ngờ lẫn nhau đến chỗ cùng chung hoạn nạn, sống chết có nhau.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Ấn Tiểu Thiên,Dương Nghiệp Minh,Vương Tử Phi ,Phạm Mộng', 'Niên Kiến Luân', '2025-05-24 17:34:07.853', 'Tập 8', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (55, '4daab94b22b63a9e47c1762083a4c9e0', 'mua-hoa-roi-gap-lai-chang', 'Mùa Hoa Rơi Gặp Lại Chàng', 'Love Never Fails', 'https://phimimg.com/upload/vod/20250428-1/1908024d2b0d0b738f32485770020c7e.jpg', 'https://phimimg.com/upload/vod/20250428-1/8ddc08cc5c27bc4c6f12a4990d2e0666.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Bộ phim được chuyển thể từ tiểu thuyết cùng tên “Yêu Không Bao Giờ Thất Bại” của tác giả Thục Khách, kể về chuyện thượng thần Cẩm Tú mong muốn giúp đỡ yêu tinh hoa trà Hồng Ngưng thành tiên. Nhưng hai người đã kết thành duyên phận nghìn năm, cuối cùng Hồng Ngưng đã giúp Cẩm Tú trở thành câu chuyện của loài người.', 'completed', 'https://www.youtube.com/watch?v=UUBTcqhnAqI', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lưu Học Nghĩa,Hồ Ý Hoàn,Ngao Thụy Bằng,Hứa Hiểu Nặc,Dương Lâm,Cảnh Nghiên Tuấn', 'Anh Anh Lữ', '2025-05-24 17:34:11.851', 'Hoàn Tất (40/40)', '40');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (10, 'a6cff0397725a493ba4047565693f84a', 'chiec-vong-ngoc-bich', 'Chiếc Vòng Ngọc Bích', 'The Jade Bracelet', 'https://phimimg.com/upload/vod/20250516-1/310c5e61b2546acd218ccef6228170eb.jpg', 'https://phimimg.com/upload/vod/20250516-1/5ad06a97dbb502ba71520a05c2286a85.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, '“Chiếc vòng ngọc bích” kể về câu chuyện tình dang dở của cô gái nghèo côi cút tên Lụa. Vì trót trao tình cho Thành Danh, cậu ba nhà họ Lê nổi tiếng trăng hoa, Lụa đã phải nhận kết cục bi thảm. Sông, kết tinh của tình yêu oan trái cũng trở thành hòn máu rơi vô thừa nhận. Không thể thực hiện di nguyện của cô bạn vắn số, Tâm, chàng trai cùng cảnh ngộ với Lụa quyết định sẽ cưu mang đứa bé bất hạnh ấy. Tám năm sau, Thành Danh vì muốn được thừa hưởng tài sản Lê gia đã bất chấp thủ đoạn cướp lại đứa con trai mà anh ta từng nhẫn tâm chối bỏ khi xưa. Trước quyền thế của cậu ba Danh, Tâm đành bất lực rời con. Trong khi đó, Nhung, người chị gái song sinh thất lạc từ nhỏ của Lụa vì muốn trả thù cho em gái và bảo vệ cháu mình đã tìm mọi cách bước chân vào nhà họ Lê trong thân phận của Lụa. Đó cũng là lúc hào môn dậy sóng vì oán thù xưa sống lại…', 'ongoing', 'https://www.youtube.com/watch?v=kI0dWtUEvfw', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "f6ce1ae8b39af9d38d653b8a0890adb8", "name": "Việt Nam", "slug": "viet-nam"}]', 'Hạ Anh,Anh Tài,Huỳnh Trường Thịnh,Lê Bê La,Đàm Phương Linh,Võ Thành Tâm', 'Nguyễn Dương', '2025-05-24 17:38:37.37', 'Tập 37', '50');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (41, '2354ec2849bd2954df8dd2f2199d58a2', 'ke-thu-than-yeu', 'Kẻ Thù Thân Yêu', 'Dear Enemy', 'https://phimimg.com/upload/vod/20250508-1/17d0878ff2f507eab9ab61e76765de29.jpg', 'https://phimimg.com/upload/vod/20250508-1/676ac92c8335dcf23d3a4aca96ebc182.jpg', 2025, 'series', 'FHD', 'Vietsub', '39 phút/tập', 0, 'Câu chuyện kể về La Mạn và Trần Khải Tây, hai người bạn thân từng có xuất phát điểm tương đồng và ngang tài ngang sức. Vài năm sau khi tốt nghiệp, họ gặp lại nhau nhưng hoàn cảnh lại hoàn toàn trái ngược. La Mạn, một biên kịch đã có chút danh tiếng, không hài lòng với thành tựu sự nghiệp, hy vọng thông qua hôn nhân để nâng tầm cuộc sống, đạt được địa vị ngang hàng với Trần Khải Tây. Trong khi đó, Trần Khải Tây, làm dâu hào môn lại phải đối mặt với sự chế nhạo, mỉa mai của La Mạn. Dù cũng có phản kháng nhưng cô lại đang mắc kẹt sâu trong vũng lầy hôn nhân, và việc cứu vãn tình yêu cùng cuộc hôn nhân trở nên cấp bách hơn bao giờ hết. Vào lúc mối quan hệ giữa hai người đầy sóng ngầm, Chung Khuynh Thành trẻ trung xinh đẹp xuất hiện và trở thành nhân vật mấu chốt trong cuộc cạnh tranh giữa họ...', 'ongoing', 'https://www.youtube.com/watch?v=fKbQiwVr4RQ', NULL, 'trending_now', true, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Cao Diệp,Trần Nghiên Hy,Viên Hoằng,Vạn Bằng,Lô Phương Sinh,Lư Đông Húc', 'Hoàng Thiên Nhân', '2025-05-24 17:34:15.431', 'Tập 23', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (56, 'cedb7f24376214d5fe503683cac8ab74', 'xin-hay-mac-no-vao-takaminesan', 'Xin Hãy Mặc Nó Vào, Takamine-san', 'Please Put Them On, Takamine-san', 'https://phimimg.com/upload/vod/20250429-1/d4a6cbbca2af5622c79adfb16b3e96bb.jpg', 'https://phimimg.com/upload/vod/20250429-1/0e378791ec0a77289ca4df29e1e05c47.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Chủ tịch hội học sinh, Takane Takamine, là một người đẹp không gì sánh bằng, và cô ấy thường không bao giờ kết giao với một người vô danh không bạn bè như Koushi Shirota. Tuy nhiên, sau khi nhìn thấy cô ấy cởi đồ, anh ấy buộc phải trở thành &quot;tủ quần áo&quot; di động của cô ấy khi cô ấy thay đồ lót suốt cả ngày. Nhưng việc Takamine cởi đồ không chỉ để trêu chọc—mà còn là chìa khóa để giải phóng sức mạnh bẻ cong thời gian của cô ấy.', 'ongoing', 'https://www.youtube.com/watch?v=0J5aJF1rl_E', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yurika Kubo,Daisuke Kasuya,Sumire Uesaka,Miyu Tomita', 'Đang cập nhật', '2025-05-24 17:34:18.808', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (57, 'fd11255337d0a02076a3915eb1344bd9', 'hoa-huong-duong-2025', 'Hoa Hướng Dương', 'We Girls', 'https://phimimg.com/upload/vod/20250524-1/7f7b0093582ce01ab09a5aaee87b6633.jpg', 'https://phimimg.com/upload/vod/20250524-1/b77e121027d2fbd02984144e4e23ec6b.jpg', 2025, 'single', 'FHD', 'Vietsub', '124 phút', 0, 'Vì muốn mua thiết bị cấy ghép ốc tai điện tử trị giá 200.000 tệ cho con gái, Cao Nguyệt Hương (do Triệu Lệ Dĩnh thủ vai) đã liều lĩnh phạm pháp và bị kết án tù. Tuy nhiên, chính trong khoảng thời gian bị giam giữ đó, cô đã kết bạn với Hắc Muội (do Lan Tây Á thủ vai), Đặng Hồng (Chuỵết Ni), Hồ Bình (Vương Cúc), và Quách Ái Mỹ (Thành Tiêu). Dù mỗi người một tính cách, họ đều có chung một tinh thần không khuất phục trước số phận, dũng cảm đối mặt với hiện thực nghiệt ngã. Trên hành trình vượt qua nghịch cảnh, họ luôn sát cánh bên nhau, cùng nhau vươn lên, sống như những bông hoa luôn hướng về phía mặt trời.', 'completed', 'https://www.youtube.com/watch?v=5Mg_GBrWXps', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Triệu Lệ Dĩnh,Lan Tây Á,Chuỵết Ni,Vương Cúc,Thành Tiêu,Vương Khiếu Vũ,Tiền Y,Dương Thần Tịch,Lý Huệ Quân,Trần Chấp Âm', 'Phùng Tiểu Cương', '2025-05-24 17:34:27.619', 'Full', '1');
