INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (63, 'e2eacaff46787bfeefcaa24cf35264c7', 'tho-san-yeu-tinh-titan-troi-day', 'Thợ Săn Yêu Tinh: Titan Trỗi Dậy', 'Trollhunters: Rise of the Titans', 'https://phimimg.com/upload/vod/20250524-1/1756340d37fdd9cd94ff8f1f64caac11.jpg', 'https://phimimg.com/upload/vod/20250524-1/7e173470c7997615b7db43992c63a23b.jpg', 2021, 'hoathinh', 'FHD', 'Vietsub + Lồng Tiếng', '106 phút', 0, 'Các anh hùng của “Thợ săn yêu tinh”, “Bộ ba trời giáng” và “Pháp sư” bắt tay chống lại kẻ thù mờ ám đe dọa chiếm lấy thế giới của họ – và tái thiết lập cả Trái đất.', 'completed', 'https://www.youtube.com/watch?v=6H4Y21Hg2L8', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Emile Hirsch,Lexi Medrano,Charlie Saxton,Kelsey Grammer,Alfred Molina,Steven Yeun,Nick Frost,Colin O&#039;Donoghue,Diego Luna,Tatiana Maslany,Nick Offerman,Cole Sand,Fred Tatasciore,Brian Blessed,Kay Bess,Piotr Michael,James Hong,Tom Kenn', 'Francisco Ruiz Velasco,Johane Matte,Andrew L. Schmidt', '2025-05-24 17:34:52.085', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (64, '0b7361b9b59ab639eb91b016ddb87421', 'hoa-dai-dong-noi-2025', 'Hoa Dại Đồng Nội', 'Wild Flowers', 'https://phimimg.com/upload/vod/20250524-1/2fe245641959890f0f237354c30070df.jpg', 'https://phimimg.com/upload/vod/20250524-1/ee6e6148fbf148b24432754dd223d528.jpg', 2023, 'single', 'FHD', 'Vietsub', '91 phút', 0, 'Kevin là một nam diễn viên điện ảnh quyến rũ, hiện đang quay phim tại một địa điểm hẻo lánh. Khi công việc kết thúc, họ đã tổ chức một buổi tiệc với dàn diễn viên, ngập tràn rượu và ma túy. Sau một đêm vui vẻ và ăn chơi thác loạn, Kevin khăng khăng muốn trở về thành phố, bất chấp những lời cảnh báo và khuyên ngăn của các đồng nghiệp rằng điều đó có thể rất nguy hiểm. Và như thể họ đã dự đoán trước điều gì sẽ xảy ra, Kevin mất lái khi đang lái xe và gặp tai nạn nghiêm trọng…', 'completed', 'https://www.youtube.com/watch?v=zKb7DI2zNiY', NULL, NULL, false, '[{"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "77dab2f81a6c8c9136efba7ab2c4c0f2", "name": "Philippines", "slug": "philippines"}]', 'Arron Villaflor,Sheila Snow,Chloe Jenna,Jeric Raval,Sheree,Marissa Sanchez,Gerald Madrid,Dominic Roco,Raul Morit,Dianne Moldez,Van Allen Ong,Chloe Mendoza', 'Jeffrey Hidalgo', '2025-05-24 17:34:55.679', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (65, '6fc6530065dd97671efc710510979dc9', 'doraemon-nobita-va-cuoc-phieu-luu-o-thanh-pho-day-cot', 'Doraemon: Nobita và Cuộc Phiêu Lưu Ở Thành Phố Dây Cót', 'Doraemon: Nobita and the Spiral City', 'https://phimimg.com/upload/vod/20250521-1/8edce8e6571f9809a40734cf46bcc77b.jpg', 'https://phimimg.com/upload/vod/20250521-1/c166c767c1dfaa794859a48f311017dc.jpg', 1997, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '99 phút', 0, 'Sau khi Suneo khoe khoang về việc có một trang trại, Nobita được hỏi liệu cậu có hay không, buộc miệng cậu nói có. Doraemon đã trúng một hàng chục giải xổ số trúng thưởng được những hành tinh vô dụng trong vành đai giữa sao Hỏa và sao Mộc. Khi Suneo và những người khác đến xem trang trại, Nobita đã tình cờ đọc được con số cuối cùng của dãy số xổ số cho cửa thần kỳ, dẫn họ đến một khu vực rộng lớn đẹp như mơ. Khi con ngựa đồ chơi của Nobita tung tăng xung quanh thích thú Suneo và những người khác bắt đầu tạo sự sống cho đồ chơi của họ và để chúng sống trong khu vực. Vì vậy, họ quyết định tạo ra thành phố đồng hồ của riêng mình.', 'completed', '', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kazuya Tatekabe,Kaneta Kimotsuki,Sachiko Chijimatsu,Nozomu Sasaki,Sumiko Shirakawa,Masashi Sugawara,Kaneto Shiozawa', 'Tsutomu Shibayama', '2025-05-24 17:34:59.053', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (66, 'db6040c329c81f77c902cc63b2b74aca', 'doraemon-nobita-va-chuyen-tau-toc-hanh-ngan-ha', 'Doraemon: Nobita và Chuyến Tàu Tốc Hành Ngân Hà', 'Doraemon: Nobita and the Galaxy Super-express', 'https://phimimg.com/upload/vod/20250521-1/3d8ab2d17007875837dae97b0ff4fe34.jpg', 'https://phimimg.com/upload/vod/20250521-1/734a09cb58215d54efe79c6d52a2c87a.jpg', 1996, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '97 phút', 0, 'Doraemon mất tích 3 ngày. Nhưng hóa ra sau đó, anh ta đã đi đến thế kỷ 22 để mua một vé tàu tốc hành thiên hà bí ẩn mà điểm đến là một bí mật cho đến khi hành khách đến đó và tận mắt chứng kiến.', 'completed', '', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kaneta Kimotsuki,Kazuya Tatekabe,Sachiko Chijimatsu,Ryoichi Tanaka,Junichi Sugawara,Kaneto Shiozawa,Kazue Ikura,Minoru Yada,Sakura Tange,Mitsuaki Madono,Yosuke Akimoto,Kenji Utsumi,Rei Sakuma,Koichi', 'Tsutomu Shibayama', '2025-05-24 17:35:02.242', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (67, '3f3267d02dea7f94781bd5a437733db3', 'doraemon-tuyen-tap-moi-nhat', 'Doraemon: Tuyển tập mới nhất', 'Doraemon: New Series', 'https://phimimg.com/upload/vod/20250108-1/2eea374f015f589cb6565f2e91be0347.jpg', 'https://phimimg.com/upload/vod/20250108-1/008f74495954be77b6495b44c98ce6b4.png', 2025, 'hoathinh', 'FHD', 'Vietsub', '21 phút/tập', 0, 'Tuyển tập phim hoạt hình Doraemon New Series được nhóm dịch Mon Fansub thực hiện.', 'ongoing', '', NULL, NULL, false, '[{"id": "0c853f6238e0997ee318b646bb1978bc", "name": "Trẻ Em", "slug": "tre-em"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-24 17:35:12.164', 'Tập 863', '0');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (68, '00c9761570bf06f1a1cbe59075518b0e', 'trieu-duong-chi-vu-da', 'Triêu Dương Chi Vu Dạ', 'The Dawn To The Night', 'https://phimimg.com/upload/vod/20250521-1/cc277bd459ae0ad5bd018b8b8b134007.jpg', 'https://phimimg.com/upload/vod/20250521-1/2701f79a79941bb3564430c7288b352a.jpg', 2025, 'series', 'FHD', 'Vietsub', '16 phút/tập', 0, 'Hoa Triêu Dương, một tu sĩ của phái Cổ Nguyệt nhân tộc đã bế quan năm trăm năm, đột phá cảnh giới thiên nhân, giết chết kẻ thù không đội trời chung là Tu La Dạ Thiên và bước vào ảo cảnh thang lên thiên đường. Nếu Hoa Triêu Dương muốn trở thành tiên nhân thực sự, phải thực hiện nguyện vọng cuối cùng của Dạ Thiên - cứu và ngăn cản hắn trở thành Tu La. Hoa Triêu Dương vì thế đã phong ấn linh hồn mình vào trong ngọc, luân hồi đi tìm Dạ Thiên kiếp trước, tiêu trừ tà niệm và đánh thức Dạ Thiên.', 'ongoing', 'https://www.youtube.com/watch?v=Pm84PFdxGdg', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Ngụy Thiên Hạo,Dụ Chung Lê,Hà Tử Di,Phan Mân Vĩnh', 'Đường Vạn Lí', '2025-05-24 17:35:24.247', 'Tập 12', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (69, '29353ce24ad093d9324c479b7a1bd107', 'thieu-dot-con-tim', 'Thiêu Đốt Con Tim', 'Love Beyond The Curse', 'https://phimimg.com/upload/vod/20250520-1/364c1fffc1ea474be18c22a6bdf40004.jpg', 'https://phimimg.com/upload/vod/20250520-1/6e058b9ca639740c3e137920f8b5be07.jpg', 2025, 'series', 'FHD', 'Vietsub', '13 phút/tập', 0, 'Sùng Dương của tộc Vĩnh Dạ trồng hoa Thực Dạ để kết liễu cuộc đời mình, thế nhưng hoa Thực Dạ lại mãi không nở, cho đến ngày gặp gỡ cô gái Viêm tộc là Quý Nam Tinh. Quý Nam Tinh bị nguyền rủa nếu muốn sống sót thì phải thành thân với Sùng Dương của tộc Vĩnh Dạ. Hai người, một hướng đến cái chết, một hướng đến sự sống, dần mở ra một cuộc tình đau thương cứu rỗi lẫn nhau…', 'ongoing', 'https://www.youtube.com/watch?v=CvOxsN226SQ', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đại Cao Chính,Hà Thích,Lưu Bác', 'Trương Minh Tả', '2025-05-24 17:35:28.444', 'Tập 14', '23');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (17, '0d14e3ef9e05269b449abdfcf5c8c60a', 'thang-cap-manh-nhat', 'Thăng Cấp Mạnh Nhất', 'The Strongest Upgrade, The Mightiest Level Up', 'https://phimimg.com/upload/vod/20250308-1/02bc24a35b294ea2ddc6d7240f5ef27d.jpg', 'https://phimimg.com/upload/vod/20250308-1/8afb345e4dfd00972423029ea7d9cc95.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '10 phút/tập', 0, 'Triệu Phóng mang theo hệ thống trò chơi xuyên đến dị giới, phát hiện mình lại là một thiếu gia phế vật bị phế võ công, bên cạnh chỉ có một thị nữ đi theo. Đối mặt với nghịch cảnh, Triệu Phóng không hề nản lòng, mà ngược lại, cảm thấy đây chính là cơ hội để thể hiện bản thân. Dựa vào kinh nghiệm chơi game dày dặn, hắn thành công tìm ra &quot;Bug&quot; của hệ thống, liều mạng cày cấp. Vượt qua vô số hiểm cảnh, tiến vào vô vàn bí cảnh, hoàn thành hàng loạt nhiệm vụ do hệ thống sắp đặt…', 'ongoing', 'https://www.youtube.com/watch?v=BSgXJ0PUWVg', NULL, 'anime', false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '清殇,Ying Shuai', 'Lei Fang', '2025-05-24 17:35:36.02', 'Tập 28', '40');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (75, '4ba3a8aaad152d230887da6a26610846', 'doraemon-nobita-va-ba-chang-hiep-si-mong-mo', 'Doraemon: Nobita và Ba Chàng Hiệp Sĩ Mộng Mơ', 'Doraemon: Nobita''s Three Visionary Swordsmen', 'https://phimimg.com/upload/vod/20250521-1/3ea1c9deeb19a16f472c78164d42f1d0.jpg', 'https://phimimg.com/upload/vod/20250521-1/f4a1392b6675476fb8d21857ba9c67e1.jpg', 1994, 'hoathinh', 'FHD', 'Lồng Tiếng', '99 phút', 0, 'Mệt mỏi vì liên tục gặp ác mộng, Nobita yêu cầu Doraemon mang đến một Cỗ máy ước mơ để Nobita có thể mơ bất cứ điều gì cậu muốn. Sau khi nỗ lực để có được một giấc mơ về sự sụp đổ của Atlantis không thành công, anh ta chọn một giấc mơ nơi anh ta đang ở trong một thế giới giả tưởng với nguồn cảm hứng từ &quot;Ba chàng lính ngự lâm&quot;. Nobita và những người bạn của mình phải cùng nhau đánh bại tên Vua độc ác trước khi hắn thoát khỏi giấc mơ của Nobita để đi vào giấc mơ của người khác.', 'completed', '', NULL, NULL, false, '[{"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kaneta Kimotsuki,Kazuya Tatekabe', 'Tsutomu Shibayama', '2025-05-24 17:36:07.255', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (70, '65df376cb19d1a208ea312d7f58c7579', 'doraemon-nobita-va-nhung-phap-su-gio-bi-an', 'Doraemon: Nobita và Những Pháp Sư Gió Bí Ẩn', 'Doraemon: Nobita and the Windmasters', 'https://phimimg.com/upload/vod/20250521-1/b868b6bdf13baf0a6cc90aaa8d022371.jpg', 'https://phimimg.com/upload/vod/20250521-1/c7241c40bbe8fba3ab85cf19c0ea501c.jpg', 2003, 'hoathinh', 'FHD', 'Lồng Tiếng', '84 phút', 0, 'Một ngày nọ, Nobita tình cờ gặp một quả cầu gió giống như một sinh vật đến từ một vùng đất xa xôi, bị thổi bay vào khu vực lân cận của họ sau cơn bão gần đây đi qua khu vực này. Nobita đặt tên cho nó là Fuuko. Cuối cùng, cậu, Doraemon và những người bạn của họ đưa nó đến một vùng nông thôn rộng lớn qua Cánh cửa bất kỳ. Tại đó, họ tìm hiểu về Làng Gió và Bão, và danh tính thực của Fuuko. Chẳng bao lâu nữa, Nobita và những người bạn của cậu phải bảo vệ Fuuko khỏi Làng Bão và Nobuo giờ đã bị chiếm hữu, người đang bị điều khiển bởi linh hồn của thủ lĩnh cũ của Làng Bão.', 'completed', '', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Michiko Nomura,Nobuyo Oyama,Noriko Ohara,Kaneta Kimotsuki,Kazuya Tatekabe', 'Tsutomu Shibayama', '2025-05-24 17:35:39.81', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (71, 'd74cb35426f3d808325876f45b69dbf1', 'doraemon-nobita-va-hon-dao-dieu-ki-cuoc-phieu-luu-cua-loai-thu', 'Doraemon: Nobita và Hòn Đảo Diệu Kì – Cuộc Phiêu Lưu Của Loài Thú', 'Doraemon: Nobita and the Island of Miracles – Animal Adventure', 'https://phimimg.com/upload/vod/20250521-1/36971d32bf271fd37497c7ad2e7f2671.jpg', 'https://phimimg.com/upload/vod/20250521-1/bbd241dab75fd43d6da28f11199c8fb5.jpg', 2012, 'hoathinh', 'FHD', 'Vietsub + Lồng Tiếng', '100 phút', 0, 'Nobita được mua cho một con bọ cánh cứng, Nobita đem nó đi đấu với Jaian nhưng lại bị thua nên Nobita nhờ Doraemon bắt cho mình một con khác để phục thù,trong lúc dò tìm bọ cánh cứng cho Nobita không may lại bắt dính loài khổng điểu cổ đại. Lo sợ khi đưa nó về thế giới cổ đại cũng sẽ diệt vong nên nhóm Doraemon đưa nó đến một nơi có tên là đảo Beregamondo. Ở đây nhóm bạn đã gặp người quản lý đảo, cô tiến sĩ Kelly. Do sơ suất nên Doraemon bị con khổng điểu lấy mất gậy lãng quên. Con khổng điểu ấy đã đánh rơi cậy gầu đó vào đầu Nobisuke/Dakke (ba Nobita lúc chạc tuổi Nobita).', 'completed', 'https://www.youtube.com/watch?v=uzQ0IRL9KEc', NULL, NULL, false, '[{"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Wasabi Mizuta,Megumi Oohara,Yumi Kakazu,Subaru Kimura,Tomokazu Seki,Nana Mizuki,Masako Nozawa,Atsuko Tanaka,Chiaki Fujimoto,Kotono Mitsuishi,Yasunori Matsumoto,Koichi Yamadera,Shihoko Hagino,Yuzuru Fujimoto,Naoki Tatsuta,Rikako Aikawa,Shun', 'Kōzō Kusuba', '2025-05-24 17:35:43.906', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (72, '4c74744a9c10b3001a1d9b87f86eb26f', 'thai-co-chien-hon', 'Thái Cổ Chiến Hồn', 'Ancient War Soul / Tai Gu Zhan Hun', 'https://phimimg.com/upload/vod/20250520-1/8fc321e71315997e7d07d0e9892efdfb.jpg', 'https://phimimg.com/upload/vod/20250520-1/49aa1d4a07451b524c3d6d82f3e6b40f.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '12 phút/tập', 0, 'Võ Đế một thời bị kẻ xấu hại nên đã bỏ mạng. Vạn năm sau trùng sinh vào một thiếu niên tên Tần Phong, một thiếu niên bình thường nhưng lại có số mệnh gian truân nghiệt ngã. Thức tỉnh thần hồn vô thượng, tu luyện võ đạo vô thượng. Sóng gió ập tới, hắn trai tài cùng vô số thiên kiêu. Một thời gian sau Tần Phong trở thành một huyền thoại anh hùng, chư thiên vạn giới đều phải run rẩy vì sợ trở lại của hắn.', 'ongoing', '', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Yi Qiu,Tang Yuhe', 'Wang Chengtao', '2025-05-24 17:35:48.514', 'Tập 13', '40');
