INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (21, '0055a5709f2388ee34e6a39c4719fccb', 'tuyet-the-chien-hon', 'Tuyệt Thế Chiến Hồn', 'Peerless Soul', 'https://phimimg.com/upload/vod/20250219-1/b880c627b5571d9afd22e58d056e772a.jpg', 'https://phimimg.com/upload/vod/20250219-1/b2facbf6cebbf66d0c728df0b75ad5b9.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Đại lục Thương Lam là nơi nếu muốn thành võ giả thì bắt buộc phải thức tỉnh được võ hồn, từ đó kết nối với trời đất, hấp thụ linh khí, tiến hành tu luyện. Thiếu niên bình thường Tần Nam thức tỉnh được Chiến Thần Chi Hồn để không ngừng trở nên mạnh, để báo đáp ơn tri ngộ của Tiêu Khinh Tuyết, đã trải qua bao trắc trở, bị cuốn vào những cuộc tranh đấu khốc liệt, cuối cùng danh chấn Thương Lam, đứng trên vạn người.', 'ongoing', '', NULL, 'anime', false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2276b29204c46f75064735477890afd6", "name": "Thần Thoại", "slug": "than-thoai"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-24 17:36:13.603', 'Tập 116', '120');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (76, 'd6305e4149bc8b9672b74d1021bb7eef', 'doraemon-nobita-va-vuong-quoc-tren-may', 'Doraemon: Nobita và Vương Quốc Trên Mây', 'Doraemon: Nobita and the Kingdom of Clouds', 'https://phimimg.com/upload/vod/20250521-1/2bd42420e47fbf84301d6a504ea18ba6.jpg', 'https://phimimg.com/upload/vod/20250521-1/53bf90587900f357d3f577fa3ffec4e7.jpg', 1992, 'hoathinh', 'FHD', 'Vietsub + Lồng Tiếng', '98 phút', 0, 'Doraemon đã sử dụng những bảo bối của mình để cùng với Nobita tạo ra thế giới của riêng cậu trên bầu trời, một đám mây khổng lồ. Trong cuộc hành trình trên đám mây, cả nhóm nhận ra những người ngoài hành tinh đang tìm cách phá hủy nền văn minh loài người vì thiếu cam kết với môi trường. Doraemon và nhóm bạn phải tìm đồng minh và thuyết phục những người trên mây trên Trái đất rằng có những người chiến đấu vì thiên nhiên. Trong cuộc phiêu lưu của mình, gặp gỡ những người bạn tốt, trải qua vô số nguy hiểm, chạm trán với động vật thời tiền sử và cố gắng để bảo vệ hành tinh của chúng ta.', 'completed', '', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kazuya Tatekabe,Kaneta Kimotsuki,Sachiko Chijimatsu,Masayuki Katô,Ryoichi Tanaka,Miki Ito,Akira Murayama', 'Tsutomu Shibayama', '2025-05-24 17:36:16.593', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (77, '2ad63b2ee1c70baedfadbe817528fc17', 'doraemon-nobita-va-vuong-quoc-robot', 'Doraemon: Nobita và Vương Quốc Robot', 'Doraemon: Nobita and the Robot Kingdom', 'https://phimimg.com/upload/vod/20250521-1/432748202226b7154c1dda476fa8b250.jpg', 'https://phimimg.com/upload/vod/20250521-1/75b53aba7a5e4f359c1d1e5f26138221.jpg', 2002, 'hoathinh', 'FHD', 'Vietsub + Lồng Tiếng', '80 phút', 0, 'Phim chưa có nội dung.', 'completed', '', NULL, NULL, false, '[{"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kaneta Kimotsuki,Kazuya Tatekabe,Houko Kuwashima,Chiharu Niiyama,Konishiki,Sachiko Chijimatsu,Masako Nozawa,Kazuko Sugiyama,Takanobu Hozumi,Toshiko Fujita,Banjo Ginga,Omi Minami,Bin Shimada,Nobuo To', 'Tsutomu Shibayama', '2025-05-24 17:36:21.932', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (78, '8d68054999f057b3eded106aa379bec9', 'sieu-nang-lap-phuong-sieu-pham', 'Siêu Năng Lập Phương: Siêu Phàm', 'Super Cube', 'https://phimimg.com/upload/vod/20250324-1/2392932232977da78bc4e68e542fea59.jpg', 'https://phimimg.com/upload/vod/20250324-1/ce7d987b2e78887a2d2d26ed8a742e1b.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '21 phút/tập', 0, 'Cậu thiếu niên bình thường Vương Tiểu Tu trong một sự cố bất ngờ đã nhận được &quot;Siêu Năng Lập Phương&quot; - hệ thống không gian từ văn minh vũ trụ chiều không gian tiên tiến, từ đó sở hữu năng lực phi phàm. Vì được cô gái mình yêu thầm đã lâu, cũng là hoa khôi của trường Thẩm Dao tỏ tình, Vương Tiểu Tu đã khiến tên côn đồ Tôn Tuấn, kẻ cũng theo đuổi Thẩm Dao tức giận. Nhờ sự thông minh và năng lực siêu nhiên, Vương Tiểu Tu đã hóa giải nguy hiểm, nhưng đồng thời cũng chuốc thêm nhiều rắc rối khác. Thẩm Dao bị một kẻ bí ẩn đưa đến thế giới của những người siêu phàm, Vương Tiểu Tu quyết tâm dấn thân vào hành trình cứu cô. Hãy đồng hành cùng Tiểu Tu chiến đấu trong thế giới kỳ ảo, và diễn giải sự công bằng và chính nghĩa trên con đường trở thành cường giả tuyệt thế !', 'completed', 'https://www.youtube.com/watch?v=pp7yzzwP44c', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Ye Zhiqiu,Jiang Yingjun,Zhangtaikang Chen,Zhenyan Liu,Tong Yin', 'Đang cập nhật', '2025-05-24 17:36:25.991', 'Hoàn Tất (12/12)', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (79, '34b192408688fdd73d2f323cb052d692', 'doraemon-nobita-va-nhung-dung-si-co-canh', 'Doraemon: Nobita và Những Dũng Sĩ Có Cánh', 'Doraemon: Nobita and the Winged Braves', 'https://phimimg.com/upload/vod/20250521-1/82f0cee07b135d83c89f47ca6043f479.jpg', 'https://phimimg.com/upload/vod/20250521-1/c13bc9759142bc85240151f21ce976ee.jpg', 2001, 'hoathinh', 'FHD', 'Vietsub', '91 phút', 0, 'Sau khi xem chương trình truyền hình về loài chim và một loài được cho là có hình người được phát hiện ở Châu Phi, Nobita mơ ước có thể &nbsp;được bay bằng đôi cánh. Cậu ta tạo ra đôi cánh bằng gỗ sau khi Doraemon từ chối giúp đỡ cậu ấy , dù nhiều lần thất bại với đôi cánh tự chế của mình. Trong khi giúp Shizuka lấy lại con chim hoàng yến cưng của mình, họ chứng kiến một cánh cổng mở ra trên bầu trời và một con chim hình người cưỡi máy bay lao ra. Anh ta tự giới thiệu mình là Gusuke, một người chim sống ở &quot;Birdopia&quot;. Doraemon, Nobita và Shizuka giúp Gusuke sửa chiếc máy bay của mình, và Nobita nhanh chóng trở thành bạn của cậu. Khi Gusuke trở về nhà của mình, Gian và Suneo đã bắt được anh ta và lấy máy bay của anh ta. Ba người còn lại theo họ qua cổng', 'completed', '', NULL, NULL, false, '[{"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nobuyo Oyama,Noriko Ohara,Michiko Nomura,Kazuya Tatekabe,Kaneta Kimotsuki,Sachiko Chijimatsu,Rina Chinen,Daisuke Gori,Kyoko Hikami,Yasunori Matsumoto,Hisaya Morishige,Ai Orikasa,Bin Shimada,Sumiko Shirakawa,Ichiro Nagai', 'Tsutomu Shibayama', '2025-05-24 17:36:33.776', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (80, '680c256fb6e2c27e27a9d268e8379690', 'nhat-ky-cua-me', 'Nhật Ký Của Mẹ', 'My Little Old Boy', 'https://phimimg.com/upload/vod/20250309-1/ca480b54cd2ca6060c6b1e5b7f3abceb.jpg', 'https://phimimg.com/upload/vod/20250309-1/68a1b2439bec4f1f79820d4ddd6a1e8b.jpg', 2016, 'tvshows', 'FHD', 'Vietsub', '100 phút/tập', 0, 'Bạn hiểu bao nhiêu về cậu con trai đã trưởng thành của mình? Trong “Nhật Ký Của Mẹ”, cuộc sống thường nhật của những người con trai nổi tiếng nay đã trưởng thành được các bà mẹ theo dõi một cách cẩn thận và đầy yêu thương. Bạn có biết vì sao dạo này con trai mình hay uống rượu không? Bạn hiểu bao nhiêu về triết lý sống và lối sống của con mình? “Nhật Ký Của Mẹ” mang đến những khoảnh khắc xúc động, nơi tình mẫu tử được thể hiện qua sự quan sát và thấu hiểu – một cuộc đối thoại không lời nhưng đầy gắn kết giữa mẹ và con trai.', 'ongoing', 'https://www.youtube.com/watch?v=hDXK_LYvS1M', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Shin Dong-yup,Seo Jang-hoon', 'Kwak Seung-young', '2025-05-24 17:36:38.18', 'Tập 443', '480');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (81, '7cbc8120edbc9108520a43532f5439a6', 'doraemon-nobita-va-me-cung-thiec', 'Doraemon: Nobita và Mê Cung Thiếc', 'Doraemon: Nobita and the Tin Labyrinth', 'https://phimimg.com/upload/vod/20250521-1/a8cf6f67a982cb577331561b4feb4a44.jpg', 'https://phimimg.com/upload/vod/20250521-1/7460d3da1db05f1bb0e9052b6ea88c37.jpg', 1993, 'hoathinh', 'FHD', 'Vietsub', '100 phút', 0, 'Bố Nobita tình cờ thấy một quảng cáo kỳ lạ về một khu nghỉ dưỡng tuyệt vời trên truyền hình vào lúc nửa đêm. Đang buồn ngủ, anh ấy đặt chỗ trước dù thậm chí không nhận ra mình đang nói chuyện với quảng cáo. Ngày hôm sau, anh thảo luận với gia đình về kế hoạch kỳ nghỉ của họ, chỉ để nhận ra rằng anh không thể tìm thấy nơi nào trên trái đất. Đột nhiên, mặc dù có một chiếc vali trong phòng Nobita và bị tò mò như vậy, cậu mở nó ra chỉ để tìm thấy cánh cổng dẫn đến một khu nghỉ dưỡng xinh đẹp được quản lý bởi những con rô bốt thiếc. Vẫn tốt hơn, nó hoàn toàn miễn phí. Có vẻ như có một chương trình nghị sự ẩn đằng sau người mời họ đến đó.', 'completed', '', NULL, NULL, false, '[{"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Noriko Ohara,Michiko Nomura,Kazuya Tatekabe,Sachiko Chijimatsu,Yôsuke Naka,Kaneta Kimotsuki,Nobuyo Oyama', 'Tsutomu Shibayama', '2025-05-24 17:36:47.088', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (82, '83e1adbd4772ca2758d087bc632ec9eb', 'nguoi-danh-cap-trai-tim-toi', 'Người Đánh Cắp Trái Tim Tôi', 'Took My Heart Away', 'https://phimimg.com/upload/vod/20250523-1/cc708eb0c3c1a3b37d804fc282849d1d.jpg', 'https://phimimg.com/upload/vod/20250523-1/74791e94994d3e4390e48a23408bc1c2.jpg', 2025, 'series', 'FHD', 'Vietsub', '17 phút/tập', 0, 'Phim kể về thủ lĩnh Ảnh Thám – Phương Nhàn, buộc phải che giấu thân phận để kết hôn gả vào hào môn họ Khám. Anh tình cờ kết hôn với Khám Mỹ Viện – người con gái mà anh đã thầm yêu từ lâu nhưng cô lại luôn chống đối cuộc hôn nhân sắp đặt này. Một nụ hôn bất ngờ đã kích hoạt hiện tượng hoán đổi linh hồn, khiến hai người phải miễn cưỡng hợp tác trong hoàn cảnh trớ trêu khi bị hoán đổi thân xác. Khám Mỹ Viện ban đầu cố tình bày mưu gây khó dễ để thoát khỏi cuộc hôn nhân, nhưng Phương Nhàn lại dùng những chiêu trò kỳ lạ như mở tiệc cưới kiểu &quot;dòng nước chảy&quot;, liệu pháp trị liệu bằng cá để vực dậy ngành kinh doanh nhà tắm của gia tộc, khiến cô bắt đầu nhìn anh bằng con mắt khác. Đặc biệt, khi gặp nguy hiểm, cô tận mắt chứng kiến Phương Nhàn không ngại nguy hiểm, hy sinh cứu mình, từ đó tình cảm dần nảy sinh.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wang Luqing,Samuel Liu,Gao Xiaoyu,Ye Yi,Wang Miaomiao,Zhou Liaoke', 'Đang cập nhật', '2025-05-24 17:36:53.232', 'Tập 20', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (1, '10a55f345c206822c64a07d7728aef73', 'thien-kim-nhat-trich', 'Thiên Kim Nhất Trịch', 'All In', 'https://phimimg.com/upload/vod/20250518-1/cec6e99314fa939eae06bc9218cdcff1.jpg', 'https://phimimg.com/upload/vod/20250518-1/1d297f02b8b71d60abc1c78bdc77f264.jpg', 2025, 'series', 'FHD', 'Vietsub', '13 phút/tập', 0, 'Vưu Hạo Uẩn, học trò của một thần bài, bị mất trí nhớ và được gia đình Hách Kim Kim cưu mang. Việc anh vô tình bộc lộ kỹ năng cờ bạc đã cuốn anh vào một loạt rắc rối: Tôn Ức Thiên tìm cách lôi kéo anh nhằm tranh giành quyền lực gia tộc; Hách Kim Kim, vốn căm ghét cờ bạc, lại hiểu lầm anh; trong khi đó, Nặc Nhấtliên tục ép anh tham gia vào các ván độ. Sự xuất hiện của Hạ Trĩ, một góa phụ đang một mình nuôi con, đã vô tình làm bại lộ thân phận thực sự của Vưu Hạo Uẩn, đồng thời dẫn đến việc tìm ra hung thủ của một vụ án mạng nghiêm trọng. Vưu Hạo Uẩn buộc phải vận dụng tài năng cờ bạc của mình để phá giải bế tắc, qua đó vạch trần sự thật đằng sau những mánh khóe lừa đảo tinh vi trong xã hội.', 'ongoing', '', NULL, 'popular_tv', false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lưu Kiếm Vũ,Minh Duyệt,Lý Tụng Từ,Thượng Na,Vương Lý Đan Ni', 'Khúc Thế Hàng', '2025-05-24 17:36:55.924', 'Tập 16', '26');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (83, '92759f3b989bd57b544abacd6cf92d32', 'ngu-uyen-lenh', 'Ngự Uyên Lệnh', 'Love Rewritten', 'https://phimimg.com/upload/vod/20250519-1/1a9f621e4b09507c457e4d412624251d.jpg', 'https://phimimg.com/upload/vod/20250519-1/3cf902d8bb1a366a317acad90c076ec1.jpg', 2025, 'series', 'FHD', 'Vietsub', '14 phút/tập', 0, 'Một vụ ám sát bất ngờ đã khiến Tiêu Cảnh Dương và Lâm Minh Huyên – cặp đôi vốn đã định ly hôn – không chỉ bị hoán đổi linh hồn cho nhau mà còn trùng sinh trở về thời điểm trước khi họ thành hôn. Cả hai buộc phải cùng nhau tìm cách để hoán đổi thân xác trở lại. Ngay khi vừa trở lại thân xác của mình và mọi hiểu lầm tưởng chừng sắp được hóa giải, Tiêu Cảnh Dương lại chọn cách đẩy Lâm Minh Huyên ra xa. Tuy nhiên, cô vẫn phát hiện ra bí mật mà anh cố gắng che giấu. Vì vậy, đứng trước ranh giới sinh tử và giữa lúc các thế lực đen tối đang ngấm ngầm trỗi dậy, lần này, Lâm Minh Huyên quyết tâm sẽ cùng Tiêu Cảnh Dương nắm chặt tay nhau, đối mặt với mọi chuyện.', 'completed', 'https://www.youtube.com/watch?v=_zBscumVoww', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Triệu Việt,Đới Cảnh Diệu,Lý Nhược Gia,Lâm Á Đông', 'Nhậm Đình Lộ', '2025-05-24 17:36:56.815', 'Hoàn Tất (24/24)', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (24, 'da90fdf234654eb69d7d14654641134f', 'luyen-khi-muoi-van-nam', 'Luyện Khí Mười Vạn Năm', 'One Hundred Thousand Years of Qi Refining', 'https://phimimg.com/upload/vod/20250219-1/0ddffeb590aa6bad556a0724302487ad.jpg', 'https://phimimg.com/upload/vod/20250219-1/9e7246fa85194e2fad2da74ce43f0c7d.jpg', 2023, 'hoathinh', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Mười vạn năm trước Thiên Lam Tông vang dội giới tu chân, đệ tử trong tông đều là những đứa con của trời, đánh đâu thắng đó. Chỉ có khai sơn đệ tử Từ Dương vẫn luôn ở Luyện Khí kỳ, để đột phá tu vi sớm ngày phi thăng, Từ Dương bế quan vạn năm. Ai ngờ trong thời gian bế quan giới tu chân đã xuống dốc, Thiên Lam Tông cũng chỉ còn vài ba đệ tử, thấy sắp phải đối mặt với diệt tông, Từ Dương đánh bại cường địch, thề sẽ dẫn dắt Thiên Lam Tông quay về đỉnh cao!', 'ongoing', '', NULL, 'latest_movies', true, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-24 17:37:03.784', 'Tập 243', '260');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (85, '235d345c2ab5e66d05754f2129ed5c06', 'hay-cham-soc-5-anh-em-dai-bang', 'Hãy Chăm Sóc 5 Anh Em Đại Bàng', 'For Eagle Brothers', 'https://phimimg.com/upload/vod/20250203-1/74726bd36e4abe6edeef97ccebe00b07.jpg', 'https://phimimg.com/upload/vod/20250203-1/b9d63541b87aedd2d567070938dbc5d4.jpg', 2025, 'series', 'FHD', 'Vietsub', '67 phút/tập', 0, 'Ma Gwang Suk là trưởng phòng tại Bưu điện Shiwan, 45 tuổi và độc thân. Cô gặp O Jang Su, người là CEO của Eagle Brewery, và họ quyết định kết hôn. Tuy nhiên, chỉ 10 ngày sau khi kết hôn, O Jang Su gặp tai nạn và qua đời. Ma Gwang Suk tiếp quản nhà máy bia và trở thành trụ cột cho 4 người em chồng của mình.', 'ongoing', 'https://www.youtube.com/watch?v=jzGxBrllRMo', NULL, 'popular_tv', false, '[{"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Ahn Jae-wook,Uhm Ji-won,Lee Pil-mo,Choi Dae-chul,Kim Dong-wan,Yoon Park,Yoo In-young,Park Joon-geum,Kim Joon-bae,Choi Byung-mo,Bae Hae-seon,Park Hyo-ju,Kim Seung-yun,Shin Seul-ki', 'Choi Sang Yeol', '2025-05-24 17:37:21.377', 'Tập 32', '50');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (84, 'f48db3cd91ebb288ff33e95493b6329b', 'muon-duoc-o-gan-em', 'Muốn Được Ở Gần Em', 'Close To You', 'https://phimimg.com/upload/vod/20250520-1/d2829c38d70b83b4ed55d3472dbdc19f.jpg', 'https://phimimg.com/upload/vod/20250520-1/b7b8ac6a083e968796064d7be83d74c7.jpg', 2025, 'series', 'FHD', 'Vietsub', '18 phút/tập', 0, 'Minh Hy - một cô gái bình thường bất ngờ nhận được cơ hội vào học tại Học viện Tinh Anh. Để hoàn thành kỳ vọng của người cha đã khuất, cô quyết tâm phát huy tài năng thể thao thiên bẩm tại ngôi trường danh giá này. Trong khi đó, Giang Bạc Hãn - chàng trai tài năng xuất chúng nhưng mang trong lòng nỗi đau mất em trai, đã cố tình khoác lên mình vỏ bọc của một học sinh cá biệt ngỗ ngược để chống lại sự xa cách với mẹ. Hai con người mang những lớp vỏ ngụy trang ấy bỗng chốc vướng vào cuộc đời nhau. Họ giằng xé, đối đầu, rồi lại cứu rỗi lẫn nhau. Những vết sẹo trong lòng dần được phơi bày, và cũng chính họ lại trở thành liều thuốc dịu dàng nhất chữa lành cho nhau.', 'completed', '', NULL, 'popular_tv', false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Liu Xiaobei,Bubble Zhu,Li Ruotian,Wu Bowei,Chen Jianing,Chen Siyu,Hu Xiaolong,Lv Yihao,Liu Haoyuan', 'Jackie Zhang', '2025-05-24 17:38:00.498', 'Hoàn Tất (31/31)', '31');
