INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (86, '11ca04268b41f39203efd92cd1f8b108', 'biet-doi-linh-cuu-hoa-phan-3', 'Biệt Đội Lính Cứu Hỏa (Phần 3)', 'Fire Force (Season 3)', 'https://phimimg.com/upload/vod/20250411-1/26e2e526501396c2b3c4758761eb926a.jpg', 'https://phimimg.com/upload/vod/20250411-1/f628491ea49b3da90473487260e1e9fb.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Năm 198 của kỷ nguyên Thái Dương ở Tokyo, các đội cứu hỏa đặc thù chiến đấu chống lại Hiện tượng nhân thể bộc hỏa, khi cơ thể con người đột nhiên biến thành quái vật lửa được gọi Viêm Nhân. Shinra Kusakabe là một chàng trai trẻ bị gắn biệt danh là Dấu chân ác quỷ, vì chân của cậu ấy có thể bốc cháy theo ý muốn. Sau khi cậu gia nhập Đội lính cứu hỏa đặc thù số 8, cậu đã cùng những đồng đội trong đội ngũ chiến đấu chống lại các Viêm Nhân với sức mạnh lính cứu hỏa thế hệ thứ 3 của mình. Khi tiếp xúc với kẻ tạo ra Viêm Nhân, Shinra bắt đầu biết được bí mật của cuộc hỏa hoạn đã gây ra cái chết thương vong cho cả gia đình cậu 12 năm trước...', 'ongoing', 'https://www.youtube.com/watch?v=JOlRi9YFA5c', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Gakuto Kajiwara,Yusuke Kobayashi,Saeko Kamijo,Mao Ichimichi,Kazuya Nakai,Kenichi Suzumura,Aoi Yuki,Daisuke Sakag