INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (89, '851b10e5b105815806efcf78b53588f4', 'bi-mat-kinh-hoang', 'Bí Mật Kinh Hoàng', 'Until Dawn', 'https://phimimg.com/upload/vod/20250524-1/a26f77d13ef543f1d92bdba602b145ee.jpg', 'https://phimimg.com/upload/vod/20250524-1/8a43e0b4c459cac0439ed4b1f795b70f.jpg', 2025, 'single', 'FHD', 'Vietsub', '103 phút', 0, 'Bí Mật Kinh Hoàng diễn ra sau khi em gái Melanie mất tích một cách bí ẩn, Clover cùng bạn bè quyết định vào một thung lũng nơi cuối cùng nhìn thấy em gái để tìm kiếm câu trả lời. Khi lạc vào một khu nhà bỏ hoang, họ bị một kẻ giết người đeo mặt nạ theo dõi và bị sát hại một cách kinh hoàng từng người một... cho đến khi họ tỉnh dậy và phát hiện mình quay ngược lại vào buổi tối đầu tiên. Bị mắc kẹt trong một vòng lặp thời gian bí ẩn, họ buộc phải sống lại cơn ác mộng đó mỗi đêm, nhưng mỗi lần lại phải đối mặt với những mối đe dọa mới và những cách chết khác nhau, ngày càng đáng sợ hơn. Khi hy vọng dần tắt, nhóm bạn nhận ra họ chỉ còn 13 mạng sống trước khi biến mất mãi mãi. Cách duy nhất để thoát khỏi là sống sót cho đến khi bình minh.', 'completed', 'https://www.youtube.com/watch?v=xR3lVHnh0Gg', NULL, NULL, false, '[{"id": "4db8d7d4b9873981e3eeb76d02997d58", "name": "Kinh Dị", "slug": "kinh-di"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Ella Rubin,Michael Cimino,Odessa A&#039;zion,Ji-young Yoo,Belmont Cameli,Maia Mitchell,Peter Stormare,Zsófia Temesvári,Tibor Szauerwein,Lotta Losten,Mariann Hermányi,Willem van der Vegt,Ádám Bot,Ádám Kocsis,Adrienn Mész,Ádám Zambryzcki,Bog', 'D