INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (90, 'd3a80d22394ecb6981f54282c29a0628', 'suoi-nguon-tuoi-tre', 'Suối Nguồn Tươi Trẻ', 'Fountain Of Youth', 'https://phimimg.com/upload/vod/20250524-1/07e24b99850adaa0e5c29542fe9e134f.jpg', 'https://phimimg.com/upload/vod/20250524-1/8bb5f76ca7c0b31e0204d40630851cf8.jpg', 2025, 'single', 'FHD', 'Vietsub', '125 phút', 0, 'Một kẻ săn kho báu đại tài lập ra một đội để bước vào một chuyến phiêu lưu sinh tử. Nhưng để luôn đi trước một bước các mối đe dọa, anh cần một người còn thông minh hơn mình: cô em gái xa cách.', 'completed', 'https://www.youtube.com/watch?v=-7S28bH8iDs', NULL, NULL, false, '[{"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}, {"id": "932bbaca386ee0436ad0159117eabae4", "name": "Anh", "slug": "anh"}]', 'John Krasinski,Natalie Portman,Eiza González,Domhnall Gleeson,Carmen Ejogo,Arian Moayed,Stanley Tucci,Laz Alonso,Benjamin Chivers,Daniel de Bourg,Steve Tran,Michael Epp', 'Guy Ritchie', '2025-05-24 17:37:44.535', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (11, '31dd7223d9103a8b518281cc099139b8', 'chan-tuong-trong-duong-net', 'Chân Tướng Trong Đường Nét', 'The Long Way Home', 'https://phimimg.com/upload/vod/20250513-1/e33792790e4f402f0133c9ac6805707a.jpg', 'https://phimimg.com/upload/vod/20250513-1/ba75a45f35c9a0d40244394770a1b6eb.jpg', 2025, 'series', 'FHD', 'Vietsub', '19 phút/tập', 0, 'Sau một chiến dịch vây bắt tổ chức buôn người, cảnh sát hình sự Cố Tân Hà cùng họa sĩ phác họa chân dung Tề Sở đã gia nhập đội đặc nhiệm chống buôn người của Triệu Thực. Qua hàng loạt vụ án ngày càng rối rắm, phức tạp, tổ chuyên án đã khoanh vùng được băng nhóm tội phạm do &quot;Quế Di&quot; cầm đầu. Tề Sở đích thân dấn thân vào nguy hiểm, cuối cùng tổ chuyên án đã triệt phá thành công tổ chức tội phạm gieo rắc tội ác suốt nhiều năm này, đồng thời phanh phui bí mật kinh hoàng của Quế Di là &quot;nuôi dưỡng trẻ bị bắt cóc để làm công cụ cho những vụ bắt cóc&quot;.', 'completed', '', NULL, 'popular_tv', false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Trương Thánh Nhạc,Giang Dịch Hiên,Dương Bác Tiêu,Lí Ninh', 'Mã Đa', '2025-05-24 17:37:28.445', 'Hoàn Tất (24/24)', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (91, '39349a7c3ed00bda5647ff55406aa4d2', 'dong-nuoc-ngam', 'Dòng Nước Ngầm', 'Undercurrent', 'https://phimimg.com/upload/vod/20250524-1/f894fb3b4481997f65867b92a705a5b8.jpg', 'https://phimimg.com/upload/vod/20250524-1/cfafc1d6d0969c5bd794a113aad579e3.jpg', 2025, 'single', 'FHD', 'Vietsub', '87 phút', 0, 'Một loại ma túy mới xuất hiện ở Cảng Thành, hé lộ vụ buôn lậu vũ trang ma túy xảy ra hai năm trước, với manh mối hướng đến Tập đoàn Hoành Đồ. Sau khi chuyển ngành, Lục Vân Long nhận nhiệm vụ nằm vùng điều tra, cứu được Chủ tịch tập đoàn Lý Hoành và giành được sự tin tưởng. Anh phát hiện Trần Bưu, người đứng thứ hai trong tập đoàn chính là hung thủ đã sát hại đồng đội năm xưa. Anh cùng đặc vụ nằm vùng Từ Lệ phối hợp hành động, trải qua nhiều lần đối đầu sinh tử với bọn buôn ma túy, cuối cùng đã thành công triệt phá tổ chức này.', 'completed', 'https://www.youtube.com/watch?v=CxfiZAMNnFY', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wang Ting,Tang Wang,Hei Zi,Wang Hongxiang,Shao Bing,黄子耀,Yang Qingwen,Yang Jianping,Liu Hui', 'Jiao Xiaoyu', '2025-05-24 17:37:48.224', 'Full', '1');
