INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (105, 'da29469a4b6418140138895517be93c4', 'pit-babe-2', 'Pit Babe 2', 'Pit Babe 2', 'https://phimimg.com/upload/vod/20250504-1/a30a5bb8b11a2f74582cff6564529fb8.jpg', 'https://phimimg.com/upload/vod/20250504-1/6fa9816ff2aa5109112e26fa0b6dc4bc.jpg', 2023, 'series', 'FHD', 'Vietsub + Thuyết Minh', '50 phút/tập', 0, 'Phim kể về mối quan hệ phức tạp giữa Babe-tay đua xe nổi tiếng với danh hiệu, vua đường đua, và Charlie- một mọt sách gợi cảm với ước mơ được gia nhập một đội đua. Charlie muốn tham gia đội đua đến mức đồng ý với lời đề nghị kỳ lạ của Babe để là trở thành nô lệ của cậu. Khi Babe đánh mất trái tim của mình cho Charlie, cậu ta liên tục phát hiện ra rằng mối quan hệ không như cậu mong đợi, và mục đích thực sự của Charlie khi tiếp cận cậu là để tiêu diệt cậu.', 'ongoing', 'https://www.youtube.com/watch?v=kQv4YPCJFj0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Naret Promphaopun,Krittin Kitjaruwannakul,Nut Supanut Lourhaphanich,Ping Obrnithi Leelavetchabutr,Atthanin Thaninphanuwiwat,Lee Asre Wattanayakul,Thanapon Aiemkumchai,Hemmawich Kwanamphaiphan,Pantach Kankham,Supakorn Saokhor,Vorarit Vaijairanai,', 'Nopachai Jayanama', '2025-05-24 17:38:29.281', 'Tập 4', '13');
