INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (107, 'b35b31a24acc2da3bd9e3feb30fc7e79', 'duoc-su-tu-su-phan-2', 'Dược Sư Tự Sự (Phần 2)', 'The Apothecary Diaries (Season 2)', 'https://phimimg.com/upload/vod/20250111-1/8207a9e5ea27b9079f36ca5b61e32ee6.jpg', 'https://phimimg.com/upload/vod/20250111-1/5a0da2a01045e079c85515ffb8d0581c.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Trong triều đình phong kiến Trung Quốc, một vài tháng đã trôi qua kể từ khi bé gái 17 tuổi có tên Miêu Miêu bị bắt cóc và bị buộc làm người hầu cấp thấp trong cung điện hoàng gia. Tuy nhiên, cô bé vẫn giữ tinh thần tích cực và cứ làm việc cho đến mãn hạn. Một ngày nọ, cô đã nghe tin hai đứa con của hoàng đế bị mắc bệnh nặng. Tại đây, cô đã quyết định hành động bí mật dựa vào những kinh nghiệm có sẵn từ phố đèn đỏ nghèo để cứu chữa.
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (108, 'df3abfaa6336c64811b77e86b9cb17b0', 'vi-thanh-qua-hoan-hao', 'Vị Thánh Quá Hoàn Hảo', 'The Too-Perfect Saint: Tossed Aside by My Fiancé And Sold To Another Kingdom', 'https://phimimg.com/upload/vod/20250418-1/fe5696a7c5299fdb8540cfa8cf8734cd.jpg', 'https://phimimg.com/upload/vod/20250418-1/8cc6032d85f7cd39463cb0339d9ce497.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Philia xuất thân từ một gia đình nổi tiếng vì đã sản sinh ra nhiều thế hệ thánh nhân, và cô cũng không ngoại lệ. Trên thực tế, bà được mệnh danh là vị thánh quyền lực nhất mọi thời đại, có tài năng phi thường đến mức nhiều người thấy bà không thể chịu nổi. Khi ngay cả vị hôn phu của cô cũng quyết định rằng anh không thể chịu đựng được cô, anh đột nhiên hủy bỏ hôn ước của họ. Anh ta háo hức không bao giờ gặp lại cô đến nỗi đã bán cô cho một quốc gia láng giềng đang rất cần một vị thánh của riêng họ. Giờ đây, Philia sẵn sàng đối mặt với những điều chưa biết, hoàn toàn mong đợi sự đối xử khốn khổ hơn. Rốt cuộc, cô ấy thật ngu ngốc khi mong đợi bất cứ ai chào đón cô ấy với vòng tay rộng mở...phải không?', 'ongoing', 'https://www.youtube.com/watch?v=z28cDNsqPdg', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yui Ishikawa,Kaede Hondo,Takuya Sato,Kohei Amasaki,Shinnosuke Tachibana,Sora Tokui,Ken Narita,Kanna Nakamura,Shu Uchida,Kazuyuki Okitsu,Miki Ito,Kentaro Ito,Sayaka Ohara,Yuya Murakami,Ikue Otani,KENN,Natsumi Murakami,Aina Suzuki,Ayaka Su', 'Đang cập nhật', '2025-05-24 17:38:39.01', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (109, 'b46825e256dea79fb588e5455ed7fe58', 'the-unaware-atelier-meister', 'The Unaware Atelier Meister', 'The Unaware Atelier Meister', 'https://phimimg.com/upload/vod/20250421-1/d75629fd24ae00a69eba1f45df231eb5.jpg', 'https://phimimg.com/upload/vod/20250421-1/75c6d3a8d10b414c2d3ccca0778e349a.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Một ngày nọ, Kurt, một cậu bé tốt bụng, bất ngờ bị đuổi khỏi Đảng Anh hùng vì &quot;vô dụng&quot;. Anh ta nhận thấy rằng năng khiếu về vũ khí, phép thuật và tất cả các kỹ năng liên quan đến chiến đấu khác của mình là thấp nhất, vì vậy anh ta nhận những công việc lặt vặt là sửa chữa các bức tường lâu đài và đào khoáng sản, nơi khả năng đặc biệt của anh ta ngay lập tức được bộc lộ. Anh ta tỏ ra khéo léo trong việc nấu nướng, xây dựng, khai thác mỏ, chế tạo các công cụ ma thuật—trên thực tế, khả năng của anh ta đối với mọi kỹ năng không liên quan đến chiến đấu đều có cấp độ SSS! Tuy nhiên, Kurt dường như hoàn toàn không nhận thức được tài năng của mình và cuối cùng đã cứu được mọi người, thị trấn và thậm chí cả đất nước thông qua những hành động thiếu hiểu biết của mình!?', 'ongoing', 'https://www.youtube.com/watch?v=dtH0CW_7HGo', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Mikako Komatsu,Minami Tanaka,Asami Seto,Hisako Kanemoto,Rie Tanaka', 'Đang cập nhật', '2025-05-24 17:38:41.264', 'Tập 8', '12');
