INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (112, 'c9ce98a38ebb27ccdb0e5083f2cfcde7', 'summer-pockets', 'Summer Pockets', 'Summer Pockets', 'https://phimimg.com/upload/vod/20250423-1/c2541708fdd9f9bd0f4ead5d6e2bf2a0.jpg', 'https://phimimg.com/upload/vod/20250423-1/8fe528b591540f01391de45798506a9c.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Hairi Takahara không bao giờ mong đợi mùa hè sẽ giống như một giấc mơ. Được gửi đến Torishirojima để sắp xếp đồ đạc của người bà quá cố, anh đã gặp biển cả mênh mông, nỗi nhớ yên bình và những cô gái bí ẩn, mỗi người đều theo đuổi một thứ gì đó ngoài tầm với. Khi anh ổn định cuộc sống trên đảo, những ký ức đã mất bắt đầu xuất hiện và anh tìm thấy thứ mà anh chưa từng biết mình đã mất.', 'ongoing', 'https://www.youtube.com/watch?v=2u-RIQst_N4', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Shoya Chiba,Konomi Kohara,Natsumi Takamori,Nene Hieda,Emiri Iwai,Saku Ichimiya,Sahomi Koyama,Aimi Tanaka,Megumi Takamoto,Minoru Shiraishi,Konomi Suzuki,Kentaro Kumagai,Youhei Hamada', 'Đang cập nhật', '2025-05-24 17:38:47.916', 'Tập 6', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (113, 'ccd9f73a3bb415a32b0708b0821761c4', 'guilty-gear-strive-dual-rulers', 'Guilty Gear Strive: Dual Rulers', 'Guilty Gear Strive: Dual Rulers', 'https://phimimg.com/upload/vod/20250420-1/fa83475e18c570ff30784362df5e3b53.jpg', 'https://phimimg.com/upload/vod/20250420-1/d01fcd43df4b3568e35465faff5f83af.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Sau khi các lĩnh vực khoa học và công nghệ từng rất hùng mạnh sụp đổ, một nguồn năng lượng mới gọi là ma thuật trở thành nền tảng cho thời đại hiện đại. Nhân loại đã tạo ra các vũ khí sinh học bị cấm gọi là Gear. Những Gear này cuối cùng nổi dậy chống lại loài người trong một cuộc nổi loạn. Dù nhân loại đã chiến thắng trong cuộc chiến sống còn được gọi là Thập tự chinh (Crusades), nhưng tổn thất của họ lớn đến mức nhiều thập kỷ sau đó, những vết thương lòng vẫn chưa thể hoàn toàn lành lại. Sin Kiske, đứa trẻ sinh ra từ một con người và một Gear, đang trên đường tới dự lễ cưới của cha mình là Ky và mẹ là Dizzy. Hôn lễ này đã phá vỡ điều cấm kỵ lớn nhất: sự kết hợp giữa con người và Gear. Dù thế giới đang trong hòa bình, nhưng phải mất rất nhiều năm mới có thể tổ chức được lễ cưới này. Mặc dù có những cảm xúc phức tạp vây quanh, buổi lễ vẫn diễn ra với nhiều lời chúc phúc. Đột nhiên, một cô gái bí ẩn xuất hiện... Một đứa trẻ mang trong mình dòng máu Gear định mệnh, và cô gái bí ẩn có lòng căm ghét sâu sắc đối với Gear. Cuộc gặp gỡ của họ sẽ làm rung chuyển cả thế giới.', 'ongoing', 'https://www.youtube.com/watch?v=CcMgvwfQPHY', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Issei Miyazaki,Jouji Nakata,Yui Ishikawa,Takeshi Kusao,Kazue Fujita,Manaka Iwami,Megumi Han,Aya Suzaki,Hiromi Igarashi,Mayumi Asano,Norio Wakamoto,Tetsu Inada,Junichi Endo,Yasuhiro Mamiya', 'Đang cập nhật', '2025-05-24 17:38:55.396', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (114, '6b59f92676fd007e9cc45d7f3fdd51f4', 'me-bien', 'Mẹ Biển', 'Mother Sea', 'https://phimimg.com/upload/vod/20250320-1/6b87f2ab4d57558e489ca34b1f2d39c0.jpg', 'https://phimimg.com/upload/vod/20250320-1/16437675bb1e9e64dc1d6175f9282965.jpg', 2025, 'series', 'FHD', 'Vietsub', '28 phút/tập', 0, 'Mẹ Biển khai thác sâu sắc cuộc sống của người dân làng chài miền biển, nơi họ mưu sinh bằng nghề đánh cá, ngày ngày bám víu vào những con thuyền lênh đênh giữa sóng nước. Cuộc sống tưởng chừng bình yên ấy đột nhiên tan vỡ khi một cơn bão lớn ập đến, cuốn trôi những người đàn ông ra khơi, để lại bờ biển ngập trong mất mát và đau thương. Làng quê vốn hiếm hoi đối mặt thiên tai giờ đây trở thành đống hoang tàn, với những người phụ nữ góa bụa và những đứa trẻ mồ côi cha.', 'ongoing', 'https://www.youtube.com/watch?v=iUunxGZXEk0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}]', '[{"id": "f6ce1ae8b39af9d38d653b8a0890adb8", "name": "Việt Nam", "slug": "viet-nam"}]', 'Cao Minh Đạt,Cao Thái Hà,Lily Chen,NSND Việt Anh,NSƯT Trương Minh Quốc Thái,NSƯT Kim Tuyến,Thanh Hiền,Hiếu Hiền,Thanh Thức,Trúc Mây,Quang Thái', 'Nguyễn Phương Điền', '2025-05-24 17:38:58.465', 'Tập 45', '50');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (115, '7b5f37cf6529d139d0735e31fa4baae4', 'trinh-sat-hinh-su-12', 'Trinh Sát Hình Sự 12', 'D.I.D 12', 'https://phimimg.com/upload/vod/20250522-1/9d758bbaa21d17621702a23c8604cbe9.jpg', 'https://phimimg.com/upload/vod/20250522-1/b3698cc3c9880bdcec27e6f1c737cb69.jpg', 2025, 'series', 'FHD', 'Lồng Tiếng', '43 phút/tập', 0, 'Một loạt án mạng liên hoàn, đã tập hợp lại Đinh Lạc Phong (Lâm Bảo Di) sỹ quan cảnh sát tổ trọng án và thanh tra cấp cao Hình Khải (Trương Chấn Lãng). Trong quá trình truy bắt hung thủ, Hình Khải buộc phải tìm sự trợ giúp của Dương Chỉ Phi (Phó Gia Lê), một nhà tâm lý học đồng thời là bạn gái cũ của Khải. Ba người nghiên cứu tỉ mỉ, phát hiện hung thủ là một tổ chức sát thủ, bằng cách cung cấp bố cục “Tân Bảy Mối Tội” qua trang web thần bí, xử tử người nào đã phạm phải “Tân Bảy Mối Tội”; và cũng khẳng định hung thủ có mối liên quan với tập đoàn Hy Nghiệp đang nắm giữ mạch máu kinh tế của thành phố này... Hình Khải không bao giờ ngờ rằng, cái mà chờ đón anh còn có một thời quá khứ anh rất muốn quên nhưng không được, đó làm cho anh ta khốn khó. Chị ruột của Lạc Phong là Đinh Thiếu Vân (Trần Pháp Dung) từ nước ngoài về lai ôm ấp một âm mưu đen tối, làm cho công việc điều tra thêm rắc rối...', 'ongoing', 'https://www.youtube.com/watch?v=UbUJbFsOtqs', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}, {"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lâm Bảo Di,Trần Pháp Dung,Trương Chấn Lãng,Tào Vĩnh Liêm,Trần Tự Dao', 'Trương Tuấn Hào,Âu Diệu Kiệt,Hà Gia Hoa', '2025-05-24 17:39:02.152', 'Tập 5', '25');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (116, '96bc82d11851fad841c56bac26d777a6', 'tinh-ban-traigai-lieu-co-ben-lau', 'Tình Bạn Trai-Gái Liệu Có Bền Lâu?', 'Can a Boy-Girl Friendship Survive?', 'https://phimimg.com/upload/vod/20250411-1/39cb8c263dc1a9b425e80bb8f92057d1.jpg', 'https://phimimg.com/upload/vod/20250411-1/908c484b45f41d05f959bd5aa876362b.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Tại một thị trấn nhỏ, Yuuki - chàng trai yêu cây cỏ và Rina - cô gái sôi nổi chưa biết đến tình yêu, đã thề nguyện làm ban thân suốt đời. Bước vào cấp ba, ranh giới giữa tình bạn và tình yêu bắt đầu trở nên mơ hồ khi những rung động đầu đời xuất hiện. Những hiểu lầm, sự ghen tuông và những lời trêu chọc từ bạn bè liên tục thử thách mối quan hệ tưởng chừng bền vững của họ. Liệu Yuuki và Rina có thể tiếp tục tình bạn khi đối mặt với những cảm xúc phức tạp, hay một trong hai người sẽ vượt qua giới hạn?', 'ongoing', 'https://www.youtube.com/watch?v=YLswpaA5ON0', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Kikunosuke Toya,Sayumi Suzushiro,Yuka Nukui,Ko Bonkobara,Masaaki Mizunaka,Hisako Kanemoto', 'Đang cập nhật', '2025-05-24 17:39:04.609', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (117, '803a8c2d069729f26ac947b48f7fc776', 'thinh-quan-nhap-mong', 'Thỉnh Quân Nhập Mộng', 'Everlasting Love', 'https://phimimg.com/upload/vod/20250505-1/83b77b84d849ed07a02019920183aa5b.jpg', 'https://phimimg.com/upload/vod/20250505-1/302fd037f83c41ae22c4bc25cc0745ca.jpg', 2025, 'series', 'FHD', 'Vietsub', '16 phút/tập', 0, 'Câu chuyện bắt đầu với Diệp Kim An, một nữ sinh ngành khảo cổ học, trong một lần tham gia khai quật đã vô tình chạm vào một hộp sọ cổ và bị cuốn vào một thế giới cổ đại. Tại đây, cô nhập hồn vào Phong Tri Lê, một &quot;yêu phi&quot; nổi tiếng trong lịch sử, và trở thành vợ của Phong Tri Lê, một vị &quot;bạo quân&quot; lạnh lùng nhưng ẩn chứa nhiều bí mật. Ban đầu, cả hai đều che giấu thân phận và mục đích thật sự, dẫn đến những màn đấu trí đầy kịch tính. Tuy nhiên, qua thời gian, họ dần hiểu và cảm thông cho nhau, phát triển một mối quan hệ đầy lãng mạn và sâu sắc.', 'ongoing', 'https://www.youtube.com/watch?v=meb1Ms2toHU', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Ôn Mạc Ngôn,Ngô Kỷ Phong,Lưu Giả Hỉ,Viên Tử Minh,Tùy Danh Dương,Trần Hoàn,Trương Hán Phương,Vương Lệ', 'Trương Ngao', '2025-05-24 17:39:08.606', 'Tập 5', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (118, 'd92ea9b81f514a1f8c2330f1b579bf21', 'chieu-chieu-nhu-nguyen', 'Chiêu Chiêu Như Nguyện', 'My Unpredictable Lover', 'https://phimimg.com/upload/vod/20250505-1/44747d212f842a17562797c01b814e38.jpg', 'https://phimimg.com/upload/vod/20250505-1/8243a6eb3f3056a6f93bc85108aad2bd.jpg', 2025, 'series', 'FHD', 'Vietsub', '8 phút/tập', 0, 'Lấy bối cảnh vào năm thứ 23 của triều đại Đại Tề, bộ phim kể về Tô Tiểu Tiên, một cô gái xuất thân bình dân nhưng sở hữu tài năng nấu nướng xuất sắc. Trong một lần đi hái nguyên liệu, cô vô tình lạc vào khu săn bắn hoàng gia và cứu sống Tam hoàng tử Triệu Hàn khỏi một cuộc ám sát. Để bảo vệ cô khỏi những rắc rối chính trị, Triệu Hàn đưa cô về phủ dưới danh nghĩa đầu bếp tạm thời. Tuy nhiên, Tô Tiểu Tiên không muốn bị giam cầm và luôn tìm cách rời khỏi phủ để theo đuổi ước mơ mở quán ăn riêng. Sau nhiều lần thất bại trong việc trốn thoát, cô quyết định nấu một bữa ăn tệ hại để bị đuổi đi. Nhưng món &quot;rượu hoa đào&quot; của cô lại khiến Triệu Hàn say mê. Trong cơn say, Triệu Hàn phát tác chứng bệnh kỳ lạ, khiến anh xuất hiện một nhân cách thứ hai – Triệu Nhiên. Từ đây, mối quan hệ giữa Tô Tiểu Tiên, Triệu Hàn và Triệu Nhiên trở nên phức tạp, đồng thời hé lộ những bí mật liên quan đến một loại độc dược thần bí từ phương Nam.', 'ongoing', 'https://www.youtube.com/watch?v=Al2RXD4Ly0Y', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "66c78b