INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (119, 'b414506974c8c8d9d1e4d0cf5ced4c76', 'the-gioi-hoan-my', 'Thế Giới Hoàn Mỹ', 'Perfect World', 'https://phimimg.com/upload/vod/20240822-1/97aa8ce6feea9737ac591a26a289b725.jpg', 'https://phimimg.com/upload/vod/20240822-1/98b87edeb63d262313f864bc57df93d5.jpg', 2021, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Thới Giới Hoàn Mỹ là phim hoạt hình kể về quá trình trưởng thành của một đứa trẻ trời sinh Chí Tôn cốt (đứa bé này tương lai có thể sánh vai cùng hung Thái cổ được trời ưu ái), có thể chinh chiến với Chân Hống, Kim Sí Đại Bàng có huyết mạnh tinh thuần đến hoàn mỹ, Nguyên thủy bảo thuật của nó sẽ danh chấn thiên hạ, được ghi khắc vào lịch sử của dân tộc.', 'ongoing', 'https://www.youtube.com/watch?v=-7aQNUQU6Fg', NULL, NULL, false, '[{"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '陳錦聞,趙雙,李詩萌,劉朙月,劉晴,楚越,李蘭陵,閻麼麼,胡亞捷,张雨濛,賀文瀟,白雪岑,劉琮,弋凡', 'Đang cập nhật', '2025-05-24 17:39:13.828', 'Tập 216', '234');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (120, 'e0070f4adceee3ac92c8eb8b95ad84a7', 'kidou-senshi-gundam-gquuuuuux', 'Kidou Senshi Gundam: GQuuuuuuX', 'Mobile Suit Gundam: GQuuuuuuX', 'https://phimimg.com/upload/vod/20250416-1/a5adab5037afc02c36b9aae1ff118506.jpg', 'https://phimimg.com/upload/vod/20250416-1/6d294caf4c40484cb7edeca9e0912fcf.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '25 phút/tập', 0, 'Amate Yuzuriha là một học sinh trung học sống yên bình trong một thuộc địa không gian trôi nổi ngoài không gian.Khi cô gặp một người tị nạn chiến tranh tên là Nyaan, Amate bị cuốn vào môn thể thao đấu kiếm di động bất hợp pháp được gọi là Clan Battle.Với cái tên nhập cảnh &quot;Machu&quot;, cô lao vào trận chiến dữ dội ngày này qua ngày khác, điều khiển GQuuuuuuX. Sau đó, một bộ đồ di động Gundam không xác định bị cả lực lượng không gian và cảnh sát truy đuổi xuất hiện trước mặt cô, cùng với phi công của nó, một cậu bé tên là Shuji.Bây giờ thế giới của họ sắp bước vào một kỷ nguyên mới.', 'ongoing', '', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Tomoyo Kurosawa,Shinji Kawada,Akane Fujita,Mariya Ise,Shoya Chiba,Rie Kugimiya,Yui Ishikawa,Seiichiro Yamashita,Yukitoshi Tokumoto,Yuusuke Nagano,Kousuke Echigoya', 'Đang cập nhật', '2025-05-