INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (121, '4a420e5be8a530b2a41ef92af37d1287', 'aru-majo-ga-shinu-made', 'Aru Majo ga Shinu Made', 'Until the Witch Dies, Once Upon a Witch''s Death: The Tale of the One Thousand Tears of Joy', 'https://phimimg.com/upload/vod/20250416-1/d54db1fa2dc72cfd25444cea22f20fe1.jpg', 'https://phimimg.com/upload/vod/20250416-1/ed5a699590fae7e959ca65996ca12cf4.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Vào sinh nhật thứ mười bảy của mình, phù thủy tập sự Meg biết rằng cô chỉ còn sống được một năm nữa. Thầy của cô, phù thủy trường thọ Faust, giải thích rằng cách duy nhất để hóa giải lời nguyền chết chóc là thu thập những giọt nước mắt vui mừng và gieo trồng hạt giống sự sống. Để tìm thấy họ, Meg sẽ phải rời bỏ cuộc sống được che chở mà cô luôn biết đến và tiến ra thế giới. Sẽ có những cuộc gặp gỡ, những cuộc chia ly, nhiều tình bạn và tất nhiên là nhiều nước mắt. Meg sẽ học được những bài học quan trọng nhất đối với một phù thủy là sự trong sáng, ngọt ngào và có phần đau lòng.', 'ongoing', 'https://www.youtube.com/watch?v=0lkvDeo6wI8', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yoshino Aoyama,Yoshiko Sakakibara,Miharu Hanai,Aina Suzuki,Rumi Okubo,Hina Youmiya,Atsumi Tanezaki,Shizuka Itoh,Yoko Hikasa', 'Đang cập nhật', '2025-05-24 17:39:24.887', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (122, '69ed4d71a5dbbef1843fa5b1693050d1', 'compass20-he-thong-phan-tich-thong-tin-chien-dau', '#COMPASS2.0 HỆ THỐNG PHÂN TÍCH THÔNG TIN CHIẾN ĐẤU', '#COMPASS2.0 ANIMATION PROJECT / #Compass 2.0: Sentou Setsuri Kaiseki System', 'https://phimimg.com/upload/vod/20250416-1/01cd08c4e75dcf2d7c6f11433afc503a.jpg', 'https://phimimg.com/upload/vod/20250416-1/37ae02285ad7ec9b379a37444fb682ca.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Trong &quot;Hệ Thống Phân Tích Thông Tin Chiến Đấu #COMPASS2.0&quot;, các anh hùng tập hợp cùng với cộng sự là con người trong một không gian như mơ. Các anh hùng phải liên tục chiến đấu để tạo ra đủ năng lượng nhằm duy trì hoạt động của hệ thống. Một anh hùng tên là 13 là một kẻ hay gây rối, từ chối tìm cộng sự cho mình. Khi 13 gần như bị loại khỏi hệ thống, một người chơi mới tên là Jin đã đồng ý hợp tác cùng cậu ấy. Liệu họ có thể mang lại hòa bình cho thế giới của #COMPASS2.0 không?', 'ongoing', 'https://www.youtube.com/watch?v=PBjiuKCh-zM', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Daisuke Ono,Sora Amamiya,Soma Saito,Sakura Tange,Yoshitaka Yamaya,Yasuhiro Mamiya,Shiki Aoki,Reina Kondo,Tetsuya Kakihara,Hiro Shimono,Rikiya Koyama,Marina Inoue,Kazuhiro Yamaji,Ayumu Murase,Atsuko Tanaka,Kokoa Amano,Yu Shimamura,Yoshitsu', 'Đang cập nhật', '2025-05-24 17:39:26.832', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (123, '735fba15cd27a45a0489108c2a2a70e9', 'dau-chien-thien-ha', 'Đấu Chiến Thiên Hạ', 'Fight For The Throne', 'https://phimimg.com/upload/vod/20250219-1/664b9aec66e005d6d76b2aa104fc6404.jpg', 'https://phimimg.com/upload/vod/20250219-1/79688a5b194f4ed806ccc78986321d98.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '10 phút/tập', 0, 'Thiếu niên thần bí Đại Phong đã cứu Lý Họa Mi, người lâm trọng bệnh sau khi bị kẻ gian ám hại. Đại Phong dự định lên kinh đô tìm sư tỷ, tình cờ đồng hành cùng Lý Họa Mi. Trên đường đi, Lý Họa Mi kinh ngạc phát hiện sư tỷ của chàng chính là Nữ hoàng Tần Chiêu, người liên tục phái thích khách truy sát họ. Để làm rõ nguyên do, Đại Phong và Lý Họa Mi quyết định nương tựa lẫn nhau, cùng chung sức chống lại kẻ địch. Khi giang hồ dậy sóng, triều đình tranh đấu càng thêm khốc liệt. Hai người vô tình bị cuốn vào một âm mưu đầy toan tính và hiểm ác. Đại Phong chính là chìa khóa để giải mã tất cả những bí ẩn đó…', 'ongoing', '', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-05-24 17:39:29.244', 'Tập 39', '99');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (124, 'b71faf915b91184a5c4dc56c7d6262da', 'bang-thuong-giai-te', 'Bảng Thượng Giai Tế', 'Serendipity', 'https://phimimg.com/upload/vod/20250425-1/a8a17267760c77de2cb08e2e043ab06e.jpg', 'https://phimimg.com/upload/vod/20250425-1/8bcc977603884adde71ce30d80d1f3d1.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Giản Minh Thư, thiên kim Giản phủ ở Giang Ninh, vô tình rơi xuống vực và mất trí nhớ, nhưng cô đã thoát khỏi thảm kịch gia đình bị xóa sổ và được người cô yêu là Lục Thường cứu thoát. Hai người cùng nhau đến kinh đô để dự thi. Cô luôn nghi ngờ về danh tính của mình, bước vào ngôi nhà để điều tra và giải quyết bí ẩn, và bất ngờ có được manh mối về trải nghiệm sống của mình. Tuy nhiên, cuộc điều tra của Giản Minh Thư dần rơi vào thế khó. Cô nghĩ rằng mình đang bước đi một mình trong nguy hiểm, nhưng thực ra Lục Thường đang âm thầm bảo vệ cô. Sự dịu dàng và tình cảm của Lục Thường càng làm tan chảy trái tim Minh Thư. Hai người đã cùng nhau trải qua nhiều nguy hiểm, cùng nhau chống chọi với mưa gió. Cuối cùng, họ đã xác nhận tình cảm của mình và dành phần đời còn lại bên nhau.', 'completed', 'https://www.youtube.com/watch?v=eFRZRjKUxAw', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Vương Tử Kỳ,Lư Dực Hiểu ,Vương Hoằng Nghị,Khổng Tuyết Nhi,Hạc Thu,Dương Sĩ Trạch,Uông Tịch Triều,Liêu Tuệ Giai', 'Trần Gia Lâm', '2025-05-24 17:39:31.599', 'Hoàn Tất (40/40)', '40');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (125, '60aaa4b2fc3fcf6a41c454149ab76592', 'blueming-hoa-no-vi-em', 'Blueming: Hoa Nở Vì Em', 'Blueming', 'https://phimimg.com/upload/vod/20250523-1/76dd8351fde95241f25ca39a69456102.jpg', 'https://phimimg.com/upload/vod/20240403-1/cd01ceded84c48b96452f3fa1c9663ea.jpg', 2022, 'series', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Bộ phim Hàn Quốc “Blueming Hoa Nở Vì Em” là bộ phim webtoon BL do MOVIE\u0026NEW và KENAZ Comics hợp tác sản xuất. “Blueming Hoa Nở Vì Em” cải biên từ tiểu thuyết nổi tiếng “Sự Nổi Tiếng Có Gì Đó Sai Sai”, kể về câu chuyện lãng mạn học đường của hai chàng sinh viên khoa điện ảnh: Cha Si Won dùng cách quản lý thấu đáo để bảo thân độc chiếm toàn bộ sự nổi tiếng nhưng sự nổi tiếng đó lại không còn như trước sau khi gặp phải Daun Hyeong – chàng trai vừa sinh ra đã mang theo sự nổi tiếng. Cha Siwon (Gang Eun Bin đóng), khi còn nhỏ từng bị chế giễu là xấu xí, nên cậu quyết tâm thay đổi bản thân. Sau khi trưởng thành, Cha Siwon trở thành một anh chàng đẹp trai. Cậu rất coi trọng sự nổi tiếng của mình và muốn được mọi người chú ý đến mình mọi lúc mọi nơi. Sau khi vào đại học, cậu tự tin rằng mình sẽ trở thành ông hoàng nổi tiếng, nhưng cậu lại gặp phải ông hoàng nổi tiếng thực sự Daun Hyeong (Cho Jun-hyuk đóng), người hoàn hảo cả về ngoại hình, tính cách, lẫn gia đình và điểm số! Bộ phim do đạo diễn Hwang Da Seul của những bộ phim BL đình đám như “Nơi Ánh Mắt Cậu Nán Lại”, “Gửi Đến Ngôi Sao Của Anh” làm đạo diễn.', 'completed', 'https://www.youtube.com/watch?v=mQoRRfeQo4M', NULL, NULL, false, '[{"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "01c8abbb7796a1cf1989616ca5c175e6", "name": "Học Đường", "slug": "hoc-duong"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Eun Bin Kang, Hyuk Jun Cho', 'Hwang Da-Seul,Huang Da Se', '2025-05-24 17:39:33.693', 'Hoàn Tất (11/11)', '11');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (126, 'eecd53e5e1ffd09c417b2aad6caaa3f3', 'hon-nhan-that-kho-voi-ninja', 'Hôn Nhân Thật Khó Với Ninja', 'Marriage Is Difficult For A Ninja', 'https://phimimg.com/upload/vod/20250523-1/713c286f8679c16c6287a35c0d7ca432.jpg', 'https://phimimg.com/upload/vod/20250523-1/9dca319620909da76a7a72c48f0c328c.jpg', 2023, 'series', 'FHD', 'Vietsub', '54 phút/tập', 0, '<span style="text-wrap-mode: wrap;">Kusakari Hotaru đã kết hôn với Kusakari Gorou và hiện đang làm dược sĩ tại một nhà thuốc. Chồng cô là một nhân viên giao hàng của bưu điện. Hai người đến với nhau vì tình yêu nhưng lại không biết rằng đối phương đều đang che giấu một bí mật: Đó là thân phận thực sự của họ chính là Ninja! Trong khi Hotaru là ninja của gia tộc Kouga thì Gorou là ninja thuộc gia tộc Iga và hai gia tộc này lại là kì phùng địch thủ của nhau! Cuộc hôn nhân của họ ban đầu rất hạnh phúc nhưng sau thời gian chung sống, hai người xảy ra mâu thuẫn liên quan đến vấn đề sinh hoạt trong gia đình. Đúng lúc đó, hai người nhận được nhiệm vụ và sau đó, một vụ ám sát xảy ra đã đẩy hai người ở thế đối đầu. Liệu vợ chồng họ sẽ chọn cuộc hôn nhân của mình hay là truyền thống của gia tộc?</span>', 'completed', 'https://www.youtube.com/watch?v=sfp2K7lwB9I', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Nanao,Nobuyuki Suzuki,Ryo Katsuji,Maika Yamamoto,Ayako Yoshitani,Taiyu Fujiwara,Miwako Kakei,Rie Tomosaka,Arata Furuta,Masachika Ichimura,Shinji Rokkaku', 'Yuko Matsuda', '2025-05-24 17:39:35.541', 'Hoàn Tất (11/11)', '11');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (127, '4ae61b10179243bbbd49128329ddc145', 'vua-bip-1998', 'Vua Bịp', 'The Conman', 'https://phimimg.com/upload/vod/20250523-1/74adca3c2d4f902226ef6d1c15278a50.jpg', 'https://phimimg.com/upload/vod/20250523-1/cc80e611a8bafbe99ae17e8a081a7a50.jpg', 1998, 'single', 'FHD', 'Vietsub', '113 phút', 0, 'Sau khi ra tù, một tay lừa đảo bắt đầu nối lại với vợ và gặp đứa con mà gã chưa từng thấy mặt, đồng thời dạy cho một người bạn mới vài mánh khóe.', 'completed', 'https://www.youtube.com/watch?v=3PfNor_45Lw', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}, {"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lưu Đức Hoa,Trương Gia Huy,Chu Nhân,Lý Tử Hùng,Cao Tiệp,Trương Tuệ Nghi,Trương Cẩm Trình,Bonnie Law', 'Vương Tinh', '2025-05-24 17:39:37.888', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (128, 'b1e29b063abb0df020455f6ef5a9db8d', 'vo-boc-nguoi-may', 'Vỏ Bọc Người Máy', 'Almost Human', 'https://phimimg.com/upload/vod/20250523-1/36621236908b2f69f4f11a97009798e8.jpg', 'https://phimimg.com/upload/vod/20250523-1/8a7e67b077b46b8ffc7d95f12de81eeb.jpg', 2020, 'single', 'FHD', 'Vietsub', '91 phút', 0, 'Tiến sĩ Lâm bí mật tạo ra một robot hình người để thỏa mãn bản thân, nhưng robot phát triển ý thức riêng. Nó dùng &quot;công nghệ đen&quot; thay thế da và giả dạng cô gái tên là Tô Tân để ở bên cạnh bạn trai cô – Vương Thăng. Cùng lúc, một loạt vụ án giết người kỳ lạ khiến cảnh sát Lý Động Tân vào cuộc, những mối nguy hiểm dần lộ diện...', 'completed', 'https://www.youtube.com/watch?v=oTuHSOSYShg', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Quách Bích Đình,Đoạn Bác Văn,Lưu Nghi Vĩ,Mễ Mễ,An Hổ,Mã Du Tiệp,Nhiếp Mai', 'Trương Nam', '2025-05-24 17:39:40', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (129, '108670e12c6e0fcf4d959fc8d2eabef6', 'trieu-tu-long', 'Triệu Tử Long', 'God Of War', 'https://phimimg.com/upload/vod/20250523-1/f0ec18409193fb41c8a0b6d6c1e89297.jpg', 'https://phimimg.com/upload/vod/20250523-1/b60311629f76b8298d98f3cfce11566e.jpg', 2021, 'single', 'FHD', 'Vietsub', '93 phút', 0, 'Bộ phim kể về hành trình của Triệu Tử Long sau bảy năm ẩn cư tại Thường Sơn, do biến cố chiến loạn mà lưu lạc đến Nghiệp Thành và tái ngộ với Lưu Bị. Dưới sự khích lệ của Lưu Bị và những thử thách khắc nghiệt, Triệu Tử Long dần tìm lại bản thân và lý tưởng, trở thành một đại tướng xuất sắc của nhà Hán.', 'completed', 'https://www.youtube.com/watch?v=-YGdJnLMSOA', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "f8ec3e9b77c509fdf64f0c387119b916", "name": "Lịch Sử", "slug": "lich-su"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Hạ Quân Tường,Dương Thư Phong,Lý Điền Dã,Nam Tư Khải,Điêu Tiêu', 'La Lạc', '2025-05-24 17:39:47.619', 'Full', '1');
