INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (131, 'b52340b4de4566b804c9880aa0b4af5f', 'hoang-phi-hong-ngoai-truyen-than-ke-dau-ngo-cong', 'Hoàng Phi Hồng Ngoại Truyện: Thần Kê Đấu Ngô Công', 'Last Hero In China', 'https://phimimg.com/upload/vod/20250523-1/8197c2bea105c4025cb7cb89cdaa48f5.jpg', 'https://phimimg.com/upload/vod/20250523-1/a35bd510d9a7d4f8806cc063045bc181.jpg', 1993, 'single', 'FHD', 'Vietsub', '111 phút', 0, 'Phật Sơn liên tiếp xảy ra những vụ mất tích của các cô gái trẻ khiến người dân lo lắng không yên. Phi Hồng và các đệ tử Bảo Chi Lâm lên một kế hoạch giăng bẫy để bọn bắt cóc lộ mặt, cả bọn dùng dì Thập Tam làm mồi nhử. Lần theo dấu vết các cô giá trẻ bị bán cho lầu xanh, Hoàng Phi Hồng tìm ra kẻ chủ mưu là một tên ác tăng tại Năng Nhân Tự, cùng cấu kết với tên cẩu quan Thiên Tổng của triều đình. Trúng gian kế của kẻ địch, Phi Hồng mất đi thính giác và bị đánh bại... Anh sẽ phải làm gì để khôi phục danh dự và chiến thắng kẻ thù?', 'completed', 'https://www.youtube.com/watch?v=7Vl8a8a9i1w', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "f8ec3e9b77c509fdf64f0c387119b916", "name": "Lịch Sử", "slug": "lich-su"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Lý Liên Kiệt,Trương Mẫn,Trương Vệ Kiện,Trần Bách Tường,Lương Gia Nhân,Viên Vịnh Nghi,Từ Trung Tín,Lưu Gia Huy', 'Vương Tinh,Viên Hòa Bình', '2025-05-24 17:39:51.816', 'Full', '1');
