INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (133, '82836ca597a373e6c3cd5ae2d466161e', 'tuyet-dai-song-kieu', 'Tuyệt Đại Song Kiêu', 'Handsome Siblings', 'https://phimimg.com/upload/vod/20250523-1/129cf9f55c0a7ecd6ca6b67e9e1a5ce7.jpg', 'https://phimimg.com/upload/vod/20250523-1/f5f34f15033ec2520bcd10c496cb82c9.jpg', 1992, 'single', 'FHD', 'Vietsub + Lồng Tiếng', '102 phút', 0, 'Hai cao thủ võ thuật tình cờ chạm trán tại một cuộc đấu võ, tìm được người trong lòng và sớm phát hiện ra quá khứ đan xen đầy rắc rối của cả hai.', 'completed', 'https://www.youtube.com/watch?v=YUH7MNNS_K8', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Lưu Đức Hoa,Lâm Thanh Hà,Trương Mẫn,Ngô Mạnh Đạt,Diệp Đức Nhàn,Ngô Trấn Vũ,Miêu Kiều Vĩ,Viên Vịnh Nghi', 'Tăng Chí Vỹ', '2025-05-24 17:39:55.912', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (134, '6a571fe98a2ba453e84923b447d79cff', 'tung-hoanh-tu-hai', 'Tung Hoành Tứ Hải', 'Once A Thief', 'https://phimimg.com/upload/vod/20250523-1/1bfb160a6bbc3da59ccc01a665b94a75.jpg', 'https://phimimg.com/upload/vod/20250523-1/4c87ca3d96329517db2546b247b697d7.jpg', 1991, 'single', 'FHD', 'Vietsub', '108 phút', 0, 'Joe, Jim và Sherry là những đứa trẻ mồ côi lớn lên dưới sự nuôi dưỡng và dạy dỗ của siêu trộm Chow. Khi trưởng thành, cả ba lại tiếp nối con đường làm đạo tặc: lao vào tìm kiếm, đánh cắp những bức tranh quý hiếm. Theo một đơn hàng “đặc biệt” của một trùm buôn tranh, Joe và Jim phải đột nhập vào tòa lâu đài bí mật ở Bờ biển Ngà được bảo vệ nghiêm ngặt với hệ thống báo động hiện đại đánh cắp một bức tranh quý.Thế nhưng, sự việc lần này đã không trót lọt khi cả hai vừa thoát ra ngoài. Joe bị giết còn Jim may mắn thoát chết.', 'completed', 'https://www.youtube.com/watch?v=yiRPGPqPNNI', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Châu Nhuận Phát,Trương Quốc Vinh,Chu Giang,Chung Sở Hồng,Tăng Giang,John Woo,Hồ Đại Vi', 'John Woo', '2025-05-24 17:39:57.644', 'Full', '1');
