INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (136, '09733dde1da9c47d431c043b24056f4e', 'ke-hoach-baby', 'Kế Hoạch Baby', 'Rob-B-Hood', 'https://phimimg.com/upload/vod/20250523-1/ae23a0ca2fd6284c375d2f67ff5af76a.jpg', 'https://phimimg.com/upload/vod/20250523-1/24b7ff9fd4a407d9039af3090da7c99f.jpg', 2006, 'single', 'FHD', 'Vietsub', '136 phút', 0, 'Kế Hoạch Baby kể về 3 tên trộm, cùng chung một mục đích hám tiền, gặp nhau lập thành một nhóm chuyên trộm két bẻ khóa, khoét vách kiếm tiền nhưng cả 3 tên ăn trộm đều có những mục đích tiêu tiền khác nhau, kẻ cờ bạc, kẻ bao gái, kẻ tích góp để dành. Trong một phi vụ không trót lọt,cảnh sát dí chạy dài, tên cầm đầu lại bị hốt, bất đắc dĩ 2 kẻ còn lại phải ôm theo một em bé con gia chủ hòng thực hiện kế hoạch tống tiền nhưng giờ lại phải thay nhau chăm sóc cho đứa bé suốt ngày khóc thét kia. Và từ từ, sự thơ ngây của đứa trẻ đã khiến 3 tên quay trở lại con đường lương thiện....', 'completed', 'https://www.youtube.com/watch?v=BjHdKRhQCRo', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Thành Long,Cổ Thiên Lạc,Hứa Quán Văn,Nguyên Bưu,Teresa Carpio,Cao Viên Viên,Doãn Tử Duy,Trần Bảo Quốc', 'Trần Mộc Thắng', '2025-05-24 17:40:03.136', 'Full', '1');
