INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (139, '46ba59a6994802347d659680875fb173', 'dai-thanh-tai-sinh-dau-chien-nghich-thien', 'Đại Thánh Tái Sinh: Đấu Chiến Nghịch Thiên', 'Revival Of The Monkey King', 'https://phimimg.com/upload/vod/20250523-1/2395daa053b32cbcfdf5f746cde507fb.jpg', 'https://phimimg.com/upload/vod/20250523-1/c85ca92b7c268729a98a4d41767ecae4.jpg', 2020, 'single', 'FHD', 'Vietsub', '82 phút', 0, 'Tôn Ngộ Không bị giam cầm vì chống lại Phật Tổ, một lần nữa lại nghịch thiên đổi mệnh! Thạch Hầu nhiều lần liên tiếp phạm phải luật trời, trốn khỏi thiên đình, xuống hạ giới đầu thai thành Hoa Tiểu Thiên. Tiên nữ A Thố phụng mệnh xuống hạ giới tìm Hoa Tiểu Thiên, bị ác ma Cự Linh phát hiện. Cự Linh dùng đủ loại quỷ kế, chỉ vì muốn có được thần khí của Hoa Tiểu Thiên. Sau một lần dốc sức chiến đấu, A Thố bị thiêu thành tro bụi. Hoa Thiểu Thiên cuối cùng được đánh thức, chiến thần quay trở lại, quyết một trận đại chiến sinh tử với Cự Linh...', 'completed', 'https://www.youtube.com/watch?v=qAuIYkEKY-k', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đỗng Hạo Nhiên,Trịnh Tử Hảo,Lưu Đằng Viễn,Ôn Hải Ba,Vũ Giai Huyên,Cao Minh Dương,Thôi Chân Chân,Từ Hi,Lưu Ích Yên,Lâm Mỹ Tích', 'Trương Vĩnh Sinh', '2025-05-24 17:40:16.224', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (140, 'bdbe575de5ecbc20be758c6f4e105da6', 'bonhoeffer-muc-su-gian-diep-ke-am-sat', 'Bonhoeffer: Mục Sư, Gián Điệp, Kẻ Ám Sát', 'Bonhoeffer: Pastor. Spy. Assassin', 'https://phimimg.com/upload/vod/20250523-1/4e54c5bb56dd70e332f3c1573532664d.jpg', 'https://phimimg.com/upload/vod/20250523-1/e5292501444b5ab8b66a94793fc8267c.jpg', 2024, 'single', 'FHD', 'Vietsub', '132 phút', 0, 'Phim kể về Dietrich Bonhoeffer, một mục sư và nhà thần học người Đức, người đã dũng cảm chống lại chế độ phát xít Đức dưới thời Hitler. Sau khi chứng kiến sự tàn bạo của Đức Quốc xã và sự thoái hóa của các nhà thờ quốc doanh, ông quyết định tham gia vào phong trào kháng chiến. Không chỉ giảng đạo, Bonhoeffer còn trở thành gián điệp và âm thầm hỗ trợ các kế hoạch ám sát Hitler.Trong khi đào tạo các mục sư ngầm và giúp người Do Thái trốn thoát, Bonhoeffer bị bắt vào năm 1943 và cuối cùng bị xử tử năm 1945 tại trại tập trung Flossenbürg, chỉ vài tuần trước khi chiến tranh kết thúc.', 'completed', 'https://www.youtube.com/watch?v=WZM90izJ8sI', NULL, NULL, false, '[{"id": "f8ec3e9b77c509fdf64f0c387119b916", "name": "Lịch Sử", "slug": "lich-su"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "1bae5183d681b7649f9bf349177f7123", "name": "Chiến Tranh", "slug": "chien-tranh"}]', '[{"id": "93e1c1318f7b84817ab855208973039b", "name": "Bỉ", "slug": "bi"}, {"id": "06e415f918c577f07328a52e24f75d43", "name": "Ireland", "slug": "ireland"}]', 'Jonas Dassler,Phileas Heyblom,August Diehl,David Jonsson,Moritz Bleibtreu,Nadine Heidenreich,Clarke Peters,Flula Borg,Lisa Hofer,Arthur Riordan,Luise Landau,William Robinson,James Flynn,Greg Kolpakchi,Simon Licht,Mark Wingett,Evan Hart,Vi', 'Todd Komarnicki', '2025-05-24 17:40:18.952', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (141, 'bc5fcb0018cecacba559dc512740091b', 'bat-trum-cho-vay', 'Bắt Trùm Cho Vay', 'Shark Busters', 'https://phimimg.com/upload/vod/20250523-1/2b52d2c22c8f2df7bb19454315b8563e.jpg', 'https://phimimg.com/upload/vod/20250523-1/2317419a0f8d9df0906e8899642109ad.jpg', 2002, 'single', 'FHD', 'Vietsub', '96 phút', 0, 'Trước mũi dùi của truyền thông vào khoản nợ khổng lồ của mình, sĩ quan cảnh sát dẫn đầu cuộc điều tra những kẻ cho vay nặng lãi đứng sau một kế hoạch cho vay nham hiểm.', 'completed', 'https://www.youtube.com/watch?v=RG31ztcJ1xI&pp=ygUcU2hhcmsgQnVzdGVycyAoMjAwMiB0cmFpbGxlcg%3D%3D', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Danny Lee,Hứa Thiệu Hùng,Lâm Tuyết,Trương Kiên Đình,Brian Ireland,Lô Huệ Quang,Lê Thục Hiền,Dương Thiên Kinh,Phùng Khắc An,Lục Kiếm Minh', 'Khâu Lễ Đào', '2025-05-24 17:40:21.717', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (142, '151c79acb52fe49af21cff6035b13cf3', 'cuoc-song-moi-trong-bong-toi-cua-tri-lieu-su-tai-ba', 'Cuộc Sống Mới Trong Bóng Tối Của Trị Liệu Sư Tài Ba', 'The Brilliant Healer''s New Life In The Shadows', 'https://phimimg.com/upload/vod/20250404-1/e08dae28bfe0a80e5217269dcb80cb72.jpg', 'https://phimimg.com/upload/vod/20250404-1/558c14a0fead4d1e6434556b38764efb.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '21 phút/tập', 0, 'Sinh ra trong khu ổ chuột nghèo khó, Zenos chưa bao giờ có cơ hội trong đời. Zenos vươn lên thành trị liệu sư tài ba, nhưng bị đồng đội phản bội. Bị đẩy vào bóng tối, anh mở phòng khám bất hợp pháp, trở thành trị liệu sư &quot;trong bóng tối&quot; huyền thoại. Danh tiếng lan truyền, nhưng cũng kéo theo nguy hiểm. Liệu anh có thể thoát khỏi vòng xoáy quyền lực đen tối, hay số phận đã định sẵn một kết cục nghiệt ngã?', 'ongoing', 'https://www.youtube.com/watch?v=XjwJfrxXpDk', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Shogo Sakata,Miharu Hanai,Yoko Hikasa,Mashiro Hitaka,Anna Nagase,Masaaki Mizunaka,Sayaka Kikuchi,Taku Yashiro,Yuki Nakashima', 'Đang cập nhật', '2025-05-24 17:40:25.2', 'Tập 8', '12');
