INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (162, '81ef0f4401b9bec98b849df4f0febfd3', 'thung-lung-soi', 'Thung Lũng Sói', 'Wolf Creek', 'https://phimimg.com/upload/vod/20250523-1/ec888fe6a8d6c00ba3b72425bf06efd3.jpg', 'https://phimimg.com/upload/vod/20250523-1/67e6337ff645efac555e1975478a4619.jpg', 2005, 'single', 'FHD', 'Vietsub', '104 phút', 0, 'Một nhóm du khách ba lô bị mắc kẹt ở vùng hẻo lánh của nước Úc rơi vào tay một kẻ sát nhân ẩn náu trong rừng rậm. Hắn ban đầu giả vờ tốt bụng, đề nghị sửa xe giúp họ, nhưng sau đó lại bắt giữ và giam cầm họ, khiến họ phải đấu tranh để sinh tồn trong cơn ác mộng kinh hoàng giữa thiên nhiên hoang dã.', 'completed', 'https://www.youtube.com/watch?v=pJYMZH_bafg', NULL, NULL, false, '[{"id": "4db8d7d4b9873981e3eeb76d02997d58", "name": "Kinh Dị", "slug": "kinh-di"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "435a85571578e419ed511257881a1e75", "name": "Úc", "slug": "uc"}, {"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'John Jarratt,Cassandra Magrath,Kestie Morassi,Nathan Phillips,Gordon Poole,Guy O&#039;Donnell,Phil Stevenson,Geoff Revell,Andy McPhee,Aaron Sterns,Michael Moody,David Rock,Teresa Palmer,Paul Curran,Aaron J. March,Sean Gannon,Darren Humphre', 'Greg McLean', '2025-05-24 17:41:28.274', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (168, '00653e1c588c7b4bc7e9a6be7a43a843', 'luc-dia-kien-tien', 'Lục Địa Kiện Tiên', 'Land Key Immortal', 'https://phimimg.com/upload/vod/20250224-1/09d096b856580e53597d20ab1f9ca2cf.jpg', 'https://phimimg.com/upload/vod/20250224-1/df633202b6ab9e26d966e19e4186979f.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '9 phút/tập', 0, 'Một thiếu niên đang chơi game thì bị sét đánh. Sau khi tỉnh lại phát hiện bản thân đã xuyên không và đang ở rể trong phủ Công Tước. Đêm tân hôn, người ta phát hiện hắn ngủ trên giường em gái vợ. Xuyên không mà mở màn đã như địa ngục như vậy, hãy xem hắn dùng bàn phím để hoá dữ thành lành như thế nào.', 'ongoing', '', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '清殇,Qiao Su,Shuang Zhao,Qian Chen,Yi Ruoxun', 'Đang cập nhật', '2025-05-24 17:41:47.115', 'Tập 119', '150');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (163, '0aa2946c67f639237f396261b8a894ab', 'tro-choi-nghin-ty-2024', 'Trò Chơi Nghìn Tỷ', 'Trillion Game', 'https://phimimg.com/upload/vod/20250328-1/7e6ab7e0e271f13419f3584e496292c6.jpg', 'https://phimimg.com/upload/vod/20250328-1/8c16f70da4f904deb5dc3da068510f28.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Haru – một kẻ láu cá, nhanh trí và có tài thu phục lòng người, cùng Gaku – một mọt máy tính nhút nhát, luôn gặp khó khăn trong giao tiếp. Hai con người với tính cách trái ngược hoàn toàn dần trở nên thân thiết sau một sự kiện xảy ra từ thời trung học. Vài năm sau, khi đã trở thành sinh viên đại học, Gaku miệt mài tìm việc nhưng liên tục thất bại trong các buổi phỏng vấn do bản tính rụt rè của mình. Trong lúc làm công việc lau kính tại trụ sở tập đoàn lớn Dragon Bank – công ty mà cậu khao khát được vào làm, Gaku bất ngờ nhận được lời đề nghị từ Haru: “Cùng nhau khởi nghiệp đi!” “Chúng ta sẽ sống theo cách của riêng mình, không ai có thể ngăn cản!” Để chạm tay vào tất cả mọi thứ trên thế gian này, cả hai lao vào một cuộc chiến khởi nghiệp đầy bất ngờ, với mục tiêu kiếm được 1 nghìn tỷ đô la và vươn lên đỉnh cao!', 'completed', 'https://www.youtube.com/watch?v=aMhOhAAy4UI', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Takeo Otsuka,Shoya Ishige,Yuki Tanaka,Mao Ichimichi,Hiroki Touchi,Takaya Hashi', 'Đang cập nhật', '2025-05-24 17:41:30.839', 'Hoàn Tất (26/26)', '26');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (164, '93dd84d3f9b0cc34957a3d9166d2d75e', 'thon-thien-ky', 'Thôn Thiên Ký', 'Tun Tian Ji', 'https://phimimg.com/upload/vod/20250519-1/277b550dcc3088ad438f18e8bc45d57e.jpg', 'https://phimimg.com/upload/vod/20250519-1/9c9b169a8e5674ac68aaaa8bad9ff103.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Tác phẩm được chuyển thể từ tiểu thuyết cùng tên, tác giả: Phong Thanh Dương. &quot;Thôn Thiên Ký&quot; kể lại hành trình huyền thoại của thiếu niên Ngô Dục từ một phàm nhân trở thành tiên Phật.', 'ongoing', 'https://www.youtube.com/watch?v=M0NCiOtHDoM', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Jiang Qiuzai,Haiting Cai,Huang Wei Zhong,Zhixiao Liu', 'Đang cập nhật', '2025-05-24 17:41:32.987', 'Tập 5', '50');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (165, '7f139acf3f38e85238e5f75c3ab24b72', 'su-huynh-a-su-huynh', 'Sư Huynh À Sư Huynh', 'My Senior Brother is Too Steady', 'https://phimimg.com/upload/vod/20250117-1/a9e32b44820101a9ba2c887344f7334c.jpg', 'https://phimimg.com/upload/vod/20250117-1/d2d7ee02b72e59bea282b367e36b0094.jpg', 2023, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Lý Trường Thọ - một thanh niên mắc bệnh hiểm nghèo vô tình được tái sinh vào thời thượng cổ trước đại chiến phong thần, trở thành một Luyện khí sĩ. Vì để tu được trường sinh bất lão và sống yên thân nơi hồng hoang tàn khốc này mà hắn hành sự khiêm tốn, tính trước làm sau, trước giờ không bao giờ bước vào nơi nguy hiểm, giấu át chủ bài, tu độn thuật, luyện đan độc. Cho đến một hôm, sư phụ của hắn nhận một sư muội về cho hắn, Lý Trường Thọ vốn muốn khiêm tốn tu hành bị cuốn vào hiểm nguy', 'ongoing', 'https://www.youtube.com/watch?v=II5loiIJC94', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Chaoran Yang,Bingtian Wang', 'Lei Jin', '2025-05-24 17:41:34.939', 'Tập 90', '135');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (166, '4a50c47d4386ee44d38066ae1b474dd7', 'chin-manh-ghep-bi-an', 'Chín Mảnh Ghép Bí Ẩn', 'Nine Puzzles', 'https://phimimg.com/upload/vod/20250522-1/7b6fa98b2285bb44a511a17fea3636e5.jpg', 'https://phimimg.com/upload/vod/20250522-1/b0e789223c196b582cfcd32b02d2ffd7.jpg', 2025, 'series', 'FHD', 'Vietsub', '54 phút/tập', 0, 'Nine Puzzles là bộ phim thuộc thể loại hình sự, phá án, kinh dị kể về hành trình truy tìm hung thủ vụ án giết người hàng loạt xảy ra 10 năm về trước nay lại tái diễn. Yoon Yi Na (Kim Da Mi thủ vai) là nhân chứng duy nhất trong vụ án 10 năm trước khi người chú ruột của cô bị sát hại. Sau này, cô trở thành trung úy cảnh sát 6 năm kinh nghiệm trong lĩnh vực lập hồ sơ phân tích tội phạm thuộc Đội phân tích tội phạm - Phòng Điều tra pháp y thuộc Cơ quan cảnh sát thành phố Seoul, với bộ não thiên tài, Yina nắm bắt rất nhanh động cơ phạm tội của hung thủ tại hiện trường như thể đã từng thực hiện. Cùng lật lại vụ án, truy tìm hung thủ giết người hàng loạt xảy ra 10 năm trước cùng với Yina là cảnh sát điều tra đội phòng chống bạo lực Kim Han Saem (Son Seok Gu thủ vai), người luôn nghi ngờ Yina chính là hung thủ của vụ án 10 năm trước. Han Saem là cảnh sát ưu tú, lỳ lợm và nhạy bén nhưng lại khiến cho người ta hiểu lầm bởi những hành động có phần quái dị của mình. Để ngăn chặn số lượng nạn nhân bị gi.ết hại ngày một tăng cùng với sự xuất hiện của “mảnh ghép bí ẩn”, Yina phải cùng bắt tay với Han Saem để nhanh chóng tìm ra hung thủ thật sự.', 'ongoing', 'https://www.youtube.com/watch?v=-UKrjg6RrjI', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Kim Da-mi,Son Suk-ku,Kim Sung-kyun,Hyun Bong-sik,Kwak Ja-hyung,Kim Do-gun', 'Đang cập nhật', '2025-05-24 17:41:37.186', 'Tập 6', '11');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (167, 'e8f7da8e2d75253e4003cbc4c24286ac', 'mot-chen-say-tinh', 'Một Chén Say Tình', 'Second Shot At Love', 'https://phimimg.com/upload/vod/20250514-1/feafeb5a7672829a1c920d11c6d46f4f.jpg', 'https://phimimg.com/upload/vod/20250514-1/aef68160fd7995a9c49619c207884947.jpg', 2025, 'series', 'FHD', 'Vietsub', '60 phút/tập', 0, 'Một người phụ nữ luôn tự nhận mình là người &quot;yêu&quot; rượu rất mực “hợp lý”. Nhưng mọi thứ đảo lộn khi cô tình cờ gặp lại mối tình đầu — một người đàn ông hoàn toàn bài xích rượu bia. Muốn giữ hình tượng hoàn hảo trước crush, cô quyết tâm bắt đầu hành trình... cai rượu! Từ những buổi tiệc thiếu men say đến những cuộc hẹn đầy ngượng ngùng khi tỉnh táo, cô nhận ra: cai rượu thì khó, nhưng giữ vững con tim trước người cũ còn khó hơn.', 'ongoing', 'https://www.youtube.com/watch?v=9rDAYbUCWAk', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Sooyoung Choi,Gong Myoung,Jo Yoon-hee,Kim Sung-ryung,Kim Sang-ho,Kang Hyung-suk,Kim Tae-oh,Yeom Seung-e', 'Jang Yoo-jung', '2025-05-24 17:41:39.951', 'Tập 4', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (169, 'b6e61f3a46000af53590f293dcf35c20', 'linh-moi-phan-7', 'Lính Mới (Phần 7)', 'The Rookie (Season 7)', 'https://phimimg.com/upload/vod/20250417-1/d352c4ba9188a1669697962f0db91a34.jpg', 'https://phimimg.com/upload/vod/20250417-1/475c4ab78fdac6644ccc363defc6d0fb.jpg', 2025, 'series', 'FHD', 'Vietsub', '43 phút/tập', 0, 'Sau một tai nạn, John Nolan 40 tuổi theo đuổi ước mơ gia nhập Sở Cảnh sát Los Angeles. Là lính mới già nhất, anh phải vượt qua những hiểm nguy trong công việc và sự hoài nghi từ những người coi đây chỉ là cuộc khủng hoảng tuổi trung niên.', 'completed', 'https://www.youtube.com/watch?v=NnztCSdrFqI', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "445d337b5cd5de476f99333df6b0c2a7", "name": "Canada", "slug": "canada"}, {"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Nathan Fillion,Melissa O&#039;Neil,Alyssa Diaz,Eric Winter,Mekia Cox,Richard T. Jones,Shawn Ashmore,Jenna Dewan,Lisseth Chavez', 'Alexi Hawley', '2025-05-24 17:41:49.156', 'Hoàn Tất (18/18)', '18');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (170, 'b17b1ffea01fd9acd1dd69b73e5353ea', 'khoe-truoc-yeu-sau', 'Khỏe Trước Yêu Sau', 'Pump Up The Healthy Love', 'https://phimimg.com/upload/vod/20250501-1/62e0f5b557cd8c498d838fc171e8b9b4.jpg', 'https://phimimg.com/upload/vod/20250501-1/6f53fc626c96026938a105dc4bd07dd3.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '59 phút/tập', 0, 'Từng là một vận động viên thể hình nổi tiếng, Do Hyun Joong hiện nay đã trở thành quản lý của một phòng gym nhỏ với quyết tâm lan tỏa tinh thần tập luyện đến mọi người. Còn Lee Mi Ran là một nhân viên công ty du lịch có tâm hồn ăn uống. Sau khi chia tay với bạn trai, cô bắt đầu đến tập luyện ở phòng tập của Hyun Joong và giữa hai người dần dần nảy sinh tình cảm. Bộ phim hứa hẹn sẽ mang đến những thông điệp ý nghĩa và tích cực về sự tự tin và khởi đầu mới.', 'ongoing', 'https://www.youtube.com/watch?v=gxPO6jDhfs0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Lee Jun-young,Jung Eun-ji,Kim Kwon,Lee Mi-do,Lee Seung-woo,Park Seong-yeon,Hong Yun-hwa,Jung Wook-jin,Nam Kyu-hee,Lee Sang-jin', 'Park Jun-soo,Choi Yeon-su', '2025-05-24 17:41:51.094', 'Tập 8', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (171, 'd6cc54c4be2b2fba33e2d212ce90c2fd', 'khach-san-apocalypse', 'Khách Sạn Apocalypse', 'Apocalypse Hotel', 'https://phimimg.com/upload/vod/20250416-1/514f3ae0d67b030419fb149b78aa47b2.jpg', 'https://phimimg.com/upload/vod/20250416-1/dfe17014998a181f65db9f520aa8a2a3.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Nhiều năm đã trôi qua kể từ khi loài người biến mất khỏi Trái đất, nhưng khách sạn Galaxy Tower ở Ginza, Tokyo, vẫn tiếp tục hoạt động. Tại trung tâm nhân viên của nó là Yachiyo, một robot chủ khách sạn chuyên dụng, cùng với các robot nhân viên khác làm việc không mệt mỏi trong các bộ phận khác nhau. Cùng nhau, họ dành những gì cảm thấy như một sự vĩnh cửu duy trì khách sạn, mặc dù không có khách. Khi họ chờ đợi sự trở lại của chủ sở hữu của họ và ngày nhân loại xuất hiện trở lại. Bây giờ, một phép lạ nhỏ sắp thay đổi mọi thứ cho Yachiyo và các đồng nghiệp robot của cô.', 'ongoing', 'https://www.youtube.com/watch?v=epz8n8a2Zik', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Saho Shirasu,Sumire Morohoshi,Hiroki Touchi,Shin-ichiro Miki,Hiroyuki Kinoshita,Cho,Takako Honda,Mutsumi Tamura,Yoshiko Sakakibara', 'Đang cập nhật', '2025-05-24 17:41:53.093', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (172, '7c5304360ee8740ee303cf7c0339f0ca', 'hoa-giang-ho-chi-bat-luong-nhan-phan-7', 'Họa giang hồ chi bất lương nhân (Phần 7)', 'A Portrait of Jianghu: Bad Guys (Season 7) / The Degenerate-Drawing Jianghu 7', 'https://phimimg.com/upload/vod/20250412-1/808531c4aabf0b86bc9948916ab7d5f3.jpg', 'https://phimimg.com/upload/vod/20250412-1/cc39c6db04e2a58a121e89a1a0cb721e.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '15 phút/tập', 0, 'Mạc Bắc thoạt nhìn yên ả, nhưng bên trong sóng ngầm cuộn trào. Vương hậu Thuật Lý Đoá âm thầm chuẩn bị một đại hội lớn. Bất Lương Soái dò la tin tức, dẫn Bất Lương Nhân đến đây. Cùng lúc, Tứ Đại Thi Tổ do Hàng Thần dẫn đầu mở quán lẩu ở Mạc Bắc. Một kẻ sát nhân bí ẩn gây hoang mang, buộc các thế lực phải vạch kế hoạch đối phó riêng.', 'ongoing', '', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Jiang Bian,Mengmeng Yan,Zhao Yi,Qiuxiang Shen,Jun Chu,Shuren Zhao,Xuecen Bai,Lu Zhixing', 'Đang cập nhật', '2025-05-24 17:41:54.872', 'Tập 10', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (173, '42cf125df2e054b2a12810263cda40b0', 'doi-tac-dang-ngo-2025', 'Đối Tác Đáng Ngờ', 'Ayashii Partner', 'https://phimimg.com/upload/vod/20250501-1/f24a919a22927387fe523d9015ca5331.jpg', 'https://phimimg.com/upload/vod/20250501-1/f547120a5ea8833ecefbcdd65d39cebb.jpg', 2025, 'series', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Tateishi Haruto, một công tố viên tài giỏi, bị Miyashita Sakura hiểu lầm là kẻ quấy rối trên xe buýt và trải qua một tình huống tồi tệ. Sau đó, anh tình cờ gặp lại Sakura khi cô đang cãi nhau vì bị bạn trai phản bội, và không hiểu sao anh lại giúp cô một cách vô thức... Điều này dẫn đến việc Haruto bị cuốn vào buổi nhậu say xỉn với Sakura, và khi anh hoàn toàn say mèm, cô đã đẩy anh ngã xuống! Vài ngày sau, Haruto tái ngộ với Sakura — lần này cô đến để tham gia kỳ thực tập công tố viên. Haruto nghiêm khắc với Sakura, nhưng chẳng hiểu sao anh lại không thể bỏ mặc cô. Hai người họ đã bắt đầu bằng một cuộc gặp gỡ tồi tệ nhất có thể. Liệu cuộc gặp này là sự trùng hợp? Hay là định mệnh? Một câu chuyện tình cảm hài hước vừa ngọt ngào vừa cay đắng giữa hai con người vụng về trong tình yêu, sẽ khiến bạn tin vào duyên phận.', 'ongoing', 'https://www.youtube.com/watch?v=DLe2KmpbfkA', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yusei Yagi,Kyoko Saito,Takuya Kusakawa,Kokoro Morita,Kuu Izima,Kazunari Tosa,Koh Takasugi,Ikkei Watanabe', 'Yuka Yasukawa', '2025-05-24 17:41:57.589', 'Tập 2', '10');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (174, '05204fdf0a9a07a4eac25ec99af7ae24', 'dich-vu-chia-tay', 'Dịch Vụ Chia Tay', 'Break Up Service', 'https://phimimg.com/upload/vod/20250426-1/18eecea3ff561f5d83cf79813896d47f.jpg', 'https://phimimg.com/upload/vod/20250426-1/db6bdffdc03f527cd11e9ada1db2f0a4.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Túng quẫn, Jued sẵn sàng làm bất cứ điều gì để kiếm tiền, kể cả làm việc với Boss — một người chuyên kiếm sống bằng cách phá hoại các mối quan hệ. Sau lần gặp nhau đầy trớ trêu, Boss — một tay chuyên nghiệp quen làm việc một mình — không bỏ lỡ cơ hội nào để gây khó dễ cho Jued. Tuy nhiên, Jued rất kiên cường và dần chứng tỏ bản thân giỏi hơn những gì cả hai từng nghĩ.', 'ongoing', 'https://www.youtube.com/watch?v=TmdVYUSth4A', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Jumpol Adulkittiporn,Jorin Khumpiraphan,Tachakorn Boonlupyanun,Thanakrit Panichawid,Patara Eksangkul,Ploynira Hiruntaveesin,Prariyapit Yu,Tawan Vihokratana,Nipaporn Thititanakarn', 'Thachai Komolphet,Sasinan Pattana', '2025-05-24 17:41:59.338', 'Tập 6', '12');
