INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (176, '8b57c0bb0564fe650d8ad45b7d7c1017', 'anh-hung-dot-bien-x', 'Anh Hùng Đột Biến X', 'TO BE HERO X', 'https://phimimg.com/upload/vod/20250427-1/98e883179225c98418f7e1f519580875.jpg', 'https://phimimg.com/upload/vod/20250427-1/db91e7a052fa4665a32edc912f938707.jpg', 2025, 'series', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Đây là một thế giới mà anh hùng được tạo ra bởi lòng tin của mọi người, và anh hùng nhận được nhiều lòng tin nhất được gọi là – X. Trong thế giới này, lòng tin của mọi người có thể được tính toán bằng dữ liệu và những giá trị này sẽ được phản ánh trên cổ tay của mọi người. Chỉ cần đạt được đủ điểm tin cậy, những người bình thường cũng có thể có siêu năng lực và trở thành siêu anh hùng cứu thế giới. Tuy nhiên, giá trị lòng tin luôn thay đổi khiến con đường của anh hùng đầy rẫy những điều chưa biết…', 'ongoing', 'https://www.youtube.com/watch?v=Tv1k6r5ksUU', NULL, 'trending_now', false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wei Chao,Liu Xiaoyu,Zhangtaikang Chen,Wentao Chang,Jinwen Chen,Qian Chen,Shuang Zhao,Zhang Fuzheng,Yang Kaiqi,Gu Jiangshan', 'Đang cập nhật', '2025-05-25 05:35:13.67', 'Tập 7', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (178, '502bde293ec97ed8b6113eed820d2f62', 'mua-he-hikaru-chet', 'Mùa Hè Hikaru Chết', 'The Summer Hikaru Died', 'https://phimimg.com/upload/vod/20250707-1/9812244a5e9b7e3f7e1590c0552a26da.jpg', 'https://phimimg.com/upload/vod/20250707-1/06ee909ce9e62a18384ef61095fda403.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Sáu tháng trước, Hikaru mất tích suốt một tuần. Giờ đây, khi người bạn thân nhất Yoshiki linh cảm có điều không ổn và đối mặt với cậu, sự thật kinh hoàng dần hé lộ.', 'ongoing', 'https://www.youtube.com/watch?v=sFaO07LwAVg', NULL, NULL, false, '[{"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Chiaki Kobayashi,Shuichiro Umeda,Yumiri Hanamori,Wakana Kowaka,Chikahiro Kobayashi,Yoshiki Nakajima,Shion Wakayama', 'Đang cập nhật', '2025-08-17 08:16:10.785', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (179, 'e82ba7292d1c4fbfbf1933dc51f62e60', 'hien-ngu', 'Hiến Ngư', 'When Destiny Brings The Demon', 'https://phimimg.com/upload/vod/20250816-1/0cf65fc65804a01c9c35155750e7672f.jpg', 'https://phimimg.com/upload/vod/20250816-1/9d2f4ee7f4f131f23a8de09669648ca2.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '45 phút/tập', 0, 'Bộ phim xoay quanh Trâu Nhạn – một “nô lệ công sở” điển hình thời hiện đại – vô tình xuyên không đến thế giới tu tiên, trở thành Liêu Đình Nhạn, đệ tử của Thanh Cốc Thiên, đồng thời bị tuyển chọn vào hàng ngũ một trăm đệ tử hầu hạ sư tổ Tư Mã Tiêu. Bề ngoài, Tư Mã Tiêu được cho là đang bế quan ở núi Tam Thánh, nhưng thực chất hắn đã bị phong ấn suốt 500 năm, hình thành nên tính cách u ám, lầm lì, cáu kỉnh dễ nổi nóng. Hắn vô cùng căm hận Tiên Phủ Canh Thần và luôn nuôi ý định trả thù. Liêu Đình Nhạn thực chất là thân phận của một thích khách do Ma Vực cài vào, nhưng Trâu Nhạn không hề biết &quot;bản thân&quot; còn che giấu thiết lập này nên ngay từ lần đầu chạm mặt, cô suýt nữa đã mất mạng dưới tay Tư Mã Tiêu. Sau thời gian tiếp xúc, nhờ năng lực “lời thề nói thật”, Tư Mã Tiêu dần nhận ra cô không hề có ý định ám sát hay lợi dụng mình. Thái độ này khiến hắn cảm thấy tò mò, nảy sinh hứng thú, từ đó bắt đầu chuyện tình dây dưa nhiều kiếp giữa ma vương phản diện và cô gái lười hệ chữa lành.', 'ongoing', 'https://www.youtube.com/watch?v=CHAWRCiXzd0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Trần Phi Vũ,Vương Ảnh Lộ,Vương Ý Đình,Cao Hàn,Ngô Vũ Hằng,Vương Á Gia,Bảo Kiếm Phong,Hà Trung Hoa,Trần Thư Quân', 'Ôn Đức Quang', '2025-08-17 08:16:11.742', 'Tập 6', '40');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (180, '572624400295bcd695e277e7a8ae8898', 'queendom', 'Queendom', 'Queendom', 'https://phimimg.com/upload/vod/20250817-1/c9518b9e5ba290ecf93c32f73f2f85e6.jpg', 'https://phimimg.com/upload/vod/20250817-1/789545b05d2bf7a978d0b86a98924ebc.jpg', 2025, 'series', 'FHD', 'Vietsub', '51 phút/tập', 0, 'Rey và Print là kỳ phùng địch thủ từ khi còn ngồi trên ghế giảng đường cho đến khi bước vào ngành giải trí. Họ gặp lại nhau lần nữa khi được chọn để đóng vai chính trong bộ phim hoành tráng của năm. Nhưng trước khi khai máy một tuần, hai cô gái thức dậy và phát hiện ra bị hoán đổi thân xác cho nhau. Các sự kiện kỳ lạ dẫn đến vô vàn rắc rối khiến Rey và Print phải đóng giả làm người kia và không để ai phát hiện. Quan trọng là, cảm xúc trái tim rung động mãnh liệt bắt đầu xuất hiện giữa Rey và Print có nghĩa là gì?', 'ongoing', 'https://www.youtube.com/watch?v=_s14syADEbA', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Nattawadee Pipobpornchai,Tarradee Watancharoen,Mashannoad Suvanamas,Chermawee Suwanpanuchoke,Pimolrat Pisolyabutr,Jiraphat Sodjam,Chinnawat Phattharathanachot,Supoj Janjareonborn,Karint Aongchum', 'Salmon', '2025-08-17 08:16:12.739', 'Tập 2', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (181, 'dcf8ab5349d270f4e325d44cb463c780', 'long-giam', 'Lồng Giam', 'Lock Her', 'https://phimimg.com/upload/vod/20250817-1/b1c994db96ae8483f9d974240d04f189.jpg', 'https://phimimg.com/upload/vod/20250817-1/8128df552918671686fc54af683de987.jpg', 2025, 'series', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Đêm Trung Thu cả nhà bị sát hại, Tần Thời Nguyệt của nhà họ Tần được đốc quân Đới Thế Nghiêu cưu mang. Để điều tra án oan của cha, cô rơi vào vòng xoáy giữa hai anh em, em trai Sênh từ cướp đoạt đến yêu đậm sâu, anh trai Đới Thế Nghiêu từ nghi ngờ đến rung động. Khi chiến tranh bùng lên lần nữa, ba người đã phá vỡ số phận của mình. Sênh bỏ kiếm vì tình, Đới Thế Nghiêu từ bỏ tình yêu vì thành, trong máu lửa Tần Thời Nguyệt cuối cùng cũng tìm được chân tướng và cuộc sống mới.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lý Bách Huệ,Hà Sưởng Hy,Trần Kiến Vũ,Vu Hân Ngật', 'Lâm Sen', '2025-08-17 08:16:13.694', 'Tập 7', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (182, '38abae704fb4cdba00a26baa58cb4443', 'nhung-thien-than-nuoc-my', 'Những Thiên Thần Nước Mỹ', 'Angels In America', 'https://phimimg.com/upload/vod/20250817-1/86369c55c9d69c3e1192815f4baae463.jpg', 'https://phimimg.com/upload/vod/20250817-1/a65c9f432ec19947db4512bb150bb179.jpg', 2003, 'series', 'FHD', 'Vietsub', '59 phút/tập', 0, 'Một bộ phim do HBO sản xuất lấy bối cảnh nước Mỹ vào thời điểm xảy ra nhiều biến động xã hội, trong đó nổi bật là đại dịch AIDS. Bộ phim chứa đựng nhiều hình ảnh ẩn dụ và các chiêm nghiệm sâu sắc về cuộc sống.', 'completed', 'https://www.youtube.com/watch?v=W4bsQ6nsEZ8', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Al Pacino,Meryl Streep,Emma Thompson,Mary-Louise Parker,Jeffrey Wright,Justin Kirk,Ben Shenkman,Patrick Wilson,Brian Markinson', 'Đang cập nhật', '2025-08-17 08:16:14.642', 'Hoàn Tất (6/6)', '6');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (183, '6df811b75fbf2f0dc32a60ece213f1a3', 'truyen-thuyet-phuong-hoang-phuong-dich', 'Truyền Thuyết Phượng Hoàng (Phượng Dịch)', 'Legend Of The Phoenix', 'https://phimimg.com/upload/vod/20250817-1/b885f658ef861d6724d5bed0ab0f8192.jpg', 'https://phimimg.com/upload/vod/20250817-1/97324ae502143cc80c5e19e52b20b281.jpg', 2019, 'series', 'FHD', 'Vietsub + Lồng Tiếng', '40 phút/tập', 0, 'Vào thời Đông Lương, có nàng Ngưng Chi xinh đẹp lương thiện. Một lần nàng theo đoàn kịch nhập cung biểu diễn chúc mừng Thọ Yến của Hoàng Thái Hậu, không ngờ rằng lại bị trưởng công chúa hãm hại, may mắn thay được đệ nhất mưu sĩ Ngụy Quảng kịp thời ra tay giúp đỡ, Ngưng Chi từ đây đối với chàng tương tư mãi không quên. Hai năm sau, Ngưng Chi ngoài ý muốn tiến cung làm cung nữ hầu cận của Hoàng Hậu. Với sự thông minh, lòng nhân hậu và sự dũng cảm Diệp Ngưng Chi đã chiến đấu vì tầng lớp nghèo khổ, chống lại cường quyền và trở thành giai thoại trong Hoàng Cung, khiến chính hoàng hậu cũng phải cảm động với tấm chân tình của nàng, đồng thời cũng hấp dẫn sự chú ý của vị Hoàng Đế cao cao tại thượng, nàng từ đó lâm vào tình thế nguy nan, nhất cử nhất động trong hậu cung đều trở nên vô cùng khó khăn. Cùng lúc ấy, Trưởng công chúa bắt đầu củng cố quyền lực, Diệp Ngưng Chi vô tình bị cuốn vào vòng xoay tranh quyền đoạt thế. May mắn thay Ngụy Quảng vẫn luôn kề bên nàng, cùng nàng vượt qua trùng trùng điệp điệp khó khăn, đẩy lùi Quốc nạn. Từ một cung nữ thân phận thấp hèn, Diệp Ngưng Chi đã trở thành Hiền Phi trí tuệ nhân hậu, danh tiếng lưu truyền đến ngàn đời sau. Cuối cùng nàng trở lại cuộc sống thường dân sống một cuộc đời viên mãn với tình yêu chân thành.', 'completed', 'https://www.youtube.com/watch?v=nC1vzfeup5w', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Hà Hoằng San,Từ Chính Khê,Tào Hi Văn,Lê Diệu Tường', 'Vệ Hàn Thao', '2025-08-17 08:16:15.65', 'Hoàn Tất (41/41)', '41');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (184, 'dabec13d9ab3d2f9054e435162755ff8', 'tieng-vong-cua-nguoi-song-sot-tham-an-tai-han-quoc', 'Tiếng Vọng Của Người Sống Sót: Thảm Án Tại Hàn Quốc', 'The Echoes Of Survivors: Inside Korea''s Tragedies', 'https://phimimg.com/upload/vod/20250817-1/e977dbedbd739274d4bc680dc9a720c4.jpg', 'https://phimimg.com/upload/vod/20250817-1/b9854bd980287430bc9cdc2c2322ed15.jpg', 2025, 'series', 'FHD', 'Vietsub', '56 phút/tập', 0, 'Từ các trại giam tàn bạo đến các giáo phái lợi dụng đức tin, những người sống sót đã phá vỡ sự im lặng để tiết lộ những thảm kịch đau lòng mà ít ai tin là có thể xảy ra ở Hàn Quốc.', 'completed', 'https://www.youtube.com/watch?v=SEdC9Iowdyc', NULL, NULL, false, '[{"id": "1645fa23fa33651cef84428b0dcc2130", "name": "Tài Liệu", "slug": "tai-lieu"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:16:16.624', 'Hoàn Tất (8/8)', '8');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (185, 'f5e4dd47222b23ebadd17e3ec33744c6', 'quy-duc-vo-hinh', 'Quỷ Dục Vô Hình', 'The Stealth Sex Fiend', 'https://phimimg.com/upload/vod/20250817-1/8cde3610364e9b32d8f3fa6d788c07dc.jpg', 'https://phimimg.com/upload/vod/20250817-1/1f99c52b0360de9da4946076d3d1a55d.jpg', 2003, 'single', 'FHD', 'Vietsub', '84 phút', 0, 'Nam chính Cường Tử vô tình ăn phải thuốc kích dục đã hết hạn, nên biến thành người vô hình! Hắn ta lại lợi dụng “ưu thế” vô hình này để đi rình mò chuyện dâm ô. Sau đó, để giải cứu người vợ ngực lớn bị bọn cho vay nặng lãi giam giữ, Cường Tử gây ra hàng loạt tình huống dở khóc dở cười. Câu chuyện liên tục xuất hiện những diễn biến bất ngờ… Trong lúc người vô hình Cường Tử đang vội vã đi cứu vợ, thì chính người vợ ấy, trong khi bị giam giữ, lại bất ngờ nảy sinh một mối tình lệch lạc với kẻ cho vay nặng lãi, khiến câu chuyện càng thêm phức tạp.', 'completed', '', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Lee Long-Ming,Wong Ching,Bo Chi,Tat Wah Choi', 'Carlos', '2025-08-17 08:16:17.579', 'Full', '1');
