INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (188, 'd2e404b542447bc9b745627894c4d1d9', 'duc-tin', 'Đức Tin', 'Shaman', 'https://phimimg.com/upload/vod/20250817-1/4b3fa3a0ab1ff42256ac2cba5f370425.jpg', 'https://phimimg.com/upload/vod/20250817-1/64f7d2558d09d547629d29b041be3c6c.jpg', 2025, 'single', 'FHD', 'Vietsub', '93 phút', 0, 'Giữa lòng một ngọn núi lửa hẻo lánh ở Ecuador, một nữ truyền giáo miệt mài cải đạo cho cộng đồng bản địa xa xôi. Nhưng khi con trai của cô bị ám bởi thế lực hắc ám cổ xưa — còn tồn tại lâu hơn cả tôn giáo mà cô đang rao giảng — đức tin của cô bị đẩy đến bờ vực sụp đổ. Để cứu con, cô buộc phải đối diện với một sự thật kinh hoàng: có những sức mạnh vượt ngoài mọi lời kinh cầu.', 'completed', 'https://www.youtube.com/watch?v=hQITvMvJW1M', NULL, NULL, false, '[{"id": "4db8d7d4b9873981e3eeb76d02997d58", "name": "Kinh Dị", "slug": "kinh-di"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "4d5d85af33ec2aaedb674d2d6a7d53b6", "name": "Ecuador", "slug": "ecuador"}, {"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Sara Canning,Daniel Gillies,Jett Klyne,Lisandro Morales,Alejandro Fajardo,Segundo Fuérez,Dylan Tacuri', 'Antonio Negret', '2025-08-17 08:16:20.97', 'Full', '1');
