INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (190, '2f9fc227758c8375bfd10a1447c195cf', 'van-tham-bat-tri-mong', 'Vân Thâm Bất Tri Mộng', 'Eclipse Of Illusion', 'https://phimimg.com/upload/vod/20250705-1/d9b4c7bf7cd7c0314e86e8d0ea065519.jpg', 'https://phimimg.com/upload/vod/20250705-1/113abc54b469d91d1fc4f9e0dbeffed0.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '25 phút/tập', 0, 'Hôn lễ xa hoa của Vân Vọng Thư bỗng chốc hóa thành một thảm kịch, cả môn phái và gia tộc nàng đều bị tiêu diệt do một âm mưu đã được giăng sẵn. Nàng lết tấm thân rướm máu chạy trốn. Trên bờ vực sinh tử, nàng ký giao ước đổi tim với thế lực bí ẩn “La Dị Các”. 60 năm mai danh ẩn tích, thiếu nữ năm nào giờ hóa thành La Sát đẫm máu, mang danh &quot;Hi Hòa&quot;. Vân Vọng Thư thề sẽ dùng máu kẻ thù cúng tế cho oan hồn môn phái!', 'ongoing', 'https://www.youtube.com/watch?v=d7kd5ZeF4os', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:16:22.979', 'Tập 8', '26');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (191, '9548a849d4020dd032ed0e00301d240f', 'them-muon', 'Thèm Muốn', 'ABO Desire', 'https://phimimg.com/upload/vod/20250713-1/908b598da98da72515239372be028b85.jpg', 'https://phimimg.com/upload/vod/20250713-1/946adfb2326a5198e87904c6677c5275.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '45 phút/tập', 0, 'Thịnh Thiếu Du, một Alpha cấp S, trong quá trình thâm nhập công ty đối thủ, đã gặp và bị thu hút bởi Hoa Vịnh — một Omega xinh đẹp nhưng thực chất là Enigma giả Omega để bẫy anh. Trong khi đó, Thẩm Văn Lang, một Alpha khác, phát hiện thư ký Cao Đồ — người luôn giả Beta để che giấu thân phận Omega — đã mang thai con của mình.', 'ongoing', 'https://www.youtube.com/watch?v=fAlPOAPu5ok', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}, {"id": "af5f08b6445ca1def86fdd38cc1dc0b2", "name": "Đài Loan", "slug": "dai-loan"}]', 'Huang Xing,Qiu Dingjie,Li Peien,Jiang Heng', 'Nong Jian', '2025-08-17 08:16:23.925', 'Tập 8', '16');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (192, '729f2c7eeeab66f50f4ab3677539a585', 'toi-o-dinh-cao-doi-cau', 'Tôi Ở Đỉnh Cao Đợi Cậu', 'Summit Of Our Youth', 'https://phimimg.com/upload/vod/20250808-1/941272f6220478c357bebc8e1852018c.jpg', 'https://phimimg.com/upload/vod/20250808-1/21951072ec5eb53106763f1b1cf90073.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '45 phút/tập', 0, 'Bộ phim kể về Cố Tuyết Giao – một cô gái vừa là nhân viên văn phòng dưới đáy xã hội vừa yêu đương mù quáng – trong lúc đối mặt với nguy cơ bị sa thải đã bất ngờ quay về thời trung học. Để bù đắp những tiếc nuối trong đời, cô quyết tâm biến trái tim si tình thành lý trí sự nghiệp, mượn tri thức và tài năng của học sinh giỏi Lận Chi Hoa để làm lại cuộc đời. Cũng từ đó, một mối tình ngọt ngào, cùng nỗ lực, cùng trở thành biến số trong đời nhau, đã dần dần nảy nở.', 'ongoing', 'https://www.youtube.com/watch?v=cjC4M8rl7Zk', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Tôn Chân Ni,Trần Tĩnh Khải,Cát Thu Cúc,Đồ Chất Anh,Ngô Sùng Hiên,Viên Đại Tần,Điền Nghi Đồng,Quải Gia Lạc', 'Tài Thông', '2025-08-17 08:16:24.965', 'Tập 16', '23');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (193, '707ab73422e213d6c39597e2078c565e', 'sinh-van-vat', 'Sinh Vạn Vật', 'This Thriving Land', 'https://phimimg.com/upload/vod/20250814-1/8cba7eab03986a60779e8615d70a2e9b.jpg', 'https://phimimg.com/upload/vod/20250814-1/373d5e4b63dee75d176a7dcf01e27770.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Bộ phim kể về câu chuyện tại vùng nông thôn Lỗ Nam, khắc họa hành trình biến động của mảnh đất và số phận con người trong giai đoạn lịch sử đầy sóng gió. Trọng tâm là câu chuyện trưởng thành đầy nghị lực của người phụ nữ, xen lẫn những mối tình sâu nặng, tạo nên bản anh hùng ca xúc động về tình yêu và lòng kiên cường. Giữa ách thống trị phong kiến khắc nghiệt, những người nông dân vật lộn từng ngày để sinh tồn, để vươn lên tìm ánh sáng tự do. Nhưng trên hết, phim đặc biệt khắc họa mối gắn bó máu thịt giữa con người và mảnh đất quê hương – thứ tình cảm thiêng liêng truyền từ thế hệ này sang thế hệ khác, như một lời thề không bao giờ dứt.', 'ongoing', 'https://www.youtube.com/watch?v=o-bMf7sw5Po', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lưu Gia Thành,Dương Mịch,Âu Hào,Nê Đại Hồng,Tần Hải Lộ,Hành Phi,Trương Thiên Dương,Trương Hải Vũ,Trì Mộng,Lâm Vĩnh Kiện,Lam Doanh Doanh,Tạ Trạch,Phan Chi Lâm,Vu Trấn,Thẩm Đan Bình', 'Lưu Gia Thành', '2025-08-17 08:16:25.944', 'Tập 14', '36');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (194, 'e7aa803cb22f5aea99caa8c91fcf94e5', 'quai-vat-so-8-phan-2', 'Quái Vật Số 8 (Phần 2)', 'Kaiju No. 8 (Season 2)', 'https://phimimg.com/upload/vod/20250707-1/0e2c976cd696d8dd2a37878bc0f3a703.jpg', 'https://phimimg.com/upload/vod/20250707-1/cf9ab616a9d2dc2c7bf4ad3121c639e2.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Những con &quot;kaiju&quot; (quái vật khổng lồ) bất ngờ xuất hiện và hoành hành khắp Nhật Bản trong nhiều năm. Một đơn vị tinh nhuệ được gọi là Quân đoàn Phòng vệ phải liều mạng hàng ngày để bảo vệ dân thường. Anh chàng Kafka Hibino mang ước mơ gia nhập Quân đoàn từ nhỏ nhưng lại bị dòng đời đưa đẩy, phải làm công việc chuyên xử lý xác quái vật. Sau một tai nạn kỳ lạ, anh có được khả năng biến hình, được mệnh danh là &quot;Kaiju số 8&quot;. Từ đây, Kafka bắt đầu hiện thực hóa ước mơ thuở nhỏ của mình, gia nhập Quân đoàn và giấu kín năng lực vừa có được.', 'ongoing', 'https://www.youtube.com/watch?v=SXiSfXiiOxM', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:16:26.91', 'Tập 6', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (195, '2fd71648d0bfec3f35c7415c3901a72c', 'dexter-hoi-sinh', 'Dexter: Hồi Sinh', 'Dexter: Resurrection', 'https://phimimg.com/upload/vod/20250719-1/a20268535fe70784e36d7a98983a1ad2.jpg', 'https://phimimg.com/upload/vod/20250719-1/b8a74a7c6276afe9bcea2225e95d233d.jpg', 2025, 'series', 'FHD', 'Vietsub', '47 phút/tập', 0, 'Sau một thời gian dài hôn mê, Dexter Morgan tỉnh lại trong cô độc – con trai anh, Harrison, đã biến mất không để lại dấu vết. Mang trong mình mặc cảm tội lỗi vì những gì từng gây ra cho con, Dexter lần theo dấu vết đến New York, quyết tâm tìm lại Harrison và sửa chữa những sai lầm quá khứ. Nhưng đường về không bao giờ dễ dàng. Khi Angel Batista từ Sở cảnh sát Miami xuất hiện với những nghi vấn cũ, bóng ma của quá khứ bắt đầu lộ diện. Trong thành phố không ngủ, hai cha con sớm nhận ra mình đã dấn thân quá sâu – và chỉ có một cách thoát ra: cùng nhau đối mặt.', 'ongoing', 'https://www.youtube.com/watch?v=84o1Q6fB20k', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Michael C. Hall,Jack Alcott,Uma Thurman,David Zayas,James Remar,Ntare Guma Mbaho Mwine,Kadia Saraf,Dominic Fumusa,Emilia Suárez', 'Clyde Phillips', '2025-08-17 08:16:27.934', 'Tập 7', '10');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (196, '5f04cbcc7f0a335ed1517e9f24ffb30e', 'cau-ca-tu-te', 'Cậu Cả Tử Tế', 'The Nice Guy', 'https://phimimg.com/upload/vod/20250719-1/d6dfc3b4338b1d2bea6b1f119da2eece.jpg', 'https://phimimg.com/upload/vod/20250719-1/4ee16f365e8d976234739e0e19cba089.jpg', 2025, 'series', 'FHD', 'Vietsub', '70 phút/tập', 0, 'Park Seok Cheol là cháu trai cả trong một gia đình xã hội đen. Không giống như nhiều thành viên trong gia đình, Park Seok Cheol là một chàng trai có trái tim trong sáng. Anh luôn dành tình cảm và sự quan tâm cho mối tình đầu của mình - Kang Mi Yeon, một cô gái xinh đẹp có mơ ước trở thành ca sĩ.', 'ongoing', 'https://www.youtube.com/watch?v=hAXrg0UKIFI', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Lee Dong-wook,Lee Sung-kyoung,Ryu Hye-young,Oh Na-ra,Park Hoon,Cheon Ho-jin,Park Myung-shin,Park Won-sang,Han Jae-yeong', 'Đang cập nhật', '2025-08-17 08:16:28.958', 'Tập 10', '14');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (219, '8803f7fa56465a59d0c1a12ec666f533', 'luc-luong-nen-mong-phan-3', 'Lực Lượng Nền Móng (Phần 3)', 'Foundation (Season 3)', 'https://phimimg.com/upload/vod/20250712-1/c6e451de30c036c5dcfb22cc37301981.jpg', 'https://phimimg.com/upload/vod/20250712-1/e812e14330cef32907a26b8ed6d07ff0.jpg', 2025, 'series', 'FHD', 'Vietsub', '69 phút/tập', 0, 'Dựa trên bộ tiểu thuyết của Isaac Asimov, Lực Lượng Nền Móng theo chân đoàn người lưu lạc trên hành trình cứu lấy nhân loại và tái thiết nền văn minh giữa sự sụp đổ của Đế Chế Thiên Hà.', 'ongoing', 'https://www.youtube.com/watch?v=7-MNE238l0w', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Jared Harris,Lee Pace,Lou Llobell,Leah Harvey,Laura Birn,Cassian Bilton,Terrence Mann', 'David S. Goyer', '2025-08-17 08:40:00.66', 'Tập 6', '10');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (217, '5b5c772a9de501b3e045ffa86178f800', 'phap-su-trang-bi-loai-khoi-to-doi-duoc-mao-hiem-gia-cap-s-don-nhan', 'Pháp Sư Trắng Bị Loại Khỏi Tổ Đội, Được Mạo Hiểm Giả Cấp S Đón Nhận', 'Scooped Up By An S-Ranked Adventurer', 'https://phimimg.com/upload/vod/20250714-1/64fefb83970849d918ea05ea1ee97304.jpg', 'https://phimimg.com/upload/vod/20250714-1/0f2c95c52a5cfe6eebc47b9fd71ca370.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Bị trục xuất khỏi nhóm anh hùng, Lloyd - một pháp sư hỗ trợ khiêm tốn cứ ngỡ mình chỉ là người tầm thường. Thế nhưng khi đồng hành cùng nhóm mạo hiểm giả hạng S trong một nhiệm vụ định mệnh, anh dần bộc lộ năng lực vượt xa tưởng tượng. Trong lúc nhóm anh hùng cũ rơi vào khủng hoảng, Lloyd lại vô tình bước vào con đường vinh quang, trở thành một nhà thám hiểm huyền thoại. Với tính cách giản dị nhưng sức mạnh vô song, câu chuyện của anh là hành trình thay đổi số phận đầy cuốn hút và bất ngờ.', 'ongoing', 'https://www.youtube.com/watch?v=NekFyD9qjhg', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Gakuto Kajiwara,Rina Hidaka,Haruka Shiraishi,Daisuke Hirose,Yuuichirou Umehara,Ryohei Kimura,Yui Ishikawa,Mizuki Mano,Ayaka Nanase,Saeko Oki', 'Tamada Hiroshi', '2025-08-17 0