INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (230, '41edce5cfc8f660a3c9a4c1d502d7bef', 'ultraman-omega', 'Ultraman Omega', 'Ultraman Omega', 'https://phimimg.com/upload/vod/20250705-1/c136845c971bd31ec74a88c955db3457.jpg', 'https://phimimg.com/upload/vod/20250705-1/fc4d32801c5acc9cd83f9bde967200b5.jpg', 2025, 'series', 'FHD', 'Vietsub + Lồng Tiếng', '25 phút/tập', 0, 'Lấy bối cảnh Trái Đất chưa từng có siêu anh hùng hay quái thú, một người ngoài hành tinh bị mất trí nhớ, bất ngờ rơi xuống từ bầu trời. Anh lấy tên Sorato và bắt đầu khám phá thế giới loài người đầy cảm xúc lẫn mâu thuẫn. Khi những con quái thú khổng lồ lần đầu xuất hiện, Sorato vô thức nhớ lại sứ mệnh của mình và biến thân thành Ultraman Omega, sử dụng vũ khí đặc trưng Omega Slugger để chiến đấu bảo vệ Trái Đất.', 'ongoing', 'https://www.youtube.com/watch?v=nYGyRjE_zXY', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Kondo Shori,Yoshida Haruto,Kudo Ayano', 'Masayoshi Takesue', '2025-08-17 08:40:13.444', 'Tập 7', '28');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (231, '08678ae679dc79795862b29f7935f034', 'than-tuong-con-thu', 'Thần Tướng Con Thứ', 'Bastard Wargod', 'https://phimimg.com/upload/vod/20250804-1/2bf24a35fc9ec7f8679c4b3e48a8b28c.jpg', 'https://phimimg.com/upload/vod/20250804-1/73d6edb47352da8bf2798b140c6c8df7.jpg', 2025, 'series', 'FHD', 'Vietsub', '15 phút/tập', 0, 'Thần tướng Côn Lôn Sở Bắc Trì vì cứu chúng sinh mà rơi vào hôn mê, sau khi tỉnh lại liền che giấu thân phận, trở thành con trai thứ trong Sở phủ. Trên hành trình lật ngược tình thế chỉnh đốn gia phong, quét sạch cường đạo, Sở Bắc Trì không chỉ được trưởng công chúa, nữ đế, nữ phú thương, nữ tướng đem lòng yêu và tranh giành, anh còn phá giải được thế trận Càn Khôn, chém kẻ phản quốc, trấn áp vạn bang, cuối cùng khiến thiên hạ phải quy phục!', 'ongoing', 'https://www.youtube.com/watch?v=yROkOisKYE0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Vương Hoằng Hâm,Hàn Hân Dư,Trương Địch ,Từ Anh Lạc,Tô Hàng,Chu Thiên Tiêu', 'Tô Nguyên Niên', '2025-08-17 08:40:14.56', 'Tập 23', '24');
