INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (234, '200734077bb5e01fbe9b973d0d50ee6a', 'ta-la-ngai-khun-xinh-dep-nhat', 'Ta Là Ngài Khun Xinh Đẹp Nhất', 'The Most Beautiful Count', 'https://phimimg.com/upload/vod/20250803-1/ddf54a097d11a8123182b38590bde4e4.jpg', 'https://phimimg.com/upload/vod/20250803-1/523c40eda740a1c715b191a704b757e4.jpg', 2025, 'series', 'FHD', 'Vietsub', '51 phút/tập', 0, 'Sau khi tỉnh dậy trong một kiếp trước, một biểu tượng đồng tính đầy kiêu hãnh phát hiện mình tái sinh thành một quý tộc trong vương quốc hà khắc, nơi tình yêu đồng giới bị cấm đoán và quyền lực có thể giết người. Để sinh tồn, anh buộc phải che giấu con người thật và đối mặt với những âm mưu chốn hoàng cung.', 'ongoing', 'https://www.youtube.com/watch?v=RqHw-CRB5xo', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "2975bbecb6017f4b4f06951f76d858de", "name": "Thái Lan", "slug": "thai-lan"}]', 'Supanut Lourhaphanich,Obrnithi Leelavetchabutr,Asre Wattanayakul,Pataraphol Wanlopsiri,Thanakorn Techawicha', 'Kritsada Techanilobon', '2025-08-17 08:40:17.797', 'Tập 3', '15');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (235, 'b62510e29bba2eb5af6ba88c3dce08e0', 'song-nhan', 'Song Nhẫn', 'Higher', 'https://phimimg.com/upload/vod/20250814-1/024076eab707e49aebcb32870fb74a78.jpg', 'https://phimimg.com/upload/vod/20250814-1/98e24cdf76d0471323683220db31562e.jpg', 2025, 'series', 'FHD', 'Vietsub', '14 phút/tập', 0, 'Khương Chấn, huấn luyện viên của “Trại huấn luyện Cuồng Phong”, vì cái chết của em gái Tiểu Đồng mà cải trang nằm vùng trong Tập đoàn Tử Tinh để điều tra vụ tai nạn xe tự hành gây chết người. Trong quá trình thực hiện nhiệm vụ, anh tình cờ gặp lại Bạch Phàm – người từng là cộng sự nhưng nay là kẻ thù. Từ những màn thăm dò lẫn nhau, cả hai dần hợp tác, làm sáng tỏ sự thật vụ tai nạn năm xưa và còn tìm ra bằng chứng Tập đoàn Tử Tinh lợi dụng công nghệ giao diện não - máy để làm điều ác. Sau đó, họ liên thủ với Nông Thiên Nhã - người cũng từng chịu sự áp bức của nhà họ Nông - và cùng nhau đập tan âm mưu của Nông Thương Khâm, chủ tịch Tập đoàn Tử Tinh.', 'ongoing', 'https://www.youtube.com/watch?v=X0DC5LzY2Oo', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Trương Tập Tuấn,Mã Tiểu Vũ,Châu Tử Hâm,Vu Khiêm,Nghiệp Văn,Triệu Nghĩa,Tùng Hâm', 'Lý Hán Hiên', '2025-08-17 08:40:18.906', 'Tập 11', '23');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (236, '5c2e51017bc179c37f2ac4c4fba5c781', 'pham-nhan-tu-tien-truyen', 'Phàm Nhân Tu Tiên Truyện', 'The Immortal Ascension', 'https://phimimg.com/upload/vod/20250724-1/3acd42b880b9afc0e80ce1b3b66f4825.jpg', 'https://phimimg.com/upload/vod/20250724-1/8ac37168234fcdee704b2e60e3f8a2a2.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '40 phút/tập', 0, 'Phàm Nhân Tu Tiên Truyện là hành trình tu luyện khốc liệt của Hàn Lập, một thiếu niên nghèo có ước mơ trở thành tiên nhân. Với xuất thân bình thường, Hàn Lập gia nhập một môn phái nhỏ rồi dựa vào nỗ lực cùng mưu trí của bản thân để vượt qua vô số nghịch cảnh trên con đường tu tiên đầy hiểm nguy. Với tạo hình đẹp mắt, kỹ xảo ấn tượng cùng loạt cảnh chiến đấu mãn nhãn, đây là tác phẩm tiên hiệp hứa hẹn sẽ mang đến trải nghiệm thị giác vượt trội cho người xem.', 'ongoing', 'https://www.youtube.com/watch?v=Uy1fgtHmL6o', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "2276b29204c46f75064735477890afd6", "name": "Thần Thoại", "slug": "than-thoai"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Dương Dương,Kim Thần,Vương Thác,Triệu Tiểu Đường,Triệu Thanh,Kim Gia Diệp', 'Dương Dương', '2025-08-17 08:40:19.994', 'Hoàn Tất (30/30)', '30');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (237, '19c55330a38f78e86f61e1d2831a1543', 'ot-nho-thap-nien-80', 'Ớt Nhỏ Thập Niên 80', 'Spice Up The 80''s', 'https://phimimg.com/upload/vod/20250816-1/154a68bf6c56c9331e70ffc123b11f31.jpg', 'https://phimimg.com/upload/vod/20250816-1/93cc985c4c444b58712cde2af5bc6fc6.jpg', 2025, 'series', 'FHD', 'Vietsub', '12 phút/tập', 0, 'Cuối thập niên 80, cô gái mồ côi Lâm Hiểu Tiêu bị người cô ép gả chồng để lấy tiền sính lễ. Trong lúc tuyệt vọng, cô vùng lên phản kháng để viết lại số phận của mình. Cô dũng cảm đến Dương Thành, từ một nhân viên phục vụ nhà hàng, cô đã nhận thấy cơ hội kinh doanh và kiếm được đồng vốn đầu tiên. Sau đó, cô bước chân vào ngành thời trang, chống chọi với sự gây khó dễ của côn đồ, chịu đựng những âm mưu hãm hại từ đối thủ cạnh tranh và cùng với thiếu gia Lương Khác Thanh phá tan từng âm mưu. Từ một cô gái mồ côi ở Mai Giang trở thành một ngôi sao mới trong giới kinh doanh, hành trình lội ngược dòng của cô ẩn chứa nhiệt huyết và ánh hào quang của tất cả những người theo đuổi ước mơ!', 'ongoing', 'https://www.youtube.com/watch?v=ZYS1_nGi-EI', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Tông Nguyên Viên,Ngô Trúc Hi,Khương Ngọc Giai,Vương Nhân Khả,Lưu Dĩ Hạt', 'La Lạc', '2025-08-17 08:40:21.02', 'Tập 8', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (238, 'd1d0ce9cb7dc63978000e8d3b82c3f74', 'loi-uoc-dinh-cua-linh-hon', 'Lời Ước Định Của Linh Hồn', 'The Promise Of The Soul', 'https://phimimg.com/upload/vod/20250719-1/c0d060ca4a2f1d16654b22a7a260aa3c.jpg', 'https://phimimg.com/upload/vod/20250719-1/ad204c8ab06206338feba5f0464f2d92.jpg', 2025, 'series', 'FHD', 'Vietsub', '25 phút/tập', 0, 'Sau một tai nạn, ông Hạ Trà hoán đổi linh hồn với cháu trai Hạ Trạch Phương và buộc phải sống tiếp trong cơ thể cháu để duy trì cuộc sống của cậu. Trong hành trình tìm cách trả lại cơ thể, ông cùng người bạn cùng phòng Diệp Hải Uyên bắt đầu khám phá một mối quan hệ định mệnh, từ đó mở ra câu chuyện về tình thân, định mệnh và sự kết nối giữa các thế hệ.', 'ongoing', 'https://www.youtube.com/watch?v=Cd2ZdK2qNIY', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "af5f08b6445ca1def86fdd38cc1dc0b2", "name": "Đài Loan", "slug": "dai-loan"}]', 'Martin Wong,Kenji Fan,Yaron Qiu,Hong Wei,Li Ting,Kelly Liao,Mariko Okubo', 'Kai-Hui Wu,Joe Tsai', '2025-08-17 08:40:22.06', 'Tập 9', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (239, '06f867ad5a8dd38502b33ec03d5abc47', 'ke-san-ong', 'Kẻ Săn Ong', 'Under The Cover', 'https://phimimg.com/upload/vod/20250814-1/49cff78f2905989612d2b5f9c1cb0a7f.jpg', 'https://phimimg.com/upload/vod/20250814-1/8519d447efaf0a62326d8257a965d97c.jpeg', 2025, 'series', 'FHD', 'Vietsub', '19 phút/tập', 0, 'Để tìm em gái mất tích, cảnh sát Hàn Xuyên cải trang thành &quot;Thập Tam Ca&quot; - một tên lừa đảo huyền thoại, đột nhập vào hòn đảo biệt lập đầy rẫy cạm bẫy lừa đảo. Từ việc cứu em gái đến tiêu diệt tận gốc tội ác, trong vòng xoáy đan xen giữa tình huynh đệ, lợi ích, mưu mô, chân tình, chính nghĩa và tội ác, Hàn Xuyên dần dần khám phá ra sự thật đen tối bị che giấu trong khu vực này.', 'ongoing', 'https://www.youtube.com/watch?v=wFSC-5K6kE0', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Hắc Trạch,Thường Bân,Cao Tú Dương,Vương Nhược Khê,Hòa Lệ,Đinh Thánh Phi,Tống Sở Diệm,Mạch Lăng Trân,Tào Minh Hoa,Thôi Địch,Trương Khải Luân,Tả Tiểu Quang,Trương Vị Khoa', 'Li Xinbo', '2025-08-17 08:40:23.123', 'Tập 12', '29');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (240, 'b4fd263bb699f424cdb6a662af0049b2', 'huyet-quy-hon-chien', 'Huyết Quỷ Hỗn Chiến', 'Tougen Anki', 'https://phimimg.com/upload/vod/20250713-1/2c3c7db71c2ff172083e8e0c77768f8a.jpg', 'https://phimimg.com/upload/vod/20250713-1/a079fb1c44f1bfb42f7eb0a01a2acb15.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Rất lâu sau khi Momotaro huyền thoại chiến đấu với Oni, một thiếu niên nổi loạn phát hiện ra cuộc xung đột vẫn chưa kết thúc — và dòng máu nguy hiểm vẫn chảy trong huyết quản cậu.', 'ongoing', 'https://www.youtube.com/watch?v=j_0eK6R7fm8', NULL, NULL, false, '[{"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Kazuki Ura,Hiroshi Kamiya,Koutaro Nishiyama,Manaka Iwami,Shogo Sakata,Natsuki Hanae,Kaito Miura,Aimi', 'Đang cập nhật', '2025-08-17 08:40:24.193', 'Tập 6', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (241, 'af6e15cfa6c456895fd802a9d29ead74', 'hoi-ky-cua-rati', 'Hồi Ký Của Rati', 'Memoir Of Rati', 'https://phimimg.com/upload/vod/20250621-1/245d559c59a4417a4e2f2070cd0d50f0.jpg', 'https://phimimg.com/upload/vod/20250621-1/98e059b3d4870059bae21ae97e54df5b.jpg', 2025, 'series', 'FHD', 'Vietsub', '47 phút/tập', 0, 'Năm 1915, Rati trở về Xiêm và tìm thấy sự gắn kết với Thee — người thừa kế của một gia đình giàu có và quyền lực, nhưng mối quan hệ của họ lại bị chính gia đình đó tìm cách phá hoại.', 'ongoing', 'https://www.youtube.com/watch?v=o1vKWWNFaTI', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Sarin Ronnakiat,Sapol Assawamunkong,Kapook Ploynira Hiruntaveesin,Thanaboon Kiatniran,Tharatorn Jantharaworakarn,Sivakorn Lertchuchot,David Asavanond,Allan Asawasuebsakul,Thanik Kamontharanon,Tarika Thidathit,Penpetch Benyakul', 'Natchanit Jirarungroj', '2025-08-17 08:40:25.218', 'Tập 9', '12');
