INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (243, 'fbc32e91518e668c5c8da775c9d4bf1d', 'giai-dieu-cua-dinh-menh', 'Giai Điệu Của Định Mệnh', 'Heavenly Hand', 'https://phimimg.com/upload/vod/20250729-1/1678d7bda21d7d63433e912a85a02128.jpg', 'https://phimimg.com/upload/vod/20250729-1/9ae951c96af20e99f57f09fda0e6ff35.jpg', 2025, 'series', 'FHD', 'Lồng Tiếng', '43 phút/tập', 0, 'Thừa kế quán mạt chược Đại Long Phụng từ khi còn trẻ, Tư Đồ Cửu luôn được mọi người tin tưởng vì cách làm việc điềm tĩnh, kiên định. Một ngày nọ, anh bất ngờ mua lại một ban nhạc sắp phá sản vì một động cơ bí mật mà chỉ mình anh biết. Cùng lúc đó, Âu Dương Tông, một chủ tịch tập đoàn và từng là bại tướng trên bàn mạt chược của bố Tư Đồ Cửu, bỗng quay trở lại và rắp tâm đối phó với quán Đại Long Phụng. Giai Điệu Của Định Mệnh xoay quanh những nỗ lực của Tư Đồ Cửu để gìn giữ sản nghiệp gia đình trước những biến cố liên tục ập đến.', 'ongoing', 'https://www.youtube.com/watch?v=lvF7_bUrCpc', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "a0cd53c9875b96640ac264ca81996f9f", "name": "Hồng Kông", "slug": "hong-kong"}]', 'Đàm Tuấn Ngạn,Lý Giai Tâm,Khương Đại Vệ', 'Huỳnh Lập Cương', '2025-08-17 08:40:27.184', 'Tập 15', '25');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (244, 'eb95e630acb84f9cff9abfc310349381', 'chua-te-huyen-bi', 'Chúa Tể Huyền Bí', 'Lord Of The Mysteries', 'https://phimimg.com/upload/vod/20250628-1/b85e70f3b89c25f66500f12da35d7e8e.jpg', 'https://phimimg.com/upload/vod/20250628-1/284d3bacb70acfe48b06c82dcc7d1cca.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '34 phút/tập', 0, 'Trong thế giới thời Victoria ngập tràn hơi nước, tàu chiến và những điều huyền bí rợn người, Zhou Mingrui bất ngờ tỉnh lại trong thân xác của Klein Moretti. Bị cuốn vào vòng xoáy giữa các Giáo hội quyền lực, những nghi lễ cổ xưa và thế lực hắc ám, anh phải bước đi trên lưỡi dao mong manh giữa ánh sáng và bóng tối. Càng tiến sâu, Klein càng phát hiện ra một truyền thuyết kỳ bí về sức mạnh vô hạn - đi kèm là mối hiểm họa không thể gọi tên. Liệu anh sẽ trở thành người khai phá vận mệnh, hay bị chính nó nhấn chìm?', 'ongoing', 'https://www.youtube.com/watch?v=mhP2auKqilI', NULL, NULL, false, '[{"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:40:28.168', 'Tập 9', '13');
