INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (246, 'af7ea05940553f46a0aec14fdaf0d2e7', 'chi-rieng-minh-ban', 'Chỉ Riêng Mình Bạn', 'Only You', 'https://phimimg.com/upload/vod/20250719-1/ba17a90bd6d66640525d080ff679e736.jpg', 'https://phimimg.com/upload/vod/20250719-1/7d9520e031e5c840d34a4972758b3230.jpg', 2025, 'series', 'FHD', 'Vietsub', '46 phút/tập', 0, 'Nhiệm vụ bảo vệ người bạn học cũ – nay đã trở thành nghệ sĩ nổi tiếng – dần vượt khỏi khuôn khổ công việc, khi giữa họ nảy sinh tình cảm không ngờ tới.', 'ongoing', 'https://www.youtube.com/watch?v=lYoA6jBl4Vk', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Sirilak Kwong,Kornnaphat Sethratanapong,Khemapsorn Sirisukha,Nisachon Tuamsoongnuen,Paswitch Boorananut,Marilyn Kate Gardner,Thanchanok Yutthasarnsiri,Supoj Janjareonborn,Apinun Prasertwattanakul,Krittakan Prasitpanit', 'Saratsawadee Wongsomphet', '2025-08-17 08:40:30.32', 'Tập 5', '14');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (247, '71315bc6ea3c0b7c50d856508279487d', 'chang-khong-phai-nguoi-tot-quan-phi-luong-nhan', 'Chàng Không Phải Người Tốt (Quân Phi Lương Nhân)', 'Be Not Meant To Be', 'https://phimimg.com/upload/vod/20250806-1/0071ed25637754228140a9d7f0b020b8.jpg', 'https://phimimg.com/upload/vod/20250806-1/00974cde5b6cf5a66ef35d78e436e7d9.jpg', 2025, 'series', 'FHD', 'Vietsub', '15 phút/tập', 0, 'Vào thời Dân Quốc, Diệp Nam Chiêu bị chồng cũ phản bội và mất đi con gái ruột. Trên đường đi báo quan, cô bị bọn buôn người bắt cóc. Trong tình thế tuyệt vọng, cô buộc phải mạo danh thân phận của một phụ nữ đã chết để trở thành nhị phu nhân nhà họ Lục. Trớ trêu thay, người chồng cũ phản bội cô lại chính là tân cô gia của gia đình này, còn thân phận mà cô mạo danh thì để lại cho cô một đống rắc rối khó lường.', 'ongoing', 'https://www.youtube.com/watch?v=earA-_O0egk', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lý Mặc Chí,Đại Cao Chính,Trương Hinh Nguyệt,Lưu Yến Kiều,La Sở Phàm', 'Chu Cửu Cầm', '2025-08-17 08:40:34.332', 'Tập 20', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (248, '404d52bf50ab4f86fbf54376d0bcf0dd', 'cam-tu-trach-tam', 'Cẩm Tú Trạch Tâm', 'Threads Of Destiny', 'https://phimimg.com/upload/vod/20250810-1/47efc9a829d1b87322c642bda650911e.jpg', 'https://phimimg.com/upload/vod/20250810-1/b000ab6a8bf9e775671352db9dc77623.jpg', 2025, 'series', 'FHD', 'Vietsub', '16 phút/tập', 0, 'Phim kể về tỷ tỷ Khương Tuyết Doanh và muội muội Khương Vũ Nhi cùng sống lại. Sau khi đổi hôn sự, tỷ tỷ trở thành thế tử phi, đấu trí với nữ quyến chốn hậu viện, đồng thời chinh phục phu quân giả làm công tử ăn chơi. Hai vợ chồng cùng kề vai vạch trần âm mưu của kẻ phản diện.', 'ongoing', 'https://www.youtube.com/watch?v=8RaN0wDe9wc', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "3a17c7283b71fa84e5a8d76fb790ed3e", "name": "Cổ Trang", "slug": "co-trang"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Chu Lệ Nham,Tần Thiên Vũ,Mục Lạc Ân,Vương Trạch Hiên,Mã Quân Kha', 'Triệu Tây Hi', '2025-08-17 08:40:35.354', 'Tập 17', '26');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (249, '63a82e1bc44f8cf90a9189b4632951df', 'cam-bay-tinh-yeu-2024', 'Cạm Bẫy Tình Yêu', 'Dosa Cinta', 'https://phimimg.com/upload/vod/20250715-1/fa487c1eddfb947eaaebd1860d2e0560.jpg', 'https://phimimg.com/upload/vod/20250715-1/4a609dd411b92428e70449c5a1567a11.jpg', 2024, 'series', 'FHD', 'Vietsub', '39 phút/tập', 0, 'Bộ phim kể về câu chuyện của nữ sinh đại học Adelia (do Rita Nadira thủ vai). Cô có nhiệm vụ vén màn bí mật đen tối em gái mình là Kai (do Izzati Abdullah thủ vai) tự sát vào sáu năm trước. Sau đó, Adelia gặp Medha (do Tiz Zaqyah thủ vai), chủ của một khu nghỉ dưỡng ở Langkawi và là vợ của Ehad - người đàn ông hoàn hảo trong mắt Medha. Thông qua lần gặp gỡ này, Adelia có thể trả thù cho cái chết của em gái mình không?', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3f0e49c46cbde0c7adf5ea04a97ab261", "name": "Malaysia", "slug": "malaysia"}]', 'Rita Nadira,Tiz Zaqyah,Ikmal Amry,Azlee Khairi,Aidit Noh', 'Rahila Ali', '2025-08-17 08:40:36.379', 'Tập 11', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (250, '1697fe5eb0141dca1379090a4d766cc7', 'bien-hoa', 'Biển Hoa', 'Flower Sea', 'https://phimimg.com/upload/vod/20250808-1/d09d22cd2042d7cd211b87b656abe5d0.jpg', 'https://phimimg.com/upload/vod/20250808-1/7edc49ad772e555be5cfba208a51986b.jpg', 2025, 'series', 'FHD', 'Vietsub', '28 phút/tập', 0, 'Vào một buổi sáng nọ, Trần Tĩnh An và Chúc Niên Niên hoán đổi linh hồn với nhau. Trần Tĩnh An trở thành “cô công chúa nhà giàu”, còn Chúc Niên Niên lại thành “em gái” của người cô thầm thích. Nhưng khi cả hai cùng Trần Trường Ninh – người đã phát hiện ra sự thật – điều tra nguyên nhân vụ hoán đổi, thì ngày càng nhiều sự việc khiến tình hình trở nên rối rắm hơn, và mọi chuyện bắt đầu phát triển theo một hướng khó lường…', 'ongoing', 'https://www.youtube.com/watch?v=lv_4Tq1aFSs', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Trần Xu Quân,Vương Nguyệt Đình,Tào Ân Tề,Triệu Bá Tùng,Ân Thấm', 'Trần Vĩ Tường', '2025-08-17 08:40:37.336', 'Tập 22', '24');
