INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (251, '002fdf1e30206e2b0289c5bdc7d5a369', 'bi-mat-cua-phu-thuy-tinh-lang', 'Bí Mật Của Phù Thủy Tĩnh Lặng', 'Secrets Of The Silent Witch', 'https://phimimg.com/upload/vod/20250705-1/0eac34475ca78761aed40ad8ef04fd8f.jpg', 'https://phimimg.com/upload/vod/20250705-1/80111763a3c22f5c4c77d6a9bb9ebdce.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Monica Everett được mệnh danh là &quot;phù thủy im lặng&quot; - thiên tài duy nhất có thể sử dụng phép thuật mà không cần niệm chú, thậm chí từng một mình hạ gục rồng đen huyền thoại. Nhưng đằng sau sức mạnh phi thường đó lại là một cô gái siêu nhút nhát, sợ hãi khi phải nói trước đám đông. Giờ đây, cô được giao một nhiệm vụ không chỉ nguy hiểm vì kẻ thù tàn độc mà còn đáng sợ bởi những cuộc trò chuyện xã giao, đó là bí mật bảo vệ hoàng tử thứ hai. Trong thế giới nơi lời nói chính là sức mạnh, liệu sự im lặng của cô có đủ để cứu lấy mọi người và chính bản thân mình?', 'ongoing', 'https://www.youtube.com/watch?v=0OBF29HoV4A', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Saya Aizawa,Hitomi Nabatame,Junichi Suwabe,Atsumi Tanezaki,Shogo Sakata,Kanna Nakamura,Yoshiki Nakajima,Ryohei Kimura,Yuki Sakakihara,Yoko Hikasa,Mao Ichimichi,Hina Suguta,Shun