INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (256, 'b02e588aac5fb0396ed0293ebaba8326', 'lang-thien-doc-ton', 'Lăng Thiên Độc Tôn', 'Overlord Of The Sky', 'https://phimimg.com/upload/vod/20250719-1/b5864c72d2f3811c4a81cffcd67eaa4d.jpg', 'https://phimimg.com/upload/vod/20250719-1/9d75341ac87b3cee68b2c02e8726bb0e.jpg', 2025, 'series', 'FHD', 'Vietsub', '13 phút/tập', 0, 'Nổi tiếng khắp giang hồ như một vị cao thủ kiếm thánh nhưng vì để bảo vệ người tình trong mộng của mình mà Lăng Thiên đã phải làm những việc đi ngược với đạo trời, chính vì vậy mà anh chàng đã bị Thiên Đạo nhắm đến và nổ ra một trận chiến kinh thiên động địa. Trong thời khắc quyết định, Lăng Thiên đã nằm xuống cùng với Thiên Đạo. Nhưng tưởng như vậy là đã đăng xuất thì Lăng Thiên lại bị đưa ngược trở lại thời điểm 300 năm về trước, đó là lúc mà mọi thứ còn đang dang dở, người yêu đang bên cạnh hắn, nhưng kẻ thù cũng vẫn còn đó, thậm chí là hắn lại phải tu luyện một lần nữa để quay trở lại đỉnh cao của kiếm thánh. Con đường tu luyện dài đằng đẵng một lần nữa mở ra, thách thức và đợi chờ Lăng Thiên chinh phục.', 'ongoing', 'https://www.youtube.com/watch?v=En_Q0uFA34c', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:40:41.319', 'Tập 17', '13');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (257, '83ceae014fabf2e56e69da4b132f4f6b', 'sieu-nhan-2025', 'Siêu Nhân', 'Superman', 'https://phimimg.com/upload/vod/20250717-1/0f52ee982b3b734555934ea2198b8511.jpg', 'https://phimimg.com/upload/vod/20250717-1/9db34f2c6ae544a645e5d8662afdbadc.jpg', 2025, 'single', 'FHD', 'Vietsub', '130 phút', 0, 'Mùa hè tới đây, Warner Bros. Pictures sẽ mang “Superman” - phim điện ảnh đầu tiên của DC Studios đến các rạp chiếu trên toàn cầu. Với phong cách riêng biệt của mình, James Gunn sẽ khắc họa người hùng huyền thoại trong vũ trụ DC hoàn toàn mới, với sự kết hợp độc đáo của các yếu tố hành động đỉnh cao, hài hước và vô cùng cảm xúc. Một Superman với lòng trắc ẩn và niềm tin vào sự thiện lương của con người sẽ xuất hiện đầy hứa hẹn trên màn ảnh.', 'completed', 'https://www.youtube.com/watch?v=nZTgJy8ym34', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'David Corenswet,Rachel Brosnahan,Nicholas Hoult,Edi Gathegi,Anthony Carrigan,Nathan Fillion,Isabela Merced,María Gabriela de Faría,Skyler Gisondo,Sara Sampaio,Mikaela Hoover,Zlatko Burić,Pruitt Taylor Vince,Neva Howell,Wendell Pierce,Christ', 'James Gunn', '2025-08-17 08:40:42.361', 'Full', '1');
