INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (264, 'b3caae6857cf5662d007d49b4ace0e05', 'na-tra-nao-hai', 'Na Tra Náo Hải', 'Nezha Conquers The Dragon King', 'https://phimimg.com/upload/vod/20250815-1/d6cd48b313296c628d11f14afb0b1082.jpg', 'https://phimimg.com/upload/vod/20250815-1/431f78f2235d2dd18a573ffe30d31ddc.jpg', 1979, 'single', 'FHD', 'Vietsub', '65 phút', 0, 'Vào cuối thời Thương, phu nhân của tổng binh Trần Đường Quan là Lý Tịnh mang thai suốt 3 năm 6 tháng, cuối cùng sinh ra một khối thịt. Từ trong khối thịt đó nhảy ra một cậu bé lanh lợi, đáng yêu. Lý Tịnh cho rằng đó là yêu nghiệt nên muốn giết đi, may nhờ Thái Ất Chân Nhân đến kịp, nhận cậu làm đồ đệ, đặt tên là Na Tra, và ban cho hai pháp bảo là Càn Khôn Quyền và Hỗn Thiên Lăng. Một năm nọ, thiên hạ đại hạn, không có mưa ngọt. Na Tra cùng gia tướng xuống Đông Hải tắm và vui chơi. Cậu dùng Hỗn Thiên Lăng khuấy động biển cả, làm rung chuyển Long Cung, chọc giận Tuần Hải Dạ Xoa Lý Cấn và Tam Thái Tử của Long Vương là Ngao Bính. Sau nhiều lần lời qua tiếng lại, Na Tra giết cả hai, gây nên đại họa kinh thiên. Tứ Hải Long Vương cùng kéo đến Trần Đường Quan đòi mạng. Để cứu muôn dân, Na Tra quyết định hiến dâng sinh mệnh của mình…', 'completed', 'https://www.youtube.com/watch?v=qZiCqnt-7QM', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a2492d6cbc4d58f115406ca14e5ec7b6", "name": "Gia Đình", "slug": "gia-dinh"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2276b29204c46f75064735477890afd6", "name": "Thần Thoại", "slug": "than-thoai"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69