INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (267, '05d157c6e2277aee356e685257ac5783', 'me-chong-nang-dau-2025', 'Mẹ Chồng Nàng Dâu', 'Norma: Antara Mertua dan Menantu', 'https://phimimg.com/upload/vod/20250815-1/15dfae04aa046eb65fc0624a6e8faa88.jpg', 'https://phimimg.com/upload/vod/20250815-1/1309dbbb44ba91f418fcbe9105feae27.jpg', 2025, 'single', 'FHD', 'Vietsub', '134 phút', 0, 'Khi một cô gái trẻ phát hiện mối quan hệ vụng trộm giữa mẹ mình và chồng, cô phải đối mặt với một quyết định khó khăn: tha thứ hay tìm cách đòi lại công lý.', 'completed', 'https://www.youtube.com/watch?v=vf4eae70HDE', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "4647d00cf81f8fb0ab80f753320d0fc9", "name": "Indonesia", "slug": "indonesia"}]', 'Tissa Biani,Wulan Guritno,Yusuf Mahardika,Rukman Rosadi,Nunung,Erick Estrada,Naura Hakim,Adila Fitri,Tomy Babap,Willem Bevers,Neysa Chandria,Intan RJ,Devi Permatasari,Sadhenna Sayanda', 'Guntur Soeharjanto', '2025-08-17 08:40:51.555', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (268, '1b976c57ad20e7dd4c0893de342d0cff', 'mat-tich', 'Mất Tích', 'Missing', 'https://phimimg.com/upload/vod/20240917-1/d7bc9be6f3b7bf91ac548141da3d2923.jpg', 'https://phimimg.com/upload/vod/20240917-1/e92a76da9b453cf52424ef3dbe5e9baa.jpg', 2024, 'single', 'FHD', 'Vietsub', '119 phút', 1, 'Một cô bé mất tích khi đang đi bộ trên đường. Ba tháng trôi qua mà không có bất kỳ manh mối nào về tung tích của cô. Khi con gái mất tích, người mẹ Saori đã đi xem buổi biểu diễn trực tiếp của thần tượng yêu thích. Thông tin này và những tin đồn về Saori bắt đầu lan truyền trên mạng. Những lời đồn về cô ngày càng trở nên tồi tệ hơn theo thời gian. Hơn nữa, Saori cảm thấy chồng mình ngày càng lạnh nhạt. Điều này khiến họ cãi vã không ngừng. Khi thời gian trôi qua, sự chú ý của các phương tiện truyền thông lớn dần phai nhạt về vụ mất tích của cô bé, chỉ có một đài truyền hình địa phương vẫn tiếp tục theo dõi vụ việc. Nhưng rồi...', 'completed', 'https://www.youtube.com/watch?v=ypw94YiGwxE', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', '石原さとみ,青木崇高,森優作,Tsugumi Arita,小野花梨,小松和重,Gaku Hosokawa,Shinsuke Kato,Naohiro Yamamoto,柳憂怜,美保純,中村倫也', 'Keisuke Yoshida', '2025-08-17 08:40:52.474', 'Full', '1');
