INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (272, 'efb926bfce4f58539b1c2b45a5676b09', 'canh-buom-gian-diep', 'Cánh Bướm Gián Điệp', 'Butterfly', 'https://phimimg.com/upload/vod/20250815-1/e6d79892d8128d032acb48f12f859fa2.jpg', 'https://phimimg.com/upload/vod/20250815-1/4b5ab78aff6908bd081e17a6fbca2e72.jpg', 2025, 'series', 'FHD', 'Vietsub', '51 phút/tập', 0, 'David Jung — cựu đặc vụ tình báo Mỹ, ẩn mình nhiều năm trên đất Hàn Quốc, sống lặng lẽ giữa bóng tối. Nhưng quá khứ không bao giờ ngủ yên. Một quyết định bất khả thi mà anh từng đưa ra đã quay trở lại, thổi tung cuộc sống hiện tại thành từng mảnh. Giờ đây, David trở thành con mồi của hai kẻ săn tàn nhẫn: Rebecca - sát thủ trẻ đẹp nhưng chết chóc, và Caddis - tổ chức gián điệp ngầm với những móng vuốt vươn khắp nơi.&nbsp;', 'ongoing', 'https://www.youtube.com/watch?v=RBmyiyZba3s', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Daniel Dae Kim,Reina Hardesty,Piper Perabo,Louis Landau,Kim Tae-hee,Sean Dulake,Charles Parnell,Kim Ji-hoon,Park Hae-soo', 'Ken Woodruff', '2025-08-17 08:40:56.55', 'Tập 2', '6');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (273, '8feddc18ebc59ad43f459ab72b07f93f', 'cuoc-tuyen-chon-cuoi-cung', 'Cuộc Tuyển Chọn Cuối Cùng', 'Final Draft', 'https://phimimg.com/upload/vod/20250815-1/523ade56fa0efa862736c9d1bdc04412.jpg', 'https://phimimg.com/upload/vod/20250815-1/2e1daa476db879ff1c12ffe146a3e335.jpg', 2025, 'tvshows', 'FHD', 'Vietsub', '60 phút/tập', 0, 'Có người phải từ bỏ sự nghiệp, có người giải nghệ khi đang ở đỉnh cao. Giờ đây, các vận động viên ở nhiều bộ môn có cơ hội cuối cùng để cứu chuộc và giải quyết chuyện cũ.', 'completed', 'https://www.youtube.com/watch?v=3A1EQWiA_gw', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:40:57.573', 'Hoàn Tất (8/8)', '8');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (274, 'cd7a3678e92f33f1affad511486f68da', 'thuong-lan-quyet-ban-hoat-hinh-phan-2', 'Thương Lan Quyết (Bản Hoạt Hình) (Phần 2)', 'Love Between Fairy And Devil (Season 2)', 'https://phimimg.com/upload/vod/20250803-1/124d7fa9873b76aa5fe7c33d0ea89ff2.jpg', 'https://phimimg.com/upload/vod/20250803-1/eb1dd7e0cd1e718b8bade0327b81df47.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '15 phút/tập', 0, 'Sau đại chiến long trời lở đất, Đông Phương Thanh Thương trở về biển Thương Viêm, nhưng không ngờ lại rơi vào cái bẫy đã được giăng sẵn của quân sư Khổng Tước. Sóng gió chưa kịp lắng xuống, một biến cố khác lại ập đến. Ở bên kia, Chiến thần Xích Địa liên tục xuất hiện trong những giấc mơ của Tiểu Lan Hoa. Ẩn ý phía sau là gì? Hành trình “oan gia” giữa Đông Phương và Tiểu Lan Hoa mới đi được nửa chặng thì Ảnh Tam Giới - một thế lực thần bí nằm ngoài Tam giới – bắt đầu bước ra ánh sáng, và một bí mật to lớn vốn bị chôn vùi từ lâu dần hé lộ...', 'ongoing', 'https://www.youtube.com/watch?v=sjbtq6AEkls', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Ajie,Nie Xiying,Yang Tianxiang', 'Đang cập nhật', '2025-08-17 08:40:58.602', 'Tập 7', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (275, '6dd36e7dc260bc1beeb79a33da67b5df', 'thon-phe-tinh-khong', 'Thôn Phệ Tinh Không', 'Swallowed Star', 'https://phimimg.com/upload/vod/20240821-1/a651652396e9f53c09cd88d28700d5c4.jpg', 'https://phimimg.com/upload/vod/20240821-1/22c49ba9590b0e5f3d126696c0bfbecf.jpg', 2020, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Một ngày nọ, một chiếc virus RR ko xác định xuất hiện trên trái đất, và thế giới rơi vào thảm họa. Động vật bị nhiễm bệnh đột biến thành quái vật đáng sợ và tấn công ồ ạt. Khi con người đối mặt sở hữu sự hủy diệt, họ xây tường và xây dựng các tỉnh thành căn cứ như pháo đài cuối cùng của con người. Những thử thách mà nhân loại trải qua trong khoảng thời gian này được gọi là “Thời kỳ Niết bàn.” Trong môi trường sống khắc nghiệt, sức mạnh của con người cũng dần thăng tiến và phát triển, võ công xuất hiện, sức mạnh của con người cũng tăng lên về chất so mang trước đây. Và thấp nhất trong số họ được gọi là Chiến binh. Luo Feng, 18 tuổi, cũng thèm khát trở nên một trong số họ.', 'ongoing', 'https://www.youtube.com/watch?v=pUcsPl2ikk4', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Zhang Xin,Wang Xiaobing,Zhihao Su,Vin Zhang,Li Chanfei,Lei Wu,Yuze Sang,Ruoyu Zhang,Zhao Qianjing,Xie Ying,张晔,赵梓涵', 'Đang cập nhật', '2025-08-17 08:40:59.624', 'Tập 184', '208');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (276, 'adac904ea275fdefc65d4c4c998ea7cb', 'tsuyokute-new-saga', 'Tsuyokute New Saga', 'New Saga', 'https://phimimg.com/upload/vod/20250720-1/3e79546d23e577ca51a5e8dcd1c0edbe.jpg', 'https://phimimg.com/upload/vod/20250720-1/a06e506cb853131687fe90b87916f84c.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Sau một cuộc chiến tàn khốc, kiếm sĩ ma pháp Kyle đánh bại Ma Vương nhưng bị thương nặng sắp chết. Một tinh thể đỏ đưa anh quay về quá khứ bốn năm trước, đến quê hương từng bị hủy diệt, nơi anh tìm thấy những người thân yêu đã mất vẫn còn sống. Với kiến thức từ tương lai, Kyle thề sẽ ngăn chặn bi kịch sắp tới và viết lại định mệnh.', 'ongoing', 'https://www.youtube.com/watch?v=BaomnapVQ-0', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yuma Uchida,Hiro Shimono,Fairouz Ai,Asami Seto,Minami Takahashi,Hiroki Yasumoto,Kaori Maeda,Rie Hikisaka,Riho Sugiyama,Tetsu Inada', 'Đang cập nhật', '2025-08-17 08:41:00.853', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (277, 'e9ef4cc28cff2bbfaa9cca870ef88b58', 'tien-sung', 'Tiên Sủng', 'Celestial Bonds', 'https://phimimg.com/upload/vod/20250614-1/06713b7378411d0836c6c774924f84cd.jpg', 'https://phimimg.com/upload/vod/20250614-1/b92183b741b237dd4227ff358361da51.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '22 phút/tập', 0, 'Một trăm năm trước, Tiên nữ Thiên Quyển đã chém Thận quân khiến Thận yêu biến mất khỏi Thương Sóc, nhưng cô cũng mất đi ký ức về trận chiến. Sau chiến tranh, Thiên Quyển hạ phàm làm Thổ Địa, nuôi chim Ly Kiêu — sinh vật hóa thành người với dung mạo giống người tình đã khuất Thiệu Vị Ly. Khi Ly Kiêu đi khỏi nhiều ngày, Thiên Quyển đến trấn La Y và phát hiện toàn bộ dân làng bị sát hại, Thận yêu tái xuất hiện. Thiên Quyển cùng Ly Kiêu hợp lực chống lại yêu quái, giải cứu trấn La Y. Trong lúc ký ức dần hồi phục, Thiên Quyển nhận ra mối liên hệ sâu sắc giữa Thiệu Vị Ly, Ly Kiêu và Thận quân mà cô từng giết.', 'ongoing', 'https://www.youtube.com/watch?v=V5w25NpnX8M', NULL, NULL, false, '[{"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Liu Xiaoyu,Qian Chen,Liu Sanmu,Yang Kaiqi,Ajie,Chen Zhangtaikang,Shuang Zhao', 'Đang cập nhật', '2025-08-17 08:41:01.779', 'Tập 12', '18');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (278, '8f64c0a6975ce782d1adaf73ce892d51', 'ma-thien-ky', 'Ma Thiên Ký', 'Demon''s Ascension', 'https://phimimg.com/upload/vod/20250617-1/9159ab7268a534668e1d4266df7c8f69.jpg', 'https://phimimg.com/upload/vod/20250617-1/134ca1412a01f92f1b69c9d9cc8cf2cb.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '20 phút/tập', 0, 'Khi một thiếu niên lưu lạc lớn lên giữa vòng xoáy của kẻ ác bước vào thế giới tu tiên, điều gì sẽ xảy ra? Tiên – Ma chỉ cách nhau một niệm, sống chết chẳng do trời định. Hãy cùng theo dõi hành trình của cậu – người nghịch dòng số mệnh trong một thế giới nơi người và ma cùng tồn tại, yêu quái hoành hành, để vươn lên đỉnh cao và trở thành truyền thuyết.', 'ongoing', 'https://www.youtube.com/watch?v=5Xho2k4vBRM', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', '路扬,Qing Liu,Liangwei Hu,Zhao Chengchen,魏茹晨', 'Ding Lingtao', '2025-08-17 08:41:02.704', 'Tập 11', '16');
