INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (280, 'f6556dfe948f58c57650fc8c13294030', 'chuyen-sinh-thanh-de-that-hoang-tu-toi-quyet-dinh-trau-doi-ma-thuat-phan-2', 'Chuyển Sinh Thành Đệ Thất Hoàng Tử, Tôi Quyết Định Trau Dồi Ma Thuật (Phần 2)', 'I Was Reincarnated As The 7th Prince So I Can Take My Time Perfecting My Magical Ability (Season 2)', 'https://phimimg.com/upload/vod/20250710-1/cab351b8ef669d0ec7376d049da6fd9a.jpg', 'https://phimimg.com/upload/vod/20250710-1/000e73a7161b4ee5c0eef0f24cf3a70e.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Vẫn nhớ về lần gần nhất chuyển sinh thành pháp sư, vị hoàng tử trẻ bèn dốc hết tâm sức học phép thuật. Nhưng là nhân vật hoàng gia 10 tuổi thì cũng gặp những thách thức riêng!', 'ongoing', 'https://www.youtube.com/watch?v=x_lyzvuPOSs', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Makoto Koichi,Fairouz Ai,Lynn,Akira Sekine,Rie Takahashi,Shun Horie,Yuya Hirose,Akane Kumada,Eriko Matsui,Tomokazu Sugita,Satomi Akesaka,Shunichi Toki,Takuma Nagatsuka,Nobunaga Shimazaki', 'Đang cập nhật', '2025-08-17 08:41:04.642', 'Tập 6', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (281, 'a4f87e21ec472bbff8435588d5b08a8f', 'di-hat-karaoke-di', 'Đi Hát Karaoke Đi!', 'Let''s Go Karaoke!', 'https://phimimg.com/upload/vod/20250809-1/41168c4ef4128714911d46a99f5c02a0.jpg', 'https://phimimg.com/upload/vod/20250809-1/275268921f73eb5ea4ddadc477cbcc58.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Hayashi – cậu học sinh kỳ lạ với thói quen đếm bậc thang, chụp biển báo đường phố và phơi khoai lang trên ban công lớp học – luôn sống thật với chính mình, bất chấp mọi ánh nhìn. Trong khi đó, Nikaidou lại cố giấu mình sau vẻ lạnh lùng, u ám khiến ai cũng dè chừng. Nhưng khi một người bắt đầu nhìn thấy điều khác lạ phía sau lớp mặt nạ ấy, mọi khoảng cách dần bị thu hẹp…', 'ongoing', 'https://www.youtube.com/watch?v=sw6kD6f9l8M', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Shun Horie,Daisuke Ono,Shinnosuke Tokudome,Hidenobu Kiuchi', 'Đang cập nhật', '2025-08-17 08:41:05.591', 'Tập 4', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (282, '90be09f2c0cf80e0004fc73d2a72473d', 'du-tan-hanh-gia', 'Dư Tẫn Hành Giả', 'Embers', 'https://phimimg.com/upload/vod/20250613-1/bd352eebc9d159abc450757aa14c70f4.jpg', 'https://phimimg.com/upload/vod/20250613-1/b25e831b5d2c543493c9615588efcc13.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '22 phút/tập', 0, 'Đoan Mộc Dạ Vũ, thiếu niên mang ước mơ trở thành thợ săn địa ngục, vô tình cứu một người máy cải tạo và lấy đi vật dụng quan trọng trong nhiệm vụ tuyệt mật. Hành động vô ý ấy châm ngòi cho cuộc truy lùng quy mô lớn của phe phản diện, đẩy thành Dư Tẫn vào cuộc chiến sinh tử khởi nguồn từ lòng tốt ngây thơ của một cậu bé.', 'ongoing', 'https://www.youtube.com/watch?v=LdaX0Pm6oRc', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:06.539', 'Tập 12', '15');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (283, '6b8268b2aea8c743f066d9a8f5d056f6', 'dan-da-dan-phan-2', 'Dan Da Dan (Phần 2)', 'Dan Da Dan (Season 2)', 'https://phimimg.com/upload/vod/20250704-1/7b759d5356cd982a45eb812ddfbeec2b.jpg', 'https://phimimg.com/upload/vod/20250704-1/69a3b7a6f3369a96b99930ba0be0bedd.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Lồng Tiếng', '24 phút/tập', 0, 'Dan Da Dan (Phần 2) tiếp tục theo chân Momo và Okarun trong hành trình khám phá thế giới siêu nhiên đầy biến động. Khi các thế lực mới ngày càng mạnh mẽ và nguy hiểm hơn xuất hiện, cả nhóm buộc phải đối mặt với những bí ẩn rùng rợn và quá khứ chưa từng được hé lộ. Thế giới càng trở nên kỳ quái, dữ dội nhưng cũng đầy cuốn hút. Xen giữa những trận chiến sinh tồn nghẹt thở là loạt khoảnh khắc &quot;lầy lội&quot; làm nên hành trình trưởng thành của cặp đôi bá đạo cùng nhóm bạn thân.', 'ongoing', 'https://www.youtube.com/watch?v=uXr9Ha9qRHE', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Shion Wakayama,Natsuki Hanae,Ayane Sakura,Nana Mizuki', 'Fuuga Yamashiro', '2025-08-17 08:41:07.507', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (284, 'd2a7069e603da0c9e813ce0c6a376d10', 'da-ngoai-mot-minh-cung-nhau', 'Dã Ngoại Một Mình Cùng Nhau', 'Solo Camping For Two', 'https://phimimg.com/upload/vod/20250810-1/e92a2d01408ed639962d3d1331373358.jpg', 'https://phimimg.com/upload/vod/20250810-1/f937e8cb0b8dc1e3987e54ab2af3f76d.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Gen, người đàn ông yêu thích sự cô đơn giữa thiên nhiên, chỉ muốn tận hưởng những chuyến cắm trại một mình. Thế nhưng, một cuộc gặp gỡ tình cờ với Shizuku, cô nàng mới toanh trong thế giới cắm trại, đã khiến mọi thứ thay đổi. Từ hai kẻ xa lạ, họ bắt đầu một hành trình độc đáo: &quot;cắm trại một mình… cùng nhau.&quot;', 'ongoing', 'https://www.youtube.com/watch?v=s7aK_ckCCbU', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Daiki Hamano,Mizuki Niizaki', 'Đang cập nhật', '2025-08-17 08:41:08.458', 'Tập 6', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (286, '78b42f064d22bb6a65d4e956becb2e02', 'do-thi-co-tien-y', 'Đô Thị Cổ Tiên Y', 'Urban Miracle Doctor', 'https://phimimg.com/upload/vod/20241018-1/422e01866d2bfcb0adfd4ae2a31ef32f.jpg', 'https://phimimg.com/upload/vod/20241018-1/f39df234908b4305fdd20c97020c0eea.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '9 phút/tập', 0, 'Sinh viên đại học năm thứ ba Diệp Bất Phàm, làm người giả bị đụng cho mẫu thân gom góp tiền chữa bệnh, nhưng gặp phải không theo như chiêu thức ra bài nữ tài xế, bị đụng sau lấy được được Cổ y môn truyền thừa, từ đây thông y thuật, tu công pháp, chơi chuyển đô thị, thắng được vô số người đẹp xem trọng.', 'ongoing', 'https://www.youtube.com/watch?v=A_ikX4OhoH4', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:09.866', 'Tập 96', '150');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (288, 'b8516c82e38e6b34bc96330a3ba59b03', 'dai-luc-linh-vo', 'Đại Lục Linh Võ', 'Legend of Lingwu Continent', 'https://phimimg.com/upload/vod/20250224-1/f10d225c86bd40ae0eaa2ef5d957c24e.jpg', 'https://phimimg.com/upload/vod/20250224-1/f68af9aa9f67c035f72938fb5291ba55.jpg', 2024, 'hoathinh', 'FHD', 'Vietsub', '10 phút/tập', 0, 'Một thế giới mà linh lực và võ hồn cùng tồn tại, chỉ một ý niệm của linh tu có thể dời non lấp biển, võ giả tay không phá vỡ thiên địa. Thiên tài Thần Thiên, sau 10 tuổi võ hồn không thấy, linh hải khô cạn, trở thành phế vật của gia tộc. Sau đó vào nhầm đại trận của Cổ Kiếm Đế, có được cơ duyên lớn, từ đó cuộc đời thay đổi, phá Thiên Đạo, nắm giữ luân hồi, độ Đế kiếp, trở thành người đứng đầu Linh Võ Đại Lục.', 'ongoing', '', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:11.443', 'Tập 100', '120');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (292, '3824ab9a06b2d12d1221c7f79bd17da5', 'quan-huu-van-phan-2', 'Quân Hữu Vân (Phần 2)', 'Word Of Honor (Season 2)', 'https://phimimg.com/upload/vod/20250626-1/6806b2c7e01a09b0cd57691fb6aee5ae.jpg', 'https://phimimg.com/upload/vod/20250626-1/80e459757bc285b36ce66f42412c5652.jpg', 2022, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '20 phút/tập', 0, '4 thiếu niên rời khỏi trường bước chân vào giang hồ, trên đường tìm kiếm chân tướng, làm sáng tỏ câu đố thân thế. Vì thành quân tử mà trải qua muôn vàn khó khăn nguy hiểm. Họ trọng đạo quân tử, thể hiện sự hiệp nghĩa lấy thân là sức, thực hiện công đạo nhân gian. Một bộ kỳ thư, một trận ân oán, một loại tín ngưỡng, một đoạn truyền kỳ.', 'ongoing', 'https://www.youtube.com/watch?v=J2_CKATSyJ0', NULL, NULL, false, '[{"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Zhang Fuzheng,Tang Xiaoxi,Jie Cai,Li Lanling,Wei Chao,Jinwen Chen,Liu Cong,Li Shimeng,Haiting Cai,Titus Jin,Liu Mingyue,Teng Xin', 'Đang cập nhật', '2025-08-17 08:41:14.061', 'Tập 14', '32');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (293, 'ea8f123bcd0751b651e0944774d790e0', 'ta-la-dao-tong', 'Ta Là Đao Tông', 'I Am The Blade', 'https://phimimg.com/upload/vod/20250725-1/8e383a9e0066ee11ffc1d8aa745cb57a.jpg', 'https://phimimg.com/upload/vod/20250725-1/98fde2db0a6d463590924d0c401ccfe3.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '20 phút/tập', 0, 'Trong một âm mưu giang hồ, Tông chủ Đao Tông – võ lâm chí tôn – bị sát hại, các thủ lĩnh bang phái lớn hoặc bỏ mạng, hoặc rơi vào vòng lao ngục, khiến giang hồ rơi vào hỗn loạn. Để tái lập trật tự võ lâm, Yến Ký Vũ – các chủ Trường Phong Các – cử sứ giả đến các môn phái, mưu đồ xây dựng một võ lâm “chính khí” do hắn đứng đầu. Trong lúc đó, Dương Nhận – một kẻ vừa bước chân vào giang hồ – nhận ủy thác đưa đi bức thư do Đao Tông để lại. Dọc đường, kẻ địch rình rập, hiểm nguy trùng trùng, nhưng anh nhờ nhiệt huyết và nghĩa hiệp mà không ngừng vượt qua bản thân, đánh bại đối thủ, võ công tiến bộ vượt bậc, đồng thời kết giao được nhiều người hào hiệp chính nghĩa. Giang hồ nên là nơi như thế nào? Dương Nhận không có câu trả lời, nhưng anh biết chắc chắn đó không phải là thứ giang hồ “chính khí” mà Yến Ký Vũ tạo ra. Dương Nhận dựng lá cờ “Thừa Phong Bang”, nhanh chóng quy tụ những người phản đối Yến Ký Vũ. Đại chiến sắp nổ ra, không ai có thể đứng ngoài. Sau cái chết của Đao Tông, giang hồ đã chia cắt bấy lâu, nay sẽ được khâu lại với sự xuất hiện của tân Đao Tông.', 'ongoing', 'https://www.youtube.com/watch?v=23Xhy8blZ30', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:14.996', 'Tập 8', '16');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (294, 'ba0745192120cbda87da3de261ec9f02', 'song-sinh-vo-hon', 'Song Sinh Võ Hồn', 'The Rise Of Twin Souls', 'https://phimimg.com/upload/vod/20250725-1/c8f465cee0f9ff68ac8425e55add699d.jpg', 'https://phimimg.com/upload/vod/20250725-1/4ca116d416f7e7b621bc5cbe8f03df98.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '12 phút/tập', 0, 'Lâm Phàm, xuất thân từ thế gia tại Đại Lâm quận, vốn là thiên tài tuyệt thế sở hữu Thiên Kiêu Lệnh, nhưng lại bị vị hôn thê đoạt mất võ hồn, trở thành phế vật. Khi một Ma Vương lai lịch thần bí ký sinh trên người, hắn khôi phục được võ hồn đã bị phế và trở thành người mang thể chất song võ hồn hiếm có. Từ đây, Lâm Phàm chính thức bước lên con đường quật khởi, từ một tiểu thành của quận nhỏ, tung hoành chư thiên vạn giới.', 'ongoing', 'https://www.youtube.com/watch?v=wd_JGT2ufIA', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Wang Qiuhao,Liu Man,Li Min,Shi Zekun', 'Tinghe Li', '2025-08-17 08:41:16.007', 'Tập 16', '60');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (295, '3aef625160d85a9fc3b52f3be4474ed5', 'de-linh-yeu-mac-thuy-linh-lung', 'Đế Linh Yêu Mặc Thuỷ Linh Lung', 'Divine Love Deep Blue', 'https://phimimg.com/upload/vod/20250802-1/30f12e6c13f801fd2146913879f4409b.jpg', 'https://phimimg.com/upload/vod/20250802-1/4f7f04c688a3d3e2bfb6bde6eb796296.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '14 phút/tập', 0, 'Câu chuyện bắt đầu từ thuở xa xưa, khi mà vạn vật trên đời này đều sở hữu những nguồn sức mạnh và ý thức của riêng mình, dù là nhỏ nhoi và ít ỏi, nhưng gộp chung lại thì chúng tạo ra những thực thể với sức mạnh và ý thức vô cùng to lớn, có thể gọi đó là những tiên tử. Nhưng tiên tử cũng đang bị đe dọa bởi sự cuồng vọng của con người, và thêm với việc lớp phong ấn của một thứ sinh mạnh kỳ bí đang dần bị phá hỏng, các tiên tử dần chịu cảnh thương tổn không ít. Trong khi đó thì một nữ nhân lại vô tình gặp được một tiên tử, họ nảy sinh rất nhiều thứ tình cảm với nhau, mà ta có thể gọi đó chính là tình yêu, nhưng rào cản giữa tiên và người đã dần ngăn cách họ. Vô cùng đau buồn vì sự thực nghiệt ngã ấy, nữ nhân kia đã quyết tâm lên đường để chinh phục những thứ sức mạnh mới cho bản thân, tìm ra bản ngã cho riêng mình, bởi cô luôn có một chấp niệm rằng con người cũng là một phần của tự nhiên, cũng như việc cô và tiên tử vẫn có thể tìm ra cách thức để chung sống với thứ tình cảm thiêng liêng của mình.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "92aa3c93de523a414a520399bb6a4304", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:17.031', 'Tập 7', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (296, '3400f321cb9fe8a7c2efa0e1edb2eaf5', 'tieu-tien-chi-dao-xiao-xian-zhi-yao', 'Tiểu Tiên Chi Dao (Xiao Xian Zhi Yao)', 'Little Fairy Yao', 'https://phimimg.com/upload/vod/20250804-1/f1e285897d82bc7b5ee42f88042aa898.jpg', 'https://phimimg.com/upload/vod/20250804-1/6c567708ab7a3a6e1c26a23ef5b5f705.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '10 phút/tập', 0, 'Giữa cơn gió lạnh thổi qua chín tầng trời, vị nữ chúa của Ẩn tộc, kẻ khiến tam giới kinh hãi được biết đến với cái tên Hòa Uyển đã bất ngờ dẫn quân xâm lấn Thiên Đình. Không hề nao núng, Nam Trạch, vị thượng thần uy dũng, đứng lên nghênh chiến, được trợ giúp bởi Ngu Chi Dao, một tiên nữ chăm sóc ngọc lan giản dị, liều mình bảo vệ ngài. Giữa thời khắc định mệnh ngàn cân treo sợ bún đồng sinh cộng tử của Nam Trạch và Hòa Uyển, Chi Dao đã chẳng may chết đi nhưng đã được gửi trở lại, và cũng kỳ diệu thay, sự tái sinh này đã đưa cô cộng sinh trong nhục thể của Hoà Uyển. Sức mạnh Ẩn tộc trong cô gần như tan biến. Cùng lúc đó thì Thính Chiêu, một ẩn vệ từ vùng biển Tây Hải đã xuất hiện để hỗ trợ nữ chúa của mình lấy lại thần lực. Từ đó, Chi Dao sống hai cuộc đời: trước bá tánh, cô giữ vẻ uy nghiêm của bậc tôn chủ, nhưng bên người thân thiết, cô hóa thành thiếu nữ nhu mì, nết na.', 'ongoing', 'https://www.youtube.com/watch?v=mIK-lQnMOJU', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Liangwei Hu,Li Ai,王宁,Jiang Qiuzai,姜贺,Zhang Enze,Yuantao Zhang,Yu Minglu', 'Đang cập nhật', '2025-08-17 08:41:18.057', 'Tập 37', '60');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (319, '6d061501b6395b30cfb6aaa256e138af', 'kiem-sac-hoa-hong', 'Kiếm Sắc: Hoa Hồng', 'Sword Rose', 'https://phimimg.com/upload/vod/20250729-1/f8ea3feae674f59b4898fc086ee00722.jpg', 'https://phimimg.com/upload/vod/20250729-1/07e040ca9d9aebb91e7a6027822e9525.jpg', 2025, 'series', 'FHD', 'Vietsub', '45 phút/tập', 0, 'Trong một lần vô tình can thiệp vào một vụ việc khẩn cấp, Đặng Nghiên đã góp công giải cứu một cô gái bị bắt cóc. Tuy nhiên, hành động này lại vô tình làm gián đoạn kế hoạch truy bắt tội phạm mà Phòng Phòng, chống Mua bán người đã dày công chuẩn bị. Sau sự cố đó, cô bất ngờ được bổ nhiệm làm Trưởng phòng mới của đơn vị này. Quyết định bổ nhiệm khiến Thường Duệ – một cảnh sát từng nằm vùng trong các chuyên án chống ma túy – cảm thấy bất mãn. Trong mắt anh, Đặng Nghiên là một Trưởng phòng “nhảy dù”, thiếu kinh nghiệm thực chiến. Thế nhưng, sau khi nhậm chức, Đặng Nghiên đã nhanh chóng khẳng định năng lực chuyên môn, tham gia tích cực vào công tác điều tra phá án và đóng vai trò chủ chốt trong nhiều vụ việc phức tạp. Nhờ vậy, cô dần giành được sự tin tưởng từ các đồng nghiệp và từng bước thay đổi hoàn toàn cách nhìn của Thường Duệ qua quá trình hợp tác. Về phía Thường Duệ, trong quá trình điều tra, anh nhiều lần bị giằng xé giữa tình cảm cá nhân và trách nhiệm nghề nghiệp, khiến bản thân rơi vào bế tắc. Tuy nhiên, nhờ sự động viên từ những người xung quanh, anh dần thức tỉnh và nhận ra trọng trách thiêng liêng của một chiến sĩ chống buôn người, từ đó quyết tâm tiếp tục cống hiến cho sứ mệnh cao cả này. Riêng Đặng Nghiên, cô luôn mang trong mình ngọn lửa căm phẫn với tội ác buôn người – một cảm xúc xuất phát từ nỗi đau khi người bạn thân thuở nhỏ mất tích. Chính điều đó đã thôi thúc cô không ngừng đào sâu điều tra, ứng dụng các công nghệ hiện đại để phá giải hàng loạt vụ án tồn đọng. Khi từng vụ án lần lượt được làm sáng tỏ, một mạng lưới buôn người khổng lồ dần lộ diện. Trong mỗi chiến dịch, Đặng Nghiên ngày càng thấm thía hơn trách nhiệm nặng nề mà cô đang gánh vác. Đối mặt với tình hình phức tạp và những biến cố bất ngờ, dù bản thân rơi vào nguy hiểm, thậm chí có nguy cơ bị hãm hại, cô vẫn kiên trì theo đuổi sự thật đến cùng. Sau khi được minh oan, Đặng Nghiên đã dẫn dắt cả đội bước vào cuộc đối đầu quyết liệt với thế lực ngầm đứng sau những đường dây buôn người.', 'completed', 'https://www.youtube.com/watch?v=PhCT8sYrOpw', NULL, NULL, false, '[{"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Địch Lệ Nhiệt Ba,Kim Thế Giai,Vưu Dũng Trí,Lý Trí,Vương Nghệ Triết,Cao Cơ Tài,Hạ Tinh', 'Tô Vạn Xung', '2025-08-17 08:41:43.896', 'Hoàn Tất (32/32)', '32');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (297, 'b10d25cbe07aeb3bbf6ec350cec76fcc', 'phieu-mieu-kiem-tien-truyen', 'Phiêu Miểu Kiếm Tiên Truyện', 'Legend Of The Misty Sword Immortal', 'https://phimimg.com/upload/vod/20250811-1/8d69b8d19589c20002a676d17e5cc071.jpg', 'https://phimimg.com/upload/vod/20250811-1/631a67d6788ab55ec6765ed359a96254.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub + Thuyết Minh', '12 phút/tập', 0, 'Câu chuyện được bắt đầu từ anh chàng có tên Đông Phương Thiếu Hồng, một anh chàng hiện lên trong mắt của mọi người với những sự giễu cợt hết lần này đến lần khác, nhưng thật sự thì anh ấy lại đáng mến hơn là đáng cười, bởi đôi khi chỉ thiếu may mắn một chút thôi, hoặc có chăng là may mắn quá, hoặc cũng là may mắn chưa đủ nên rơi vào những tình huống cười ra nước mắt, chứ nếu mà đỏ thì quên đi nhé. Số là mang trong mình tới hai loại thể chất của đại đạo, nhưng chính 2 thứ ấy lại bài xích lẫn nhau nên Đông Phương Thiếu Hồng không thể mở ra linh thể cho việc tu luyện bản thân. Đã đen thì chớ, cha của anh chàng lại bị bọn Tiên Minh bắt đi vì ông ấy biết được nhiều bí mật trong việc đi vào Thương Ngọc Tiên Phủ, nơi mà ẩn chứa rất nhiều điều bí mật khác mà bao người vẫn luôn tò mò. Chưa hết, bọn Tiên Minh và những gia tộc khác lại đang cố chèn ép để đưa gia tộc của anh đến mức diệt vong. Uất hận vì tình cảnh ngặt nghèo vậy, Thiếu Hồng đã dùng máu của mình để tạo nên sức mạnh từ Tiên Nguyên Đạo Thạch, đánh lui được bọn Tiên Minh và các gia tộc khác, bảo vệ cho gia tộc mình tạm thời an toàn, nhưng cha của anh thì đã bị bọn khốn Tiên Minh mang đi rồi, buộc anh phải tìm cách để cứu thoát ông ấy. Một vị cố nhân của ông ấy là Quý Dận đã cứu giúp anh, đưa anh đến một miếu tông của ông để tu luyện, phát triển sức mạnh, bởi đó là cách duy nhất anh có thể làm để cứu cha mình.', 'ongoing', 'https://www.youtube.com/watch?v=jO_RAEmKFr8', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:22.355', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (298, 'acc1fc2a7746c567f63c3c0490c35ddc', 'trai-tim-giam-cam', 'Trái Tim Giam Cầm', 'Captive Heart', 'https://phimimg.com/upload/vod/20250620-1/922045b0e59496a8097cee0338b6280a.jpg', 'https://phimimg.com/upload/vod/20250620-1/5cebf9607e52f5a1bcb7fbf5d864559b.jpg', 2025, 'series', 'FHD', 'Vietsub', '56 phút/tập', 0, 'Để trả thù cho gia đình, chàng trai trẻ nọ từ bỏ tình yêu để học tà thuật. Nhiều năm sau, cuộc gặp tình cờ với em gái của kẻ thù cuốn anh vào một thử thách chưa từng có.', 'ongoing', 'https://www.youtube.com/watch?v=cAtaE8NJhro', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Nadech Kugimiya,Rinrada Kaewbuasai,Kummun Klomkaew,Pitchapa Phanthumchinda,Tara Tipa,Kulteera Yordchang,Kanuengpim Thanaphitchakorn,Peerakrit Phacharaboonyakiat,Akekarin Runggran,Suriyont Arunwattanakul,Natthanit Praditthan,Namnung Suttidachana', 'Somching Srisupap', '2025-08-17 08:41:23.378', 'Tập 17', '21');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (299, 'fad68ee497f1cf9108b630e7ce630e6c', 'tien-si-da-hoi-sinh-the-gioi-phan-4', 'Tiến Sĩ Đá: Hồi Sinh Thế Giới (Phần 4)', 'Dr. STONE (Season 4)', 'https://phimimg.com/upload/vod/20250111-1/d23db88980804afd45a326dcc9d12112.jpg', 'https://phimimg.com/upload/vod/20250111-1/70b8653b53be96fa060e99e4d02fcaff.jpg', 2025, 'hoathinh', 'FHD', 'Vietsub', '24 phút/tập', 0, 'Chuyển thể từ manga cùng tên của tác giả Riichiro Inagaki. Lấy bối cảnh tương lai, ngày định mệnh của nhân loại đã đến, một tia sáng kì dị xuất hiện trên địa cầu khiến toàn bộ loài người hóa thành đá. Mấy ngàn năm trôi qua, ngày nọ cậu thiếu niên Senkuu bỗng nhiên phá đá thức tỉnh, trước mắt cậu là những pho tượng hóa đá của nhân loại. Cùng với cậu bạn của mình là Taiju bắt đầu đại nghiệp giải cứu nhân loại. Cuộc phiêu lưu mới bắt đầu, điều gì sẽ chờ đợi Senkuu và Taiju ở phía trước? Đại nghiệp ấy có thành công mỹ mãn hay thất bại trong tuyệt vọng?', 'ongoing', 'https://www.youtube.com/watch?v=8w15gloIYgk', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Đang cập nhật', 'Đang cập nhật', '2025-08-17 08:41:24.321', 'Tập 18', '24');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (300, 'b45da944356527405715c356a9ac9379', 'cuoc-hon-nhan-cua-ho', 'Cuộc Hôn Nhân Của Họ', 'Their Marriage', 'https://phimimg.com/upload/vod/20250725-1/70f6251bb620af4a40c65fcf8bc508c8.jpg', 'https://phimimg.com/upload/vod/20250725-1/3a888b101d040ad32a695dd47068395c.jpg', 2025, 'series', 'FHD', 'Vietsub', '49 phút/tập', 0, 'Sau nhiều năm sống cô độc, luật sư nọ tìm được tri kỷ là một giáo viên mỹ thuật. Nhưng đằng sau mối quan hệ bình yên ấy là một bí mật có thể thay đổi mọi chuyện.', 'ongoing', '', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Sadawo Abe,Takako Matsu,Rihito Itagaki,Yasunori Danta,Takashi Okabe,Reo Tamaoki,Satoshi Kanada,Toru Baba,Nagiko Tsuji,Yosuke Sugino,Keiko Horiuchi,Kazushige Komatsu', 'Hiroshi Kurosaki', '2025-08-17 08:41:25.262', 'Tập 4', '7');
