INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (303, '3680e8e70b3306a6a18479170f61c48f', 'an-mang-trong-con-say', 'Án Mạng Trong Cơn Say', 'The Tipsy Mystery', 'https://phimimg.com/upload/vod/20250723-1/ad4303b483c04c71dc35b5fcfedaed53.jpg', 'https://phimimg.com/upload/vod/20250723-1/139576ef44e6f8a697f72ae135b0e562.jpg', 2025, 'series', 'FHD', 'Vietsub + Thuyết Minh', '59 phút/tập', 0, 'Tỉnh dậy sau một đêm ăn chơi trác táng, bà đồng Phing cùng bốn tay sát gái khét tiếng Pi, Ter, Jock và Dung phát hiện thi thể lạnh ngắt của Bam, cô gái đã cùng tiệc tùng với họ đêm hôm trước. Phing cố gắng dùng năng lực của mình để liên lạc với hồn ma của Bam và tìm ra hung thủ. Trớ trêu thay, lúc bị sát hạt Bam lại say đến mức ngay cả hồn ma của cô cũng không nhớ chuyện gì đã xảy ra. Phing sẽ phải làm thế nào để vạch trần sự thật phía sau vụ Án Mạng Trong Cơn Say này?', 'completed', 'https://www.youtube.com/watch?v=3JycvMLfevM', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "2fb53017b3be83cd754a08adab3e916c", "name": "Bí Ẩn", "slug": "bi-an"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}]', '[{"id": "cefbf1640a17bad1e13c2f6f2a811a2d", "name": "Thái Lan", "slug": "thai-lan"}]', 'Engfa Waraha,Porapat Srikajorn,Rachata Hampanont,Sarun Naraprasertkul,Nichaphat Chatchaipholrat,Cholawit Meetongcom,Supathat Opas', 'Prueksa Amaruji', '2025-08-17 08:41:28.193', 'Hoàn Tất (8/8)', '8');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (304, '2f1f0bdbb82e8f2a7ab031d8f2a13ee1', '6-vien-da-vang', '6 Viên Đá Vàng', 'Golden SixTONES', 'https://phimimg.com/upload/vod/20250620-1/cc6691d4af0f6898d1189acba5d09f5b.jpg', 'https://phimimg.com/upload/vod/20250620-1/6cb392134f2e9564841005719746e088.jpg', 2025, 'tvshows', 'FHD', 'Vietsub', '60 phút/tập', 0, '6 Viên Đá Vàng là một show truyền hình vui nhộn, nơi các thành viên tham gia những thử thách thú vị, dự án độc đáo và các phân đoạn ẩm thực hấp dẫn. Với sự xuất hiện của nhiều khách mời nổi tiếng, chương trình mang đến một không khí giải trí sôi động, hài hước và đầy bất ngờ, thể hiện trọn vẹn cá tính dí dỏm và năng lượng trẻ trung của nhóm.', 'completed', 'https://www.youtube.com/watch?v=twPR8E03tvE', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "b8f81b0defa84c5a7ac72bcdbcee8bb8", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Yugo Kochi,Taiga Kyomoto,Juri Tanaka,Hokuto Matsumura,Lewis Jesse,Shintaro Morimoto', 'Đang cập nhật', '2025-08-17 08:41:29.152', 'Hoàn Tất (10/10)', '10');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (305, 'd9c9af41dda3bd35df1fddd4ff2b9b2b', 'tieng-on-quy-di-2025', 'Tiếng Ồn Quỷ Dị', 'Noise', 'https://phimimg.com/upload/vod/20250815-1/d2b88793394d6c3c6c006bdc517826b0.jpg', 'https://phimimg.com/upload/vod/20250815-1/3d49327392760934c7ba577a8deb767b.jpg', 2025, 'single', 'FHD', 'Vietsub', '95 phút', 0, 'TIẾNG ỒN QUỶ DỊ là câu chuyện về hai chị em Joo Young và Joo Hee. Sau khi dọn vào căn hộ mới, cả hai liên tục bị quấy nhiễu bởi những tiếng động kỳ quái phát ra từ giữa các tầng – thứ âm thanh âm ỉ, vặn vẹo như thể có ai đó… hoặc thứ gì đó đang sống giữa các bức tường. Rồi một ngày, Joo Hee biến mất không dấu vết. Joo Young cùng bạn trai của em gái lao vào cuộc truy tìm trong vô vọng – khi càng đào sâu, họ càng tiến gần đến một bí mật đen tối bị chôn vùi sau những bức tường cách âm. Cùng lúc đó, người đàn ông sống tầng dưới cũng bị tra tấn bởi chính thứ âm thanh đó và tin rằng, con quái vật nằm ngay trong căn hộ của hai chị em.', 'completed', 'https://www.youtube.com/watch?v=2vCBuo0AESI', NULL, NULL, false, '[{"id": "4db8d7d4b9873981e3eeb76d02997d58", "name": "Kinh Dị", "slug": "kinh-di"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "05de95be5fc404da9680bbb3dd8262e6", "name": "Hàn Quốc", "slug": "han-quoc"}]', 'Lee Sun-bin,Kim Min-seok,Jeon Ik-ryoung,Ryu Kyung-soo,Han Su-ah,Baek Joo-hee', 'Kim Soo-jin', '2025-08-17 08:41:30.138', 'Full', '1');
