INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (308, '9d38100800ba194b7852be19dc1b289b', 'mua-gat', 'Mùa Gặt', 'Harvest', 'https://phimimg.com/upload/vod/20250815-1/a0599938ea710e2b51d7e2c93eee6b14.jpg', 'https://phimimg.com/upload/vod/20250815-1/b1ba8a8ac8eee31521f72e7366d28d0d.jpg', 2025, 'single', 'FHD', 'Vietsub', '131 phút', 0, 'Trong bảy ngày mơ hồ như ảo giác, một ngôi làng vô danh một thời và nơi chốn không xác định dần biến mất. Walter Thirsk – một dân làng trở thành nông dân – và Charles Kent – vị lãnh chúa ngơ ngác của trang viên – là đôi bạn từ thuở nhỏ, nay cùng đối mặt với cuộc xâm lăng từ thế giới bên ngoài: cú sốc của thời hiện đại.', 'completed', 'https://www.youtube.com/watch?v=EbCcz0OzhtQ', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Caleb Landry Jones,Harry Melling,Rosy McEwen,Arinzé Kene,Thalissa Teixeira,Frank Dillane,Stephen McMillan,Mitchell Robertson,Grace Jabbari,Gordon Brown,Neil Leiper,Emma Hindle,Gary Maitland,Noor Dillan-Night,Antonia Quirke,Logan Buchanan,R', 'Athina Rachel Tsangari', '2025-08-17 08:41:33.108', 'Full', '1');
