INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (312, '793d2101fe21893b3d463a6600eead38', 'ke-ngu-cu-2025', 'Kẻ Ngụ Cư', 'The Occupant', 'https://phimimg.com/upload/vod/20250813-1/8dd329225a4b3662007f59d99b7cf844.jpg', 'https://phimimg.com/upload/vod/20250813-1/e04d4b0546b4a77ed0c3c9788cea2dbf.jpg', 2025, 'single', 'FHD', 'Vietsub', '104 phút', 0, 'Vì tuyệt vọng muốn cứu em gái, Abby nhận một công việc nguy hiểm ở vùng hoang dã hẻo lánh của Georgia. Khi trực thăng gặp nạn và cô bị mắc kẹt giữa núi rừng, Abby tìm thấy tia hy vọng qua giọng nói của John – một người bí ẩn liên lạc qua radio từ gần đó. Khi anh hướng dẫn cô vượt qua điều kiện khắc nghiệt, Abby vừa chiến đấu để sinh tồn vừa dần mất đi sự tỉnh táo, cho đến khi phải đối mặt với một lựa chọn không thể ngờ tới.', 'completed', 'https://www.youtube.com/watch?v=1ekDq7HCpKA', NULL, NULL, false, '[{"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "eada819634d0164c6a7547bdcc405033", "name": "Georgia", "slug": "georgia"}, {"id": "41487913363f08e29ea07f6fdfb49a41", "name": "Hà Lan", "slug": "ha-lan"}, {"id": "932bbaca386ee0436ad0159117eabae4", "name": "Anh", "slug": "anh"}, {"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Ella Balinska,Rob Delaney,Vanessa Ifediora,Stuart Graham,George Lasha,Konstantine Roinishvili,Armin Karima', 'Hugo Keijzer', '2025-08-17 08:41:37.102', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (313, '98c2473648afc991669f9b9334c11072', 'jim-jefferies-chinh-sach-hai-chi', 'Jim Jefferies: Chính Sách Hai Chi', 'Jim Jefferies: Two Limb Policy', 'https://phimimg.com/upload/vod/20250815-1/b040cd9b0505045821214fe7dc6d6ee7.jpg', 'https://phimimg.com/upload/vod/20250815-1/f0f37c31ad37b287ad5fa4fa840c407b.jpg', 2025, 'single', 'FHD', 'Vietsub', '62 phút', 0, 'Diễn viên hài Jim Jefferies bộc lộ suy nghĩ của mình về những bộ ria mép tí hon, những khó khăn của đàn ông dị tính và lý do vì sao ông cho rằng diễn xuất không được tính là một công việc thực sự.', 'completed', 'https://www.youtube.com/watch?v=078p_FjZC_4', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "af5c50bf625c1da71838678a5cf37189", "name": "Âu Mỹ", "slug": "au-my"}]', 'Jim Jefferies', 'Scott Zabielski', '2025-08-17 08:41:38.127', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (314, '90d048af68ca32e1bfb1d645e35ab644', 'hau-cung', 'Hậu Cung', 'The Concubine', 'https://phimimg.com/upload/vod/20250808-1/6c55fab9cd58bb2e872b4419fc6e8cc4.jpg', 'https://phimimg.com/upload/vod/20250808-1/8e2d369c259704b9949f01af1f1467b7.jpg', 2012, 'single', 'FHD', 'Vietsub', '122 phút', 0, 'Là những năm đầu của triều đại Chosun, bộ phim xoay quanh ba nhân vật: Hwa Yeon, con gái của một tướng quân đương triều, người đã chấp nhận tiến cung để bảo vệ người yêu. Kwon Yoo, người đàn ông luôn bị dằng xé giữa tình yêu và thù hận. Vua Seong Won với tình yêu đầy đam mê nhục dục với Hwa Yeon dù có biết bao cung tần vây quanh.
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (315, 'd690d0cd274a05efe2a0a58dac0d9461', 'thi-tran-trong-con-dich', 'Thị Trấn Trong Cơn Dịch', 'Eddington', 'https://phimimg.com/upload/vod/20250815-1/d6f998d963f3ae4fd9f21e51706cb3c1.jpg', 'https://phimimg.com/upload/vod/20250815-1/351c0a69600ba6b68caf4fdab73787f6.jpg', 2025, 'single', 'FHD', 'Vietsub', '149 phút', 0, 'Giữa đại dịch COVID-19, thị trấn nhỏ Eddington, New Mexico chìm trong hỗn loạn khi cuộc tranh chấp giữa cảnh sát trưởng Joe Cross phản đối đeo khẩu trang và thị trưởng Ted Garcia ủng hộ xây trung tâm dữ liệu AI leo thang thành chiến tuyến chính trị, cuốn cả gia đình, cộng đồng vào vòng xoáy cực đoan, bạo lực và tan rã – phản chiếu một nước Mỹ chia rẽ', 'completed', 'https://www.youtube.com/watch?v=ytyBfsqN3eI', NULL, NULL, false, '[{"id": "d111447ee87ec1a46a31182ce4623662", "name": "Miền Tây", "slug": "mien-tay"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "7a035ac0b37f5854f0f6979260899c90", "name": "Hình Sự", "slug": "hinh-su"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}, {"id": "a6eab26efda9c1479389e87ad763af11", "name": "Phần Lan", "slug": "phan-lan"}]', 'Joaquin Phoenix,Pedro Pascal,Luke Grimes,Deirdre O&#039;Connell,Micheal Ward,Austin Butler,Emma Stone,Cameron Mann,Matt Gomez Hidaka,Amélie Hoeferle,Clifton Collins Jr.,William Belleau,Landall Goolsby,Elise Falanga,King Orba,Rachel de la To', 'Ari Aster', '2025-08-17 08:41:40.06', 'Full', '1');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (316, '8ddc98fe6483c3ecddcb687eb2d30d37', 'tram-nam-hoa-hop-uoc-dinh-mot-loi', 'Trăm Năm Hòa Hợp, Ước Định Một Lời', 'Forever Love', 'https://phimimg.com/upload/vod/20250815-1/18c53992b9988c7965973cd9a7701b41.jpg', 'https://phimimg.com/upload/vod/20250815-1/a372c6112ae2faa41cb33f149a982552.jpg', 2020, 'series', 'FHD', 'Vietsub + Thuyết Minh', '45 phút/tập', 0, 'Câu chuyện xoay quanh cuộc sống vườn trường đầy hoài bão và ước vọng đậu đại học. Trong đó, cặp đôi chính Tưởng Chính Hàn (Vương An Vũ) và Hạ Lâm Hy (Hướng Hàm Chi) ngay từ lần đầu gặp gỡ đã được gọi là &quot;oan gia ngõ hẹp&quot;. Vì là lớp trưởng nên Lâm Hy buộc phải quan tâm đến sự hiện diện trong lớp của tất cả mọi người, nếu ai vắng mặt, cô phải thay giáo viên tìm hiểu ngọn ngành.', 'completed', 'https://www.youtube.com/watch?v=oIjTakqPUyA', NULL, NULL, false, '[{"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}, {"id": "bb2b4b030608ca5984c8dd0770f5b40b", "name": "Tình Cảm", "slug": "tinh-cam"}, {"id": "a7b065b92ad356387ef2e075dee66529", "name": "Tâm Lý", "slug": "tam-ly"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Vương An Vũ,Hướng Hàm Chi,Trần Trạch,Phan Mỹ Diệp,Viên Hạo,Triệu Hạo Hoằng', 'Văn Đức Quang', '2025-08-17 08:41:41.036', 'Hoàn Tất (28/28)', '28');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (317, '1f6325d1b1080e812e7b713ae61f4ebc', 'family-guy-phan-1', 'Family Guy (Phần 1)', 'Family Guy (Season 1)', 'https://phimimg.com/upload/vod/20250815-1/f345f125fbb6dcd6b1f61e179ad80a2a.jpg', 'https://phimimg.com/upload/vod/20250815-1/dce44dd4d1fe1b2df5ff6f285984a8a3.jpg', 1999, 'hoathinh', 'FHD', 'Vietsub', '22 phút/tập', 0, 'Bộ phim xoay quanh những cuộc phiêu lưu và hoạt động thường nhật của gia đình Griffin, bao gồm trụ cột gia đình Peter Griffin, một người đàn ông béo phì trung niên ngốc nghếch và vụng về làm việc trong nhà máy bia, Lois, nội trợ kiêm giáo viên dạy piano, vốn xuất thân từ gia đình tài phiệt Pewterschmidt, Meg, một cô bé 18 tuổi thường xuyên bị bắt nạt, Chris, cậu bé 15 tuổi thừa cân và cư xử ngốc nghếch giống Peter và Stewie, một bé trai 1 tuổi thông minh nhưng tinh ranh và đôi khi nham hiểm, cư xử theo cách của một người trưởng thành. Sống cùng gia đình là Brian, chú chó được nhân cách hóa, với nhiều thói quen của con người như hút thuốc, uống rượu martini, mặc dù về nhiều mặt vẫn được coi là thú cưng.', 'completed', '', NULL, NULL, false, '[{"id": "ba6fd52e5a3aca80eaaf1a3b50a182db", "name": "Hài Hước", "slug": "hai-huoc"}]', '[{"id": "74d9fa92f4dea9ecea8fc2233dc7921a", "name": "Âu Mỹ", "slug": "au-my"}]', 'Seth MacFarlane,Alex Borstein,Mila Kunis,Seth Green,Patrick Warburton,Arif Zahir', 'Đang cập nhật', '2025-08-17 08:41:41.993', 'Hoàn Tất (7/7)', '7');
