INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (331, '1d03841ea08e08c6e1c43cee7e07aaaa', 'am-duong-luan-hoi', 'Âm Dương Luân Hồi', 'Onmyo Kaiten Re:Birth Verse', 'https://phimimg.com/upload/vod/20250720-1/5a73b38e3678bbb6ae65bad2c8a453c7.jpg', 'https://phimimg.com/upload/vod/20250720-1/5417c961381a7339034234ee93290d39.jpg', 2025, 'series', 'FHD', 'Vietsub', '23 phút/tập', 0, 'Narihira Takeru là một tên du côn thường xuyên mơ về Tsukimiya – cô gái xuất hiện trong giấc mơ của anh. Sau một tai nạn bất ngờ, Takeru thấy mình lạc vào một vũ trụ song song – thế giới mà Tsukimiya đang sống. Khi cả hai bị quái vật giết chết, Takeru lại tỉnh dậy và nhận ra mình đã nhảy qua dòng thời gian. Từ đây, Takeru phải tu luyện cùng Abe Seimei để chiến đấu bảo vệ mạng sống của Tsukimiya!', 'ongoing', 'https://www.youtube.com/watch?v=TiqUhC4_hSg', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "0bcf4077916678de9b48c89221fcf8ae", "name": "Khoa Học", "slug": "khoa-hoc"}, {"id": "68564911f00849030f9c9c144ea1b931", "name": "Viễn Tưởng", "slug": "vien-tuong"}]', '[{"id": "d4097fbffa8f7149a61281437171eb83", "name": "Nhật Bản", "slug": "nhat-ban"}]', 'Taihi Kimura,Maaya Uchida,Ryohei Kimura,Kaito Ishikawa,Anna Nagase,Marina Inoue,Chihaya Yoshitake', 'Đang cập nhật', '2025-08-17 08:41:55.84', 'Tập 7', '12');
INSERT INTO public.movies (id, movie_id, slug, name, origin_name, poster_url, thumb_url, year, type, quality, lang, "time", view, description, status, trailer_url, sections, section, is_recommended, categories, countries, actors, directors, modified_at, episode_current, episode_total) VALUES (332, 'f45fe3f64d37932f037761c6bf9a46db', 'tay-du-ky-phan-1', 'Tây Du Ký (Phần 1)', 'Journey To The West (Season 1)', 'https://phimimg.com/upload/vod/20250814-1/f39af4b6efc136cfe442f839161a5f63.jpg', 'https://phimimg.com/upload/vod/20250814-1/331ba7ce5ee7495c00b9bd9ddcd1bd37.jpg', 1986, 'series', 'FHD', 'Thuyết Minh + Lồng Tiếng', '45 phút/tập', 0, 'Bộ phim ra đời trong hoàn cảnh khó khăn do được sản xuất vào thập kỉ 1980 thời mà kĩ xảo điện ảnh còn thô sơ lạc hậu. Vốn đầu tư 6 triệu nhân dân tệ tuy là một khoản tiền rất lớn nhưng cũng không đủ trang trải cho toàn bộ phim, các diễn viên cũng chỉ nhận được thù lao tượng trưng, ít ỏi. Phim được làm trong 6 năm trời ròng rã từ năm 1982 đến năm 1988 hoàn thành. Nhiều thông tin cung cấp năm 1986 bộ phim chính thức trình chiếu cho khán thính giả và nhận thấy có nhiều phần thiếu sót nên tiếp tục đầu tư xây dựng và mãi đến năm 1988 thì chính thức hoàn thiện. &nbsp;Đặc biệt, trong 20 năm qua, phim đã nhiều lần phát sóng lại, mỗi lần cả người lớn và trẻ em đều háo hức đón xem. Có thể nói, bản phim Tây Du Kí 1986 đã sống mãi với thời gian và ăn sâu trong kí ức của nhiều thế hệ khán giả. Hầu hết các đài truyền hình của Việt Nam đều ít nhất trình chiếu một lần. Có đài phát sóng đến gần 10 lần và trình chiếu đi và chiếu lại suốt nhiều năm liền.', 'completed', 'https://www.youtube.com/watch?v=K3KNpyKILHM', NULL, NULL, false, '[{"id": "9822be111d2ccc29c7172c78b8af8ff5", "name": "Hành Động", "slug": "hanh-dong"}, {"id": "66c78b23908113d478d8d85390a244b4", "name": "Phiêu Lưu", "slug": "phieu-luu"}, {"id": "37a7b38b6184a5ebd3c43015aa20709d", "name": "Chính Kịch", "slug": "chinh-kich"}, {"id": "2276b29204c46f75064735477890afd6", "name": "Thần Thoại", "slug": "than-thoai"}, {"id": "268385d0de78827ff7bb25c35036ee2a", "name": "Kinh Điển", "slug": "kinh-dien"}]', '[{"id": "3e075636c731fe0f889c69e0bf82c083", "name": "Trung Quốc", "slug": "trung-quoc"}]', 'Lục Tiểu Linh Đồng,Từ Thiếu Hoa,Uông Việt,Trì Trọng Thụy,Mã Đức Hoa,Diêm Hoài Lễ,Từ Huệ Kính', 'Dương Khiết', '2025-08-17 08:41:56.868', 'Hoàn Tất (25/25)', '25');
